	__Documentation__000000_Schema_Inlined_Inlined.Name = `Schema_Inlined_Inlined`
	__Documentation__000000_Schema_Inlined_Inlined.Text = `The score is the root element for the schema. It includes the score-header
            group, followed either by a series of parts with measures inside (score-partwise) or a
            series of measures with parts inside (score-timewise). Having distinct top-level
            elements for partwise and timewise scores makes it easy to ensure that an XSLT
            stylesheet does not try to transform a document already in the desired format.`
	__Documentation__000000_Schema_Inlined_Inlined.Source = ``
	__Documentation__000000_Schema_Inlined_Inlined.Lang = ``

	__Documentation__000001_Schema_Inlined_Inlined.Name = `Schema_Inlined_Inlined`
	__Documentation__000001_Schema_Inlined_Inlined.Text = `MusicXML W3C XML schema (XSD) Version 4.0 Copyright © 2004-2021 the
            Contributors to the MusicXML Specification, published by the W3C Music Notation
            Community Group under the W3C Community Final Specification Agreement (FSA):
            https://www.w3.org/community/about/agreements/final/ A human-readable summary is
            available: https://www.w3.org/community/about/agreements/fsa-deed/ This is the W3C XML
            Schema (XSD) version of the MusicXML 4.0 format. Validation is tightened by moving
            MusicXML definitions from comments into schema data types and definitions. Character
            entities and other entity usages that are not supported in W3C XML Schema have been
            removed. The features of W3C XML Schema make it easier to define variations of the
            MusicXML format, either via extension or restriction. This file defines the MusicXML 4.0
            XSD, including the score-partwise and score-timewise document elements. The XML catalog
            at catalog.xml supports validating against a local copy of this XSD rather than the
            networked version. Software often has trouble using system IDs due to factors such as
            restrictions on network access, or resources having moved from the original specified
            location. To validate with the MusicXML XSD, use a schema URI of
            "http://www.musicxml.org/xsd/musicxml.xsd".`
	__Documentation__000001_Schema_Inlined_Inlined.Source = ``
	__Documentation__000001_Schema_Inlined_Inlined.Lang = ``

	__Documentation__000002_Schema_Inlined_Inlined.Name = `Schema_Inlined_Inlined`
	__Documentation__000002_Schema_Inlined_Inlined.Text = `The MusicXML 4.0 DTD has no namespace, so for compatibility the MusicXML
            4.0 XSD has no namespace either. Those who need to import the MusicXML XSD into another
            schema are advised to create a new version that uses
            "http://www.musicxml.org/xsd/MusicXML" as the namespace.`
	__Documentation__000002_Schema_Inlined_Inlined.Source = ``
	__Documentation__000002_Schema_Inlined_Inlined.Lang = ``

	__Documentation__000003__Inlined.Name = `_Inlined`
	__Documentation__000003__Inlined.Text = `In cases where text extends over more than one line, horizontal
                alignment and justify values can be different. The most typical case is for credits,
                such as: Words and music by Pat Songwriter Typically this type of credit is aligned
                to the right, so that the position information refers to the right-most part of the
                text. But in this example, the text is center-justified, not right-justified. The
                halign attribute is used in these situations. If it is not present, its value is the
                same as for the justify attribute. For elements where a justify attribute is not
                allowed, the default is implementation-dependent.`
	__Documentation__000003__Inlined.Source = ``
	__Documentation__000003__Inlined.Lang = ``

	__Documentation__000004__Inlined.Name = `_Inlined`
	__Documentation__000004__Inlined.Text = `The text-formatting attribute group collects the common formatting
                attributes for text elements. Default values may differ across the elements that use
                this group.`
	__Documentation__000004__Inlined.Source = ``
	__Documentation__000004__Inlined.Lang = ``

	__Documentation__000005__Inlined.Name = `_Inlined`
	__Documentation__000005__Inlined.Text = `The score-partwise element is the root element for a partwise MusicXML
                score. It includes a score-header group followed by a series of parts with measures
                inside. The document-attributes attribute group includes the version attribute.`
	__Documentation__000005__Inlined.Source = ``
	__Documentation__000005__Inlined.Lang = ``

	__Documentation__000006__Inlined.Name = `_Inlined`
	__Documentation__000006__Inlined.Text = `The inverted-mordent element represents the sign without
                            the vertical line. The choice of which mordent is inverted differs
                            between MusicXML and SMuFL. The long attribute is "no" by default.`
	__Documentation__000006__Inlined.Source = ``
	__Documentation__000006__Inlined.Lang = ``

	__Documentation__000007__Inlined.Name = `_Inlined`
	__Documentation__000007__Inlined.Text = `The symbol element specifies a musical symbol using a
                            canonical SMuFL glyph name. It is used when an occasional musical symbol
                            is interspersed into text. It should not be used in place of semantic
                            markup, such as metronome marks that mix text and symbols. Left
                            justification is used if not specified. Enclosure is none if not
                            specified.`
	__Documentation__000007__Inlined.Source = ``
	__Documentation__000007__Inlined.Lang = ``

	__Documentation__000008__Inlined.Name = `_Inlined`
	__Documentation__000008__Inlined.Text = `The actual-notes element describes how many notes are played
                        in the time usually occupied by the number in the normal-notes element.`
	__Documentation__000008__Inlined.Source = ``
	__Documentation__000008__Inlined.Lang = ``

	__Documentation__000009__Inlined.Name = `_Inlined`
	__Documentation__000009__Inlined.Text = `The sign element represents the clef symbol.`
	__Documentation__000009__Inlined.Source = ``
	__Documentation__000009__Inlined.Lang = ``

	__Documentation__000010__Inlined.Name = `_Inlined`
	__Documentation__000010__Inlined.Text = `The text-decoration attribute group is based on the similar feature in
                XHTML and CSS. It allows for text to be underlined, overlined, or struck-through. It
                extends the CSS version by allow double or triple lines instead of just being on or
                off.`
	__Documentation__000010__Inlined.Source = ``
	__Documentation__000010__Inlined.Lang = ``

	__Documentation__000011__Inlined.Name = `_Inlined`
	__Documentation__000011__Inlined.Text = `The symbol-formatting attribute group collects the common formatting
                attributes for musical symbols. Default values may differ across the elements that
                use this group.`
	__Documentation__000011__Inlined.Source = ``
	__Documentation__000011__Inlined.Lang = ``

	__Documentation__000012__Inlined.Name = `_Inlined`
	__Documentation__000012__Inlined.Text = `One dot element is used for each dot of prolongation. The
                        placement attribute is used to specify whether the dot should appear above
                        or below the staff line. It is ignored for notes that appear on a staff
                        space.`
	__Documentation__000012__Inlined.Source = ``
	__Documentation__000012__Inlined.Lang = ``

	__Documentation__000013__Inlined.Name = `_Inlined`
	__Documentation__000013__Inlined.Text = `Musical notation duration is commonly represented as
                        fractions. The divisions element indicates how many divisions per quarter
                        note are used to indicate a note's duration. For example, if duration = 1
                        and divisions = 2, this is an eighth note duration. Duration and divisions
                        are used directly for generating sound output, so they must be chosen to
                        take tuplets into account. Using a divisions element lets us use just one
                        number to represent a duration for each note in the score, while retaining
                        the full power of a fractional representation. If maximum compatibility with
                        Standard MIDI 1.0 files is important, do not have the divisions value exceed
                        16383.`
	__Documentation__000013__Inlined.Source = ``
	__Documentation__000013__Inlined.Lang = ``

	__Documentation__000014__Inlined.Name = `_Inlined`
	__Documentation__000014__Inlined.Text = `The staccatissimo element is used for a wedge articulation, as
                        opposed to a dot or a stroke.`
	__Documentation__000014__Inlined.Source = ``
	__Documentation__000014__Inlined.Lang = ``

	__Documentation__000015__Inlined.Name = `_Inlined`
	__Documentation__000015__Inlined.Text = `The level-display attribute group specifies three common ways to
                indicate editorial indications: putting parentheses or square brackets around a
                symbol, or making the symbol a different size. If not specified, they are left to
                application defaults. It is used by the level and accidental elements.`
	__Documentation__000015__Inlined.Source = ``
	__Documentation__000015__Inlined.Lang = ``

	__Documentation__000016__Inlined.Name = `_Inlined`
	__Documentation__000016__Inlined.Text = `The fingernails element is used in notation for harp and other
                        plucked string instruments.`
	__Documentation__000016__Inlined.Source = ``
	__Documentation__000016__Inlined.Lang = ``

	__Documentation__000017__Inlined.Name = `_Inlined`
	__Documentation__000017__Inlined.Text = `The touching-pitch is the pitch at which the string is
                            touched lightly to produce the harmonic.`
	__Documentation__000017__Inlined.Source = ``
	__Documentation__000017__Inlined.Lang = ``

	__Documentation__000018__Inlined.Name = `_Inlined`
	__Documentation__000018__Inlined.Text = `The end-line element comes from RP-017 for Standard MIDI File
                        Lyric meta-events. It facilitates lyric display for Karaoke and similar
                        applications.`
	__Documentation__000018__Inlined.Source = ``
	__Documentation__000018__Inlined.Lang = ``

	__Documentation__000019__Inlined.Name = `_Inlined`
	__Documentation__000019__Inlined.Text = `Duration is a positive number specified in division units.
                        This is the intended duration vs. notated duration (for instance,
                        differences in dotted notes in Baroque-era music). Differences in duration
                        specific to an interpretation or performance should be represented using the
                        note element's attack and release attributes. The duration element moves the
                        musical position when used in backup elements, forward elements, and note
                        elements that do not contain a chord child element.`
	__Documentation__000019__Inlined.Source = ``
	__Documentation__000019__Inlined.Lang = ``

	__Documentation__000020__Inlined.Name = `_Inlined`
	__Documentation__000020__Inlined.Text = `Directives are like directions, but can be grouped together
                        with attributes for convenience. This is typically used for tempo markings
                        at the beginning of a piece of music. This element was deprecated in Version
                        2.0 in favor of the direction element's directive attribute. Language names
                        come from ISO 639, with optional country subcodes from ISO 3166.`
	__Documentation__000020__Inlined.Source = ``
	__Documentation__000020__Inlined.Lang = ``

	__Documentation__000021__Inlined.Name = `_Inlined`
	__Documentation__000021__Inlined.Text = `The midi-name element corresponds to a ProgramName meta-event
                        within a Standard MIDI File.`
	__Documentation__000021__Inlined.Source = ``
	__Documentation__000021__Inlined.Lang = ``

	__Documentation__000022__Inlined.Name = `_Inlined`
	__Documentation__000022__Inlined.Text = `The rehearsal element specifies letters, numbers, and section
                        names that are notated in the score for reference during rehearsal. The
                        enclosure is square if not specified. The language is Italian ("it") if not
                        specified. Left justification is used if not specified.`
	__Documentation__000022__Inlined.Source = ``
	__Documentation__000022__Inlined.Lang = ``

	__Documentation__000023__Inlined.Name = `_Inlined`
	__Documentation__000023__Inlined.Text = `The plop element is an indeterminate slide attached to a
                        single note. The plop appears before the main note and comes from above the
                        main pitch.`
	__Documentation__000023__Inlined.Source = ``
	__Documentation__000023__Inlined.Lang = ``

	__Documentation__000024__Inlined.Name = `_Inlined`
	__Documentation__000024__Inlined.Text = `The ipa element represents International Phonetic Alphabet
                            (IPA) sounds for vocal music. String content is limited to IPA 2015
                            symbols represented in Unicode 13.0.`
	__Documentation__000024__Inlined.Source = ``
	__Documentation__000024__Inlined.Lang = ``

	__Documentation__000025__Inlined.Name = `_Inlined`
	__Documentation__000025__Inlined.Text = `The trill-mark element represents the trill-mark symbol.`
	__Documentation__000025__Inlined.Source = ``
	__Documentation__000025__Inlined.Lang = ``

	__Documentation__000026__Inlined.Name = `_Inlined`
	__Documentation__000026__Inlined.Text = `The triple-tongue element represents the triple tongue symbol
                        (three dots arranged horizontally).`
	__Documentation__000026__Inlined.Source = ``
	__Documentation__000026__Inlined.Lang = ``

	__Documentation__000027__Inlined.Name = `_Inlined`
	__Documentation__000027__Inlined.Text = `The line-length attribute distinguishes between different line lengths
                for doit, falloff, plop, and scoop articulations.`
	__Documentation__000027__Inlined.Source = ``
	__Documentation__000027__Inlined.Lang = ``

	__Documentation__000028__Inlined.Name = `_Inlined`
	__Documentation__000028__Inlined.Text = `The valign attribute is used to indicate vertical alignment to the
                top, middle, bottom, or baseline of the text. Defaults are implementation-dependent.`
	__Documentation__000028__Inlined.Source = ``
	__Documentation__000028__Inlined.Lang = ``

	__Documentation__000029__Inlined.Name = `_Inlined`
	__Documentation__000029__Inlined.Text = `The capo element indicates at which fret a capo should be
                        placed on a fretted instrument. This changes the open tuning of the strings
                        specified by staff-tuning by the specified number of half-steps.`
	__Documentation__000029__Inlined.Source = ``
	__Documentation__000029__Inlined.Lang = ``

	__Documentation__000030__Inlined.Name = `_Inlined`
	__Documentation__000030__Inlined.Text = `The scoop element is an indeterminate slide attached to a
                        single note. The scoop appears before the main note and comes from below the
                        main pitch.`
	__Documentation__000030__Inlined.Source = ``
	__Documentation__000030__Inlined.Lang = ``

	__Documentation__000031__Inlined.Name = `_Inlined`
	__Documentation__000031__Inlined.Text = `The function element represents classical functional
                            harmony with an indication like I, II, III rather than C, D, E. It
                            represents the Roman numeral part of a functional harmony rather than
                            the complete function itself. It has been deprecated as of MusicXML 4.0
                            in favor of the numeral element.`
	__Documentation__000031__Inlined.Source = ``
	__Documentation__000031__Inlined.Lang = ``

	__Documentation__000032__Inlined.Name = `_Inlined`
	__Documentation__000032__Inlined.Text = `The instrument-sound element describes the default timbre of
                        the score-instrument. This description is independent of a particular
                        virtual or MIDI instrument specification and allows playback to be shared
                        more easily between applications and libraries.`
	__Documentation__000032__Inlined.Source = ``
	__Documentation__000032__Inlined.Lang = ``

	__Documentation__000033__Inlined.Name = `_Inlined`
	__Documentation__000033__Inlined.Text = `The print-style attribute group collects the most popular combination
                of printing attributes: position, font, and color.`
	__Documentation__000033__Inlined.Source = ``
	__Documentation__000033__Inlined.Lang = ``

	__Documentation__000034__Inlined.Name = `_Inlined`
	__Documentation__000034__Inlined.Text = `The dashed-formatting entity represents the length of dashes and
                spaces in a dashed line. Both the dash-length and space-length attributes are
                represented in tenths. These attributes are ignored if the corresponding line-type
                attribute is not dashed.`
	__Documentation__000034__Inlined.Source = ``
	__Documentation__000034__Inlined.Lang = ``

	__Documentation__000035__Inlined.Name = `_Inlined`
	__Documentation__000035__Inlined.Text = `The placement attribute indicates whether something is above or below
                another element, such as a note or a notation.`
	__Documentation__000035__Inlined.Source = ``
	__Documentation__000035__Inlined.Lang = ``

	__Documentation__000036__Inlined.Name = `_Inlined`
	__Documentation__000036__Inlined.Text = `The rights element is borrowed from Dublin Core. It contains
                        copyright and other intellectual property notices. Words, music, and
                        derivatives can have different types, so multiple rights elements with
                        different type attributes are supported. Standard type values are music,
                        words, and arrangement, but other types may be used. The type attribute is
                        only needed when there are multiple rights elements.`
	__Documentation__000036__Inlined.Source = ``
	__Documentation__000036__Inlined.Lang = ``

	__Documentation__000037__Inlined.Name = `_Inlined`
	__Documentation__000037__Inlined.Text = `The instrument-name element is typically used within a
                        software application, rather than appearing on the printed page of a score.`
	__Documentation__000037__Inlined.Source = ``
	__Documentation__000037__Inlined.Lang = ``

	__Documentation__000038__Inlined.Name = `_Inlined`
	__Documentation__000038__Inlined.Text = `The accordion-low element indicates the presence of a dot in
                        the low (16') section of the registration symbol. This element is omitted if
                        no dot is present.`
	__Documentation__000038__Inlined.Source = ``
	__Documentation__000038__Inlined.Lang = ``

	__Documentation__000039__Inlined.Name = `_Inlined`
	__Documentation__000039__Inlined.Text = `The element and position attributes are new as of Version 2.0. They
                allow for bookmarks and links to be positioned at higher resolution than the level
                of music-data elements. When no element and position attributes are present, the
                bookmark or link element refers to the next sibling element in the MusicXML file.
                The element attribute specifies an element type for a descendant of the next sibling
                element that is not a link or bookmark. The position attribute specifies the
                position of this descendant element, where the first position is 1. The position
                attribute is ignored if the element attribute is not present. For instance, an
                element value of "beam" and a position value of "2" defines the link or bookmark to
                refer to the second beam descendant of the next sibling element that is not a link
                or bookmark. This is equivalent to an XPath test of [.//beam[2]] done in the context
                of the sibling element.`
	__Documentation__000039__Inlined.Source = ``
	__Documentation__000039__Inlined.Lang = ``

	__Documentation__000040__Inlined.Name = `_Inlined`
	__Documentation__000040__Inlined.Text = `The metronome-dot element works like the dot element in
                        defining metric relationships.`
	__Documentation__000040__Inlined.Source = ``
	__Documentation__000040__Inlined.Lang = ``

	__Documentation__000041__Inlined.Name = `_Inlined`
	__Documentation__000041__Inlined.Text = `The x-position attribute group is used for elements like notes where
                specifying x position is common, but specifying y position is rare.`
	__Documentation__000041__Inlined.Source = ``
	__Documentation__000041__Inlined.Lang = ``

	__Documentation__000042__Inlined.Name = `_Inlined`
	__Documentation__000042__Inlined.Text = `The print-attributes group is used by the print element. The
                new-system and new-page attributes indicate whether to force a system or page break,
                or to force the current music onto the same system or page as the preceding music.
                Normally this is the first music data within a measure. If used in multi-part music,
                they should be placed in the same positions within each part, or the results are
                undefined. The page-number attribute sets the number of a new page; it is ignored if
                new-page is not "yes". Version 2.0 adds a blank-page attribute. This is a positive
                integer value that specifies the number of blank pages to insert before the current
                measure. It is ignored if new-page is not "yes". These blank pages have no music,
                but may have text or images specified by the credit element. This is used to allow a
                combination of pages that are all text, or all text and images, together with pages
                of music. The staff-spacing attribute specifies spacing between multiple staves in
                tenths of staff space. This is deprecated as of Version 1.1; the staff-layout
                element should be used instead. If both are present, the staff-layout values take
                priority.`
	__Documentation__000042__Inlined.Source = ``
	__Documentation__000042__Inlined.Lang = ``

	__Documentation__000043__Inlined.Name = `_Inlined`
	__Documentation__000043__Inlined.Text = `The half-muted element represents the half-muted symbol, which
                        looks like a circle with a plus sign inside. The smufl attribute can be used
                        to distinguish different SMuFL glyphs that have a similar appearance such as
                        brassMuteHalfClosed and guitarHalfOpenPedal. If not present, the default
                        glyph is brassMuteHalfClosed.`
	__Documentation__000043__Inlined.Source = ``
	__Documentation__000043__Inlined.Lang = ``

	__Documentation__000044__Inlined.Name = `_Inlined`
	__Documentation__000044__Inlined.Text = `The tuplet-normal element provide optional full control over
                        how the normal part of the tuplet is displayed, including number and note
                        type (with dots). If any of these elements are absent, their values are
                        based on the time-modification element.`
	__Documentation__000044__Inlined.Source = ``
	__Documentation__000044__Inlined.Lang = ``

	__Documentation__000045__Inlined.Name = `_Inlined`
	__Documentation__000045__Inlined.Text = `The font attribute group gathers together attributes for determining
                the font within a credit or direction. They are based on the text styles for
                Cascading Style Sheets. The font-family is a comma-separated list of font names.The
                font-style can be normal or italic. The font-size can be one of the CSS sizes or a
                numeric point size. The font-weight can be normal or bold. The default is
                application-dependent, but is a text font vs. a music font.`
	__Documentation__000045__Inlined.Source = ``
	__Documentation__000045__Inlined.Lang = ``

	__Documentation__000046__Inlined.Name = `_Inlined`
	__Documentation__000046__Inlined.Text = `The group element allows the use of different versions of the
                        part for different purposes. Typical values include score, parts, sound, and
                        data. Ordering information can be derived from the ordering within a
                        MusicXML score or opus.`
	__Documentation__000046__Inlined.Source = ``
	__Documentation__000046__Inlined.Lang = ``

	__Documentation__000047__Inlined.Name = `_Inlined`
	__Documentation__000047__Inlined.Text = `The group-name-text attribute group is used by the group-name and
                group-abbreviation elements. The print-style and justify attribute groups are
                deprecated in MusicXML 2.0 in favor of the new group-name-display and
                group-abbreviation-display elements.`
	__Documentation__000047__Inlined.Source = ``
	__Documentation__000047__Inlined.Lang = ``

	__Documentation__000048__Inlined.Name = `_Inlined`
	__Documentation__000048__Inlined.Text = `The doit element is an indeterminate slide attached to a
                        single note. The doit appears after the main note and goes above the main
                        pitch.`
	__Documentation__000048__Inlined.Source = ``
	__Documentation__000048__Inlined.Lang = ``

	__Documentation__000049__Inlined.Name = `_Inlined`
	__Documentation__000049__Inlined.Text = `Values for the prefix element include plus and the accidental
                        values sharp, flat, natural, double-sharp, flat-flat, and sharp-sharp. The
                        prefix element may contain additional values for symbols specific to
                        particular figured bass styles.`
	__Documentation__000049__Inlined.Source = ``
	__Documentation__000049__Inlined.Lang = ``

	__Documentation__000050__Inlined.Name = `_Inlined`
	__Documentation__000050__Inlined.Text = `The orientation attribute indicates whether slurs and ties are
                overhand (tips down) or underhand (tips up). This is distinct from the placement
                attribute used by any notation type.`
	__Documentation__000050__Inlined.Source = ``
	__Documentation__000050__Inlined.Lang = ``

	__Documentation__000051__Inlined.Name = `_Inlined`
	__Documentation__000051__Inlined.Text = `The directive attribute changes the default-x position of a direction.
                It indicates that the left-hand side of the direction is aligned with the left-hand
                side of the time signature. If no time signature is present, it is aligned with the
                left-hand side of the first music notational element in the measure. If a default-x,
                justify, or halign attribute is present, it overrides the directive attribute.`
	__Documentation__000051__Inlined.Source = ``
	__Documentation__000051__Inlined.Lang = ``

	__Documentation__000052__Inlined.Name = `_Inlined`
	__Documentation__000052__Inlined.Text = `The slash-type element indicates the graphical note type
                            to use for the display of repetition marks.`
	__Documentation__000052__Inlined.Source = ``
	__Documentation__000052__Inlined.Lang = ``

	__Documentation__000053__Inlined.Name = `_Inlined`
	__Documentation__000053__Inlined.Text = `The chromatic element in a part-transpose element will usually
                        have a non-zero value, since octave transpositions can be represented in
                        concert scores using the transpose element.`
	__Documentation__000053__Inlined.Source = ``
	__Documentation__000053__Inlined.Lang = ``

	__Documentation__000054__Inlined.Name = `_Inlined`
	__Documentation__000054__Inlined.Text = `The volume element value is a percentage of the maximum
                        ranging from 0 to 100, with decimal values allowed. This corresponds to a
                        scaling value for the MIDI 1.0 channel volume controller.`
	__Documentation__000054__Inlined.Source = ``
	__Documentation__000054__Inlined.Lang = ``

	__Documentation__000055__Inlined.Name = `_Inlined`
	__Documentation__000055__Inlined.Text = `A senza-misura element explicitly indicates that no time
                        signature is present. The optional element content indicates the symbol to
                        be used, if any, such as an X. The time element's symbol attribute is not
                        used when a senza-misura element is present.`
	__Documentation__000055__Inlined.Source = ``
	__Documentation__000055__Inlined.Lang = ``

	__Documentation__000056__Inlined.Name = `_Inlined`
	__Documentation__000056__Inlined.Text = `The natural element indicates that this is a natural
                            harmonic. These are usually notated at base pitch rather than sounding
                            pitch.`
	__Documentation__000056__Inlined.Source = ``
	__Documentation__000056__Inlined.Lang = ``

	__Documentation__000057__Inlined.Name = `_Inlined`
	__Documentation__000057__Inlined.Text = `Clefs are represented by a combination of sign, line, and
                        clef-octave-change elements.`
	__Documentation__000057__Inlined.Source = ``
	__Documentation__000057__Inlined.Lang = ``

	__Documentation__000058__Inlined.Name = `_Inlined`
	__Documentation__000058__Inlined.Text = `The smear element represents the tilde-shaped smear symbol
                        used in brass notation.`
	__Documentation__000058__Inlined.Source = ``
	__Documentation__000058__Inlined.Lang = ``

	__Documentation__000059__Inlined.Name = `_Inlined`
	__Documentation__000059__Inlined.Text = `The other-ornament element is used to define any ornaments
                            not yet in the MusicXML format. The smufl attribute can be used to
                            specify a particular ornament, allowing application interoperability
                            without requiring every SMuFL ornament to have a MusicXML element
                            equivalent. Using the other-ornament element without the smufl attribute
                            allows for extended representation, though without application
                            interoperability.`
	__Documentation__000059__Inlined.Source = ``
	__Documentation__000059__Inlined.Lang = ``

	__Documentation__000060__Inlined.Name = `_Inlined`
	__Documentation__000060__Inlined.Text = `The optional bass-separator element indicates that text,
                        rather than a line or slash, separates the bass from what precedes it.`
	__Documentation__000060__Inlined.Source = ``
	__Documentation__000060__Inlined.Lang = ``

	__Documentation__000061__Inlined.Name = `_Inlined`
	__Documentation__000061__Inlined.Text = `The content of the optional hole-type element indicates what
                        the hole symbol represents in terms of instrument fingering or other
                        techniques.`
	__Documentation__000061__Inlined.Source = ``
	__Documentation__000061__Inlined.Lang = ``

	__Documentation__000062__Inlined.Name = `_Inlined`
	__Documentation__000062__Inlined.Text = `The words element specifies a standard text direction. The
                            enclosure is none if not specified. The language is Italian ("it") if
                            not specified. Left justification is used if not specified.`
	__Documentation__000062__Inlined.Source = ``
	__Documentation__000062__Inlined.Lang = ``

	__Documentation__000063__Inlined.Name = `_Inlined`
	__Documentation__000063__Inlined.Text = `The tuning-octave element is represented like the octave
                        element, with a different name to reflect its different function in string
                        tuning.`
	__Documentation__000063__Inlined.Source = ``
	__Documentation__000063__Inlined.Lang = ``

	__Documentation__000064__Inlined.Name = `_Inlined`
	__Documentation__000064__Inlined.Text = `The part-name-text attribute group is used by the part-name and
                part-abbreviation elements. The print-style and justify attribute groups are
                deprecated in MusicXML 2.0 in favor of the new part-name-display and
                part-abbreviation-display elements.`
	__Documentation__000064__Inlined.Source = ``
	__Documentation__000064__Inlined.Lang = ``

	__Documentation__000065__Inlined.Name = `_Inlined`
	__Documentation__000065__Inlined.Text = `Formatting specified in the group-name-display element
                        overrides formatting specified in the group-name element.`
	__Documentation__000065__Inlined.Source = ``
	__Documentation__000065__Inlined.Lang = ``

	__Documentation__000066__Inlined.Name = `_Inlined`
	__Documentation__000066__Inlined.Text = `The pan and elevation elements allow placing of sound in a 3-D
                        space relative to the listener. Both are expressed in degrees ranging from
                        -180 to 180. For pan, 0 is straight ahead, -90 is hard left, 90 is hard
                        right, and -180 and 180 are directly behind the listener.`
	__Documentation__000066__Inlined.Source = ``
	__Documentation__000066__Inlined.Lang = ``

	__Documentation__000067__Inlined.Name = `_Inlined`
	__Documentation__000067__Inlined.Text = `The staff-lines element specifies the number of lines and
                            is usually used for a non 5-line staff. If the staff-lines element is
                            present, the appearance of each line may be individually specified with
                            a line-detail element. `
	__Documentation__000067__Inlined.Source = ``
	__Documentation__000067__Inlined.Lang = ``

	__Documentation__000068__Inlined.Name = `_Inlined`
	__Documentation__000068__Inlined.Text = `The ensemble element is present if performance is intended
                            by an ensemble such as an orchestral section. The text of the ensemble
                            element contains the size of the section, or is empty if the ensemble
                            size is not specified.`
	__Documentation__000068__Inlined.Source = ``
	__Documentation__000068__Inlined.Lang = ``

	__Documentation__000069__Inlined.Name = `_Inlined`
	__Documentation__000069__Inlined.Text = `The text-direction attribute is used to adjust and override the
                Unicode bidirectional text algorithm, similar to the Directionality data category in
                the W3C Internationalization Tag Set recommendation.`
	__Documentation__000069__Inlined.Source = ``
	__Documentation__000069__Inlined.Lang = ``

	__Documentation__000070__Inlined.Name = `_Inlined`
	__Documentation__000070__Inlined.Text = `The image-attributes group is used to include graphical images in a
                score. The required source attribute is the URL for the image file. The required
                type attribute is the MIME type for the image file format. Typical choices include
                application/postscript, image/gif, image/jpeg, image/png, and image/tiff. The
                optional height and width attributes are used to size and scale an image. The image
                should be scaled independently in X and Y if both height and width are specified. If
                only one attribute is specified, the image should be scaled proportionally to fit in
                the specified dimension.`
	__Documentation__000070__Inlined.Source = ``
	__Documentation__000070__Inlined.Lang = ``

	__Documentation__000071__Inlined.Name = `_Inlined`
	__Documentation__000071__Inlined.Text = `The chord element indicates that this note is an additional
                        chord tone with the preceding note. The duration of a chord note does not
                        move the musical position within a measure. That is done by the duration of
                        the first preceding note without a chord element. Thus the duration of a
                        chord note cannot be longer than the preceding note. In most cases the
                        duration will be the same as the preceding note. However it can be shorter
                        in situations such as multiple stops for string instruments.`
	__Documentation__000071__Inlined.Source = ``
	__Documentation__000071__Inlined.Lang = ``

	__Documentation__000072__Inlined.Name = `_Inlined`
	__Documentation__000072__Inlined.Text = `The sounding-pitch is the pitch which is heard when
                            playing the harmonic.`
	__Documentation__000072__Inlined.Source = ``
	__Documentation__000072__Inlined.Lang = ``

	__Documentation__000073__Inlined.Name = `_Inlined`
	__Documentation__000073__Inlined.Text = `The humming element represents a humming voice.`
	__Documentation__000073__Inlined.Source = ``
	__Documentation__000073__Inlined.Lang = ``

	__Documentation__000074__Inlined.Name = `_Inlined`
	__Documentation__000074__Inlined.Text = `The root-alter element represents the chromatic alteration of
                        the root of the current chord within the harmony element. In some chord
                        styles, the text for the root-step element may include root-alter
                        information. In that case, the print-object attribute of the root-alter
                        element can be set to no. The location attribute indicates whether the
                        alteration should appear to the left or the right of the root-step; it is
                        right by default.`
	__Documentation__000074__Inlined.Source = ``
	__Documentation__000074__Inlined.Lang = ``

	__Documentation__000075__Inlined.Name = `_Inlined`
	__Documentation__000075__Inlined.Text = `The system-relation attribute group distinguishes elements that are
                associated with a system rather than the particular part where the element appears.`
	__Documentation__000075__Inlined.Source = ``
	__Documentation__000075__Inlined.Lang = ``

	__Documentation__000076__Inlined.Name = `_Inlined`
	__Documentation__000076__Inlined.Text = `The movement-number element specifies the number of a
                        movement.`
	__Documentation__000076__Inlined.Source = ``
	__Documentation__000076__Inlined.Lang = ``

	__Documentation__000077__Inlined.Name = `_Inlined`
	__Documentation__000077__Inlined.Text = `The metronome-relation element describes the
                                relationship symbol that goes between the two sets of metronome-note
                                elements. The currently allowed value is equals, but this may expand
                                in future versions. If the element is empty, the equals value is
                                used.`
	__Documentation__000077__Inlined.Source = ``
	__Documentation__000077__Inlined.Lang = ``

	__Documentation__000078__Inlined.Name = `_Inlined`
	__Documentation__000078__Inlined.Text = `The beat-type element indicates the beat unit, as found in the
                        denominator of a time signature.`
	__Documentation__000078__Inlined.Source = ``
	__Documentation__000078__Inlined.Lang = ``

	__Documentation__000079__Inlined.Name = `_Inlined`
	__Documentation__000079__Inlined.Text = `The midi-program element specifies a MIDI 1.0 program number
                        ranging from 1 to 128.`
	__Documentation__000079__Inlined.Source = ``
	__Documentation__000079__Inlined.Lang = ``

	__Documentation__000080__Inlined.Name = `_Inlined`
	__Documentation__000080__Inlined.Text = `The letter-spacing attribute specifies text tracking. Values are
                either "normal" or a number representing the number of ems to add between each
                letter. The number may be negative in order to subtract space. The default is
                normal, which allows flexibility of letter-spacing for purposes of text
                justification.`
	__Documentation__000080__Inlined.Source = ``
	__Documentation__000080__Inlined.Lang = ``

	__Documentation__000081__Inlined.Name = `_Inlined`
	__Documentation__000081__Inlined.Text = `The up-bow element represents the symbol that is used both for
                        up-bowing on bowed instruments, and up-stroke on plucked instruments.`
	__Documentation__000081__Inlined.Source = ``
	__Documentation__000081__Inlined.Lang = ``

	__Documentation__000082__Inlined.Name = `_Inlined`
	__Documentation__000082__Inlined.Text = `The beat-unit element indicates the graphical note type to use
                        in a metronome mark.`
	__Documentation__000082__Inlined.Source = ``
	__Documentation__000082__Inlined.Lang = ``

	__Documentation__000083__Inlined.Name = `_Inlined`
	__Documentation__000083__Inlined.Text = `The pedal-step element defines the pitch step for a single
                        harp pedal.`
	__Documentation__000083__Inlined.Source = ``
	__Documentation__000083__Inlined.Lang = ``

	__Documentation__000084__Inlined.Name = `_Inlined`
	__Documentation__000084__Inlined.Text = `Each MusicXML part corresponds to a track in a Standard MIDI
                        Format 1 file. The score-instrument elements are used when there are
                        multiple instruments per track. The midi-device element is used to make a
                        MIDI device or port assignment for the given track. Initial midi-instrument
                        assignments may be made here as well.`
	__Documentation__000084__Inlined.Source = ``
	__Documentation__000084__Inlined.Lang = ``

	__Documentation__000085__Inlined.Name = `_Inlined`
	__Documentation__000085__Inlined.Text = `The normal-dot element is used to specify dotted normal
                            tuplet types.`
	__Documentation__000085__Inlined.Source = ``
	__Documentation__000085__Inlined.Lang = ``

	__Documentation__000086__Inlined.Name = `_Inlined`
	__Documentation__000086__Inlined.Text = `The tuning-alter element is represented like the alter
                        element, with a different name to reflect its different function in string
                        tuning.`
	__Documentation__000086__Inlined.Source = ``
	__Documentation__000086__Inlined.Lang = ``

	__Documentation__000087__Inlined.Name = `_Inlined`
	__Documentation__000087__Inlined.Text = `The source for the music that is encoded. This is similar to
                        the Dublin Core source element.`
	__Documentation__000087__Inlined.Source = ``
	__Documentation__000087__Inlined.Lang = ``

	__Documentation__000088__Inlined.Name = `_Inlined`
	__Documentation__000088__Inlined.Text = `The optional-unique-id attribute group allows an element to optionally
                specify an ID that is unique to the entire document. This attribute group is not
                used for a required id attribute, or for an id attribute that specifies an id
                reference.`
	__Documentation__000088__Inlined.Source = ``
	__Documentation__000088__Inlined.Lang = ``

	__Documentation__000089__Inlined.Name = `_Inlined`
	__Documentation__000089__Inlined.Text = `The document-attributes attribute group is used to specify the
                attributes for an entire MusicXML document. Currently this is used for the version
                attribute. The version attribute was added in Version 1.1 for the score-partwise and
                score-timewise documents. It provides an easier way to get version information than
                through the MusicXML public ID. The default value is 1.0 to make it possible for
                programs that handle later versions to distinguish earlier version files reliably.
                Programs that write MusicXML 1.1 or later files should set this attribute.`
	__Documentation__000089__Inlined.Source = ``
	__Documentation__000089__Inlined.Lang = ``

	__Documentation__000090__Inlined.Name = `_Inlined`
	__Documentation__000090__Inlined.Text = `Staff assignment is only needed for music notated on multiple
                        staves. Used by both notes and directions. Staff values are numbers, with 1
                        referring to the top-most staff in a part.`
	__Documentation__000090__Inlined.Source = ``
	__Documentation__000090__Inlined.Lang = ``

	__Documentation__000091__Inlined.Name = `_Inlined`
	__Documentation__000091__Inlined.Text = `The accordion-high element indicates the presence of a dot in
                        the high (4') section of the registration symbol. This element is omitted if
                        no dot is present.`
	__Documentation__000091__Inlined.Source = ``
	__Documentation__000091__Inlined.Lang = ``

	__Documentation__000092__Inlined.Name = `_Inlined`
	__Documentation__000092__Inlined.Text = `The frame-frets element gives the overall size of the frame in
                        horizontal spaces (frets).`
	__Documentation__000092__Inlined.Source = ``
	__Documentation__000092__Inlined.Lang = ``

	__Documentation__000093__Inlined.Name = `_Inlined`
	__Documentation__000093__Inlined.Text = `The delayed-inverted-turn element indicates an inverted
                            turn that is delayed until the end of the current note.`
	__Documentation__000093__Inlined.Source = ``
	__Documentation__000093__Inlined.Lang = ``

	__Documentation__000094__Inlined.Name = `_Inlined`
	__Documentation__000094__Inlined.Text = `The score-timewise element is the root element for a timewise MusicXML
                score. It includes a score-header group followed by a series of measures with parts
                inside. The document-attributes attribute group includes the version attribute.`
	__Documentation__000094__Inlined.Source = ``
	__Documentation__000094__Inlined.Lang = ``

	__Documentation__000095__Inlined.Name = `_Inlined`
	__Documentation__000095__Inlined.Text = `The line-type attribute distinguishes between solid, dashed, dotted,
                and wavy lines.`
	__Documentation__000095__Inlined.Source = ``
	__Documentation__000095__Inlined.Lang = ``

	__Documentation__000096__Inlined.Name = `_Inlined`
	__Documentation__000096__Inlined.Text = `The thumb-position element represents the thumb position
                        symbol. This is a circle with a line, where the line does not come within
                        the circle. It is distinct from the snap pizzicato symbol, where the line
                        comes inside the circle.`
	__Documentation__000096__Inlined.Source = ``
	__Documentation__000096__Inlined.Lang = ``

	__Documentation__000097__Inlined.Name = `_Inlined`
	__Documentation__000097__Inlined.Text = `Values for the suffix element include plus and the accidental
                        values sharp, flat, natural, double-sharp, flat-flat, and sharp-sharp.
                        Suffixes include both symbols that come after the figure number and those
                        that overstrike the figure number. The suffix values slash, back-slash, and
                        vertical are used for slashed numbers indicating chromatic alteration. The
                        orientation and display of the slash usually depends on the figure number.
                        The suffix element may contain additional values for symbols specific to
                        particular figured bass styles.`
	__Documentation__000097__Inlined.Source = ``
	__Documentation__000097__Inlined.Lang = ``

	__Documentation__000098__Inlined.Name = `_Inlined`
	__Documentation__000098__Inlined.Text = `The haydn element represents the Haydn ornament. This is
                            defined in SMuFL as ornamentHaydn.`
	__Documentation__000098__Inlined.Source = ``
	__Documentation__000098__Inlined.Lang = ``

	__Documentation__000099__Inlined.Name = `_Inlined`
	__Documentation__000099__Inlined.Text = `The normal-notes element describes how many notes are usually
                        played in the time occupied by the number in the actual-notes element.`
	__Documentation__000099__Inlined.Source = ``
	__Documentation__000099__Inlined.Lang = ``

	__Documentation__000100__Inlined.Name = `_Inlined`
	__Documentation__000100__Inlined.Text = `The line-shape attribute distinguishes between straight and curved
                lines.`
	__Documentation__000100__Inlined.Source = ``
	__Documentation__000100__Inlined.Lang = ``

	__Documentation__000101__Inlined.Name = `_Inlined`
	__Documentation__000101__Inlined.Text = `The optional instrument-abbreviation element is typically used
                        within a software application, rather than appearing on the printed page of
                        a score.`
	__Documentation__000101__Inlined.Source = ``
	__Documentation__000101__Inlined.Lang = ``

	__Documentation__000102__Inlined.Name = `_Inlined`
	__Documentation__000102__Inlined.Text = `The enclosure attribute group is used to specify the formatting of an
                enclosure around text or symbols.`
	__Documentation__000102__Inlined.Source = ``
	__Documentation__000102__Inlined.Lang = ``

	__Documentation__000103__Inlined.Name = `_Inlined`
	__Documentation__000103__Inlined.Text = `The numeral-alter element represents an alteration to the
                        numeral-root, similar to the alter element for a pitch. The print-object
                        attribute can be used to hide an alteration in cases such as when the
                        MusicXML encoding of a 6 or 7 numeral-root in a minor key requires an
                        alteration that is not displayed. The location attribute indicates whether
                        the alteration should appear to the left or the right of the numeral-root.
                        It is left by default.`
	__Documentation__000103__Inlined.Source = ``
	__Documentation__000103__Inlined.Lang = ``

	__Documentation__000104__Inlined.Name = `_Inlined`
	__Documentation__000104__Inlined.Text = `The end-paragraph element comes from RP-017 for Standard MIDI
                        File Lyric meta-events. It facilitates lyric display for Karaoke and similar
                        applications.`
	__Documentation__000104__Inlined.Source = ``
	__Documentation__000104__Inlined.Lang = ``

	__Documentation__000105__Inlined.Name = `_Inlined`
	__Documentation__000105__Inlined.Text = `The other-technical element is used to define any technical
                        indications not yet in the MusicXML format. The smufl attribute can be used
                        to specify a particular glyph, allowing application interoperability without
                        requiring every SMuFL technical indication to have a MusicXML element
                        equivalent. Using the other-technical element without the smufl attribute
                        allows for extended representation, though without application
                        interoperability.`
	__Documentation__000105__Inlined.Source = ``
	__Documentation__000105__Inlined.Lang = ``

	__Documentation__000106__Inlined.Name = `_Inlined`
	__Documentation__000106__Inlined.Text = `The rotation attribute is used to rotate text around the alignment
                point specified by the halign and valign attributes. Positive values are clockwise
                rotations, while negative values are counter-clockwise rotations.`
	__Documentation__000106__Inlined.Source = ``
	__Documentation__000106__Inlined.Lang = ``

	__Documentation__000107__Inlined.Name = `_Inlined`
	__Documentation__000107__Inlined.Text = `The laughing element represents a laughing voice.`
	__Documentation__000107__Inlined.Source = ``
	__Documentation__000107__Inlined.Lang = ``

	__Documentation__000108__Inlined.Name = `_Inlined`
	__Documentation__000108__Inlined.Text = `The y-position attribute group is used for elements like stems where
                specifying y position is common, but specifying x position is rare.`
	__Documentation__000108__Inlined.Source = ``
	__Documentation__000108__Inlined.Lang = ``

	__Documentation__000109__Inlined.Name = `_Inlined`
	__Documentation__000109__Inlined.Text = `The other-articulation element is used to define any
                        articulations not yet in the MusicXML format. The smufl attribute can be
                        used to specify a particular articulation, allowing application
                        interoperability without requiring every SMuFL articulation to have a
                        MusicXML element equivalent. Using the other-articulation element without
                        the smufl attribute allows for extended representation, though without
                        application interoperability.`
	__Documentation__000109__Inlined.Source = ``
	__Documentation__000109__Inlined.Lang = ``

	__Documentation__000110__Inlined.Name = `_Inlined`
	__Documentation__000110__Inlined.Text = `The bend-sound type is used for bend and slide elements, and is
                similar to the trill-sound attribute group. Here the beats element refers to the
                number of discrete elements (like MIDI pitch bends) used to represent a continuous
                bend or slide. The first-beat indicates the percentage of the duration for starting
                a bend; the last-beat the percentage for ending it. The default choices are:
                accelerate = "no" beats = "4" first-beat = "25" last-beat = "75"`
	__Documentation__000110__Inlined.Source = ``
	__Documentation__000110__Inlined.Lang = ``

	__Documentation__000111__Inlined.Name = `_Inlined`
	__Documentation__000111__Inlined.Text = `The justify attribute is used to indicate left, center, or right
                justification. The default value varies for different elements. For elements where
                the justify attribute is present but the halign attribute is not, the justify
                attribute indicates horizontal alignment as well as justification.`
	__Documentation__000111__Inlined.Source = ``
	__Documentation__000111__Inlined.Lang = ``

	__Documentation__000112__Inlined.Name = `_Inlined`
	__Documentation__000112__Inlined.Text = `If the metronome-arrows element is present, it indicates
                            that metric modulation arrows are displayed on both sides of the
                            metronome mark.`
	__Documentation__000112__Inlined.Source = ``
	__Documentation__000112__Inlined.Lang = ``

	__Documentation__000113__Inlined.Name = `_Inlined`
	__Documentation__000113__Inlined.Text = `A measure-style indicates a special way to print partial to
                        multiple measures within a part. This includes multiple rests over several
                        measures, repeats of beats, single, or multiple measures, and use of slash
                        notation.`
	__Documentation__000113__Inlined.Source = ``
	__Documentation__000113__Inlined.Lang = ``

	__Documentation__000114__Inlined.Name = `_Inlined`
	__Documentation__000114__Inlined.Text = `The tenuto element indicates a tenuto line symbol.`
	__Documentation__000114__Inlined.Source = ``
	__Documentation__000114__Inlined.Lang = ``

	__Documentation__000115__Inlined.Name = `_Inlined`
	__Documentation__000115__Inlined.Text = `The flip element represents the flip symbol used in brass
                        notation.`
	__Documentation__000115__Inlined.Source = ``
	__Documentation__000115__Inlined.Lang = ``

	__Documentation__000116__Inlined.Name = `_Inlined`
	__Documentation__000116__Inlined.Text = `The spiccato element is used for a stroke articulation, as
                        opposed to a dot or a wedge.`
	__Documentation__000116__Inlined.Source = ``
	__Documentation__000116__Inlined.Lang = ``

	__Documentation__000117__Inlined.Name = `_Inlined`
	__Documentation__000117__Inlined.Text = `The snap-pizzicato element represents the snap pizzicato
                        symbol. This is a circle with a line, where the line comes inside the
                        circle. It is distinct from the thumb-position symbol, where the line does
                        not come inside the circle.`
	__Documentation__000117__Inlined.Source = ``
	__Documentation__000117__Inlined.Lang = ``

	__Documentation__000118__Inlined.Name = `_Inlined`
	__Documentation__000118__Inlined.Text = `The shake element has a similar appearance to an
                            inverted-mordent element.`
	__Documentation__000118__Inlined.Source = ``
	__Documentation__000118__Inlined.Lang = ``

	__Documentation__000119__Inlined.Name = `_Inlined`
	__Documentation__000119__Inlined.Text = `The measure-attributes group is used by the measure element. Measures
                have a required number attribute (going from partwise to timewise, measures are
                grouped via the number). The implicit attribute is set to "yes" for measures where
                the measure number should never appear, such as pickup measures and the last half of
                mid-measure repeats. The value is "no" if not specified. The non-controlling
                attribute is intended for use in multimetric music like the Don Giovanni minuet. If
                set to "yes", the left barline in this measure does not coincide with the left
                barline of measures in other parts. The value is "no" if not specified. In partwise
                files, the number attribute should be the same for measures in different parts that
                share the same left barline. While the number attribute is often numeric, it does
                not have to be. Non-numeric values are typically used together with the implicit or
                non-controlling attributes being set to "yes". For a pickup measure, the number
                attribute is typically set to "0" and the implicit attribute is typically set to
                "yes". If measure numbers are not unique within a part, this can cause problems for
                conversions between partwise and timewise formats. The text attribute allows
                specification of displayed measure numbers that are different than what is used in
                the number attribute. This attribute is ignored for measures where the implicit
                attribute is set to "yes". Further details about measure numbering can be specified
                using the measure-numbering element. Measure width is specified in tenths. These are
                the global tenths specified in the scaling element, not local tenths as modified by
                the staff-size element. The width covers the entire measure from barline or system
                start to barline or system end.`
	__Documentation__000119__Inlined.Source = ``
	__Documentation__000119__Inlined.Lang = ``

	__Documentation__000120__Inlined.Name = `_Inlined`
	__Documentation__000120__Inlined.Text = `The movement-title element specifies the title of a movement,
                        not including its number.`
	__Documentation__000120__Inlined.Source = ``
	__Documentation__000120__Inlined.Lang = ``

	__Documentation__000121__Inlined.Name = `_Inlined`
	__Documentation__000121__Inlined.Text = `The smufl attribute group is used to indicate a particular Standard
                Music Font Layout (SMuFL) character. Sometimes this is a formatting choice, and
                sometimes this is a refinement of the semantic meaning of an element.`
	__Documentation__000121__Inlined.Source = ``
	__Documentation__000121__Inlined.Lang = ``

	__Documentation__000122__Inlined.Name = `_Inlined`
	__Documentation__000122__Inlined.Text = `The double-tongue element represents the double tongue symbol
                        (two dots arranged horizontally).`
	__Documentation__000122__Inlined.Source = ``
	__Documentation__000122__Inlined.Lang = ``

	__Documentation__000123__Inlined.Name = `_Inlined`
	__Documentation__000123__Inlined.Text = `Time signatures are represented by the beats element for the
                        numerator and the beat-type element for the denominator.`
	__Documentation__000123__Inlined.Source = ``
	__Documentation__000123__Inlined.Lang = ``

	__Documentation__000124__Inlined.Name = `_Inlined`
	__Documentation__000124__Inlined.Text = `The staves element is used if there is more than one staff
                        represented in the given part (e.g., 2 staves for typical piano parts). If
                        absent, a value of 1 is assumed. Staves are ordered from top to bottom in a
                        part in numerical order, with staff 1 above staff 2.`
	__Documentation__000124__Inlined.Source = ``
	__Documentation__000124__Inlined.Lang = ``

	__Documentation__000125__Inlined.Name = `_Inlined`
	__Documentation__000125__Inlined.Text = `The except-voice element is used to specify a combination of
                        slash notation and regular notation. Any note elements that are in voices
                        specified by the except-voice elements are displayed in normal notation, in
                        addition to the slash notation that is always displayed.`
	__Documentation__000125__Inlined.Source = ``
	__Documentation__000125__Inlined.Lang = ``

	__Documentation__000126__Inlined.Name = `_Inlined`
	__Documentation__000126__Inlined.Text = `A related resource for the music that is encoded. This is
                        similar to the Dublin Core relation element. Standard type values are music,
                        words, and arrangement, but other types may be used.`
	__Documentation__000126__Inlined.Source = ``
	__Documentation__000126__Inlined.Lang = ``

	__Documentation__000127__Inlined.Name = `_Inlined`
	__Documentation__000127__Inlined.Text = `A figure-number is a number. Overstrikes of the figure number
                        are represented in the suffix element.`
	__Documentation__000127__Inlined.Source = ``
	__Documentation__000127__Inlined.Lang = ``

	__Documentation__000128__Inlined.Name = `_Inlined`
	__Documentation__000128__Inlined.Text = `The unstress element indicates an unstressed note. It is often
                        notated using a u-shaped symbol.`
	__Documentation__000128__Inlined.Source = ``
	__Documentation__000128__Inlined.Lang = ``

	__Documentation__000129__Inlined.Name = `_Inlined`
	__Documentation__000129__Inlined.Text = `The soft-accent element indicates a soft accent that is not as
                        heavy as a normal accent. It is often notated as <>. It can be
                        combined with other articulations to implement the first eight symbols in
                        the SMuFL Articulation supplement range.`
	__Documentation__000129__Inlined.Source = ``
	__Documentation__000129__Inlined.Lang = ``

	__Documentation__000130__Inlined.Name = `_Inlined`
	__Documentation__000130__Inlined.Text = `The slash-dot element is used to specify any augmentation
                            dots in the note type used to display repetition marks.`
	__Documentation__000130__Inlined.Source = ``
	__Documentation__000130__Inlined.Lang = ``

	__Documentation__000131__Inlined.Name = `_Inlined`
	__Documentation__000131__Inlined.Text = `The print-style-align attribute group adds the halign and valign
                attributes to the position, font, and color attributes.`
	__Documentation__000131__Inlined.Source = ``
	__Documentation__000131__Inlined.Lang = ``

	__Documentation__000132__Inlined.Name = `_Inlined`
	__Documentation__000132__Inlined.Text = `The group-time element indicates that the displayed time
                        signatures should stretch across all parts and staves in the group.`
	__Documentation__000132__Inlined.Source = ``
	__Documentation__000132__Inlined.Lang = ``

	__Documentation__000133__Inlined.Name = `_Inlined`
	__Documentation__000133__Inlined.Text = `The creator element is borrowed from Dublin Core. It is used
                        for the creators of the score. The type attribute is used to distinguish
                        different creative contributions. Thus, there can be multiple creators
                        within an identification. Standard type values are composer, lyricist, and
                        arranger. Other type values may be used for different types of creative
                        roles. The type attribute should usually be used even if there is just a
                        single creator element. The MusicXML format does not use the creator /
                        contributor distinction from Dublin Core.`
	__Documentation__000133__Inlined.Source = ``
	__Documentation__000133__Inlined.Lang = ``

	__Documentation__000134__Inlined.Name = `_Inlined`
	__Documentation__000134__Inlined.Text = `The frame-strings element gives the overall size of the frame
                        in vertical lines (strings).`
	__Documentation__000134__Inlined.Source = ``
	__Documentation__000134__Inlined.Lang = ``

	__Documentation__000135__Inlined.Name = `_Inlined`
	__Documentation__000135__Inlined.Text = `The pedal-alter element defines the chromatic alteration for a
                        single harp pedal.`
	__Documentation__000135__Inlined.Source = ``
	__Documentation__000135__Inlined.Lang = ``

	__Documentation__000136__Inlined.Name = `_Inlined`
	__Documentation__000136__Inlined.Text = `The link-attributes group includes all the simple XLink attributes
                supported in the MusicXML format. It is also used to connect a MusicXML score with
                MusicXML parts or a MusicXML opus.`
	__Documentation__000136__Inlined.Source = ``
	__Documentation__000136__Inlined.Lang = ``

	__Documentation__000137__Inlined.Name = `_Inlined`
	__Documentation__000137__Inlined.Text = `The cue element indicates the presence of a cue note.
                                In MusicXML, a cue note is a silent note with no playback. Normal
                                notes that play can be specified as cue size using the type element.
                                A cue note that is specified as full size using the type element
                                will still remain silent.`
	__Documentation__000137__Inlined.Source = ``
	__Documentation__000137__Inlined.Lang = ``

	__Documentation__000138__Inlined.Name = `_Inlined`
	__Documentation__000138__Inlined.Text = `The beat-unit-dot element is used to specify any augmentation
                        dots for a metronome mark note.`
	__Documentation__000138__Inlined.Source = ``
	__Documentation__000138__Inlined.Lang = ``

	__Documentation__000139__Inlined.Name = `_Inlined`
	__Documentation__000139__Inlined.Text = `The mordent element represents the sign with the vertical
                            line. The choice of which mordent sign is inverted differs between
                            MusicXML and SMuFL. The long attribute is "no" by default.`
	__Documentation__000139__Inlined.Source = ``
	__Documentation__000139__Inlined.Lang = ``

	__Documentation__000140__Inlined.Name = `_Inlined`
	__Documentation__000140__Inlined.Text = `If the type associated with the number in the normal-notes
                            element is different than the current note type (e.g., a quarter note
                            within an eighth note triplet), then the normal-notes type (e.g. eighth)
                            is specified in the normal-type and normal-dot elements.`
	__Documentation__000140__Inlined.Source = ``
	__Documentation__000140__Inlined.Lang = ``

	__Documentation__000141__Inlined.Name = `_Inlined`
	__Documentation__000141__Inlined.Text = `The midi-bank element specifies a MIDI 1.0 bank number ranging
                        from 1 to 16,384.`
	__Documentation__000141__Inlined.Source = ``
	__Documentation__000141__Inlined.Lang = ``

	__Documentation__000142__Inlined.Name = `_Inlined`
	__Documentation__000142__Inlined.Text = `The key element represents a key signature. Both traditional
                        and non-traditional key signatures are supported. The optional number
                        attribute refers to staff numbers. If absent, the key signature applies to
                        all staves in the part.`
	__Documentation__000142__Inlined.Source = ``
	__Documentation__000142__Inlined.Lang = ``

	__Documentation__000143__Inlined.Name = `_Inlined`
	__Documentation__000143__Inlined.Text = `The print-object attribute specifies whether or not to print an object
                (e.g. a note or a rest). It is yes by default.`
	__Documentation__000143__Inlined.Source = ``
	__Documentation__000143__Inlined.Lang = ``

	__Documentation__000144__Inlined.Name = `_Inlined`
	__Documentation__000144__Inlined.Text = `The beats element indicates the number of beats, as found in
                        the numerator of a time signature.`
	__Documentation__000144__Inlined.Source = ``
	__Documentation__000144__Inlined.Lang = ``

	__Documentation__000145__Inlined.Name = `_Inlined`
	__Documentation__000145__Inlined.Text = `The valign-image attribute is used to indicate vertical alignment for
                images and graphics, so it removes the baseline value. Defaults are
                implementation-dependent.`
	__Documentation__000145__Inlined.Source = ``
	__Documentation__000145__Inlined.Lang = ``

	__Documentation__000146__Inlined.Name = `_Inlined`
	__Documentation__000146__Inlined.Text = `If the part is being encoded for a transposing instrument
                            in written vs. concert pitch, the transposition must be encoded in the
                            transpose element using the transpose type.`
	__Documentation__000146__Inlined.Source = ``
	__Documentation__000146__Inlined.Lang = ``

	__Documentation__000147__Inlined.Name = `_Inlined`
	__Documentation__000147__Inlined.Text = `The staccato element is used for a dot articulation, as
                        opposed to a stroke or a wedge.`
	__Documentation__000147__Inlined.Source = ``
	__Documentation__000147__Inlined.Lang = ``

	__Documentation__000148__Inlined.Name = `_Inlined`
	__Documentation__000148__Inlined.Text = `For most elements, any program will compute a default x and y
                position. The position attributes let this be changed two ways. The default-x and
                default-y attributes change the computation of the default position. For most
                elements, the origin is changed relative to the left-hand side of the note or the
                musical position within the bar (x) and the top line of the staff (y). For the
                following elements, the default-x value changes the origin relative to the start of
                the current measure: - note - figured-bass - harmony - link - directive -
                measure-numbering - all descendants of the part-list element - all children of the
                direction-type element This origin is from the start of the entire measure, at
                either the left barline or the start of the system. When the default-x attribute is
                used within a child element of the part-name-display, part-abbreviation-display,
                group-name-display, or group-abbreviation-display elements, it changes the origin
                relative to the start of the first measure on the system. These values are used when
                the current measure or a succeeding measure starts a new system. The same change of
                origin is used for the group-symbol element. For the note, figured-bass, and harmony
                elements, the default-x value is considered to have adjusted the musical position
                within the bar for its descendant elements. Since the credit-words and credit-image
                elements are not related to a measure, in these cases the default-x and default-y
                attributes adjust the origin relative to the bottom left-hand corner of the
                specified page. The relative-x and relative-y attributes change the position
                relative to the default position, either as computed by the individual program, or
                as overridden by the default-x and default-y attributes. Positive x is right,
                negative x is left; positive y is up, negative y is down. All units are in tenths of
                interline space. For stems, positive relative-y lengthens a stem while negative
                relative-y shortens it. The default-x and default-y position attributes provide
                higher-resolution positioning data than related features such as the placement
                attribute and the offset element. Applications reading a MusicXML file that can
                understand both features should generally rely on the default-x and default-y
                attributes for their greater accuracy. For the relative-x and relative-y attributes,
                the offset element, placement attribute, and directive attribute provide context for
                the relative position information, so the two features should be interpreted
                together. As elsewhere in the MusicXML format, tenths are the global tenths defined
                by the scaling element, not the local tenths of a staff resized by the staff-size
                element.`
	__Documentation__000148__Inlined.Source = ``
	__Documentation__000148__Inlined.Lang = ``

	__Documentation__000149__Inlined.Name = `_Inlined`
	__Documentation__000149__Inlined.Text = `The golpe element represents the golpe symbol that is used for
                        tapping the pick guard in guitar music.`
	__Documentation__000149__Inlined.Source = ``
	__Documentation__000149__Inlined.Lang = ``

	__Documentation__000150__Inlined.Name = `_Inlined`
	__Documentation__000150__Inlined.Text = `The measure-distance element specifies the horizontal distance
                        from the previous measure. This value is only used for systems where there
                        is horizontal whitespace in the middle of a system, as in systems with
                        codas. To specify the measure width, use the width attribute of the measure
                        element.`
	__Documentation__000150__Inlined.Source = ``
	__Documentation__000150__Inlined.Lang = ``

	__Documentation__000151__Inlined.Name = `_Inlined`
	__Documentation__000151__Inlined.Text = `The down-bow element represents the symbol that is used both
                        for down-bowing on bowed instruments, and down-stroke on plucked
                        instruments.`
	__Documentation__000151__Inlined.Source = ``
	__Documentation__000151__Inlined.Lang = ``

	__Documentation__000152__Inlined.Name = `_Inlined`
	__Documentation__000152__Inlined.Text = `The falloff element is an indeterminate slide attached to a
                        single note. The falloff appears after the main note and goes below the main
                        pitch.`
	__Documentation__000152__Inlined.Source = ``
	__Documentation__000152__Inlined.Lang = ``

	__Documentation__000153__Inlined.Name = `_Inlined`
	__Documentation__000153__Inlined.Text = `The presence of a concert-score element indicates that a score
                        is displayed in concert pitch. It is used for scores that contain parts for
                        transposing instruments. A document with a concert-score element may not
                        contain any transpose elements that have non-zero values for either the
                        diatonic or chromatic elements. Concert scores may include octave
                        transpositions, so transpose elements with a double element or a non-zero
                        octave-change element value are permitted.`
	__Documentation__000153__Inlined.Source = ``
	__Documentation__000153__Inlined.Lang = ``

	__Documentation__000154__Inlined.Name = `_Inlined`
	__Documentation__000154__Inlined.Text = `The work-number element specifies the number of a work, such
                        as its opus number.`
	__Documentation__000154__Inlined.Source = ``
	__Documentation__000154__Inlined.Lang = ``

	__Documentation__000155__Inlined.Name = `_Inlined`
	__Documentation__000155__Inlined.Text = `The detached-legato element indicates the combination of a
                        tenuto line and staccato dot symbol.`
	__Documentation__000155__Inlined.Source = ``
	__Documentation__000155__Inlined.Lang = ``

	__Documentation__000156__Inlined.Name = `_Inlined`
	__Documentation__000156__Inlined.Text = `The optional list of key-octave elements is used to specify in
                        which octave each element of the key signature appears.`
	__Documentation__000156__Inlined.Source = ``
	__Documentation__000156__Inlined.Lang = ``

	__Documentation__000157__Inlined.Name = `_Inlined`
	__Documentation__000157__Inlined.Text = `The elevation and pan elements allow placing of sound in a 3-D
                        space relative to the listener. Both are expressed in degrees ranging from
                        -180 to 180. For elevation, 0 is level with the listener, 90 is directly
                        above, and -90 is directly below.`
	__Documentation__000157__Inlined.Source = ``
	__Documentation__000157__Inlined.Lang = ``

	__Documentation__000158__Inlined.Name = `_Inlined`
	__Documentation__000158__Inlined.Text = `The virtual-name element indicates the library-specific name
                        for the virtual instrument.`
	__Documentation__000158__Inlined.Source = ``
	__Documentation__000158__Inlined.Lang = ``

	__Documentation__000159__Inlined.Name = `_Inlined`
	__Documentation__000159__Inlined.Text = `The for-part element is used in a concert score to
                            indicate the transposition for a transposed part created from that
                            score. It is only used in score files that contain a concert-score
                            element in the defaults. This allows concert scores with transposed
                            parts to be represented in a single uncompressed MusicXML file.`
	__Documentation__000159__Inlined.Source = ``
	__Documentation__000159__Inlined.Lang = ``

	__Documentation__000160__Inlined.Name = `_Inlined`
	__Documentation__000160__Inlined.Text = `Multiple part-link elements can reference different types of
                        linked documents, such as parts and condensed score. The optional group-link
                        elements identify the groups used in the linked document. The content of a
                        group-link element should match the content of a group element in the linked
                        document.`
	__Documentation__000160__Inlined.Source = ``
	__Documentation__000160__Inlined.Lang = ``

	__Documentation__000161__Inlined.Name = `_Inlined`
	__Documentation__000161__Inlined.Text = `In either partwise or timewise format, the part element has an id
                attribute that is an IDREF back to a score-part in the part-list.`
	__Documentation__000161__Inlined.Source = ``
	__Documentation__000161__Inlined.Lang = ``

	__Documentation__000162__Inlined.Name = `_Inlined`
	__Documentation__000162__Inlined.Text = `The pluck element is used to specify the plucking fingering on
                        a fretted instrument, where the fingering element refers to the fretting
                        fingering. Typical values are p, i, m, a for pulgar/thumb, indicio/index,
                        medio/middle, and anular/ring fingers.`
	__Documentation__000162__Inlined.Source = ``
	__Documentation__000162__Inlined.Lang = ``

	__Documentation__000163__Inlined.Name = `_Inlined`
	__Documentation__000163__Inlined.Text = `The staff-details element is used to indicate different types
                        of staves.`
	__Documentation__000163__Inlined.Source = ``
	__Documentation__000163__Inlined.Lang = ``

	__Documentation__000164__Inlined.Name = `_Inlined`
	__Documentation__000164__Inlined.Text = `The accent element indicates a regular horizontal accent mark.`
	__Documentation__000164__Inlined.Source = ``
	__Documentation__000164__Inlined.Lang = ``

	__Documentation__000165__Inlined.Name = `_Inlined`
	__Documentation__000165__Inlined.Text = `The strong-accent element indicates a vertical accent mark.`
	__Documentation__000165__Inlined.Source = ``
	__Documentation__000165__Inlined.Lang = ``

	__Documentation__000166__Inlined.Name = `_Inlined`
	__Documentation__000166__Inlined.Text = `The inverted-vertical-turn element has the turn symbol
                            shape arranged vertically going from upper right to lower left.`
	__Documentation__000166__Inlined.Source = ``
	__Documentation__000166__Inlined.Lang = ``

	__Documentation__000167__Inlined.Name = `_Inlined`
	__Documentation__000167__Inlined.Text = `The diatonic element specifies the number of pitch steps
                        needed to go from written to sounding pitch. This allows for correct
                        spelling of enharmonic transpositions. This value does not include
                        octave-change values; the values for both elements need to be added to the
                        written pitch to get the correct sounding pitch.`
	__Documentation__000167__Inlined.Source = ``
	__Documentation__000167__Inlined.Lang = ``

	__Documentation__000168__Inlined.Name = `_Inlined`
	__Documentation__000168__Inlined.Text = `The solo element is present if performance is intended by
                            a solo instrument.`
	__Documentation__000168__Inlined.Source = ``
	__Documentation__000168__Inlined.Lang = ``

	__Documentation__000169__Inlined.Name = `_Inlined`
	__Documentation__000169__Inlined.Text = `The metronome-type element works like the type element in
                        defining metric relationships.`
	__Documentation__000169__Inlined.Source = ``
	__Documentation__000169__Inlined.Lang = ``

	__Documentation__000170__Inlined.Name = `_Inlined`
	__Documentation__000170__Inlined.Text = `The damp element specifies a harp damping mark.`
	__Documentation__000170__Inlined.Source = ``
	__Documentation__000170__Inlined.Lang = ``

	__Documentation__000171__Inlined.Name = `_Inlined`
	__Documentation__000171__Inlined.Text = `The vertical-turn element has the turn symbol shape
                            arranged vertically going from upper left to lower right.`
	__Documentation__000171__Inlined.Source = ``
	__Documentation__000171__Inlined.Lang = ``

	__Documentation__000172__Inlined.Name = `_Inlined`
	__Documentation__000172__Inlined.Text = `The color attribute group indicates the color of an element.`
	__Documentation__000172__Inlined.Source = ``
	__Documentation__000172__Inlined.Lang = ``

	__Documentation__000173__Inlined.Name = `_Inlined`
	__Documentation__000173__Inlined.Text = `The tuning-step element is represented like the step element,
                        with a different name to reflect its different function in string tuning.`
	__Documentation__000173__Inlined.Source = ``
	__Documentation__000173__Inlined.Lang = ``

	__Documentation__000174__Inlined.Name = `_Inlined`
	__Documentation__000174__Inlined.Text = `Non-traditional key signatures are represented using a list of
                        altered tones. The key-alter element represents the alteration for a given
                        pitch step, represented with semitones in the same manner as the alter
                        element.`
	__Documentation__000174__Inlined.Source = ``
	__Documentation__000174__Inlined.Lang = ``

	__Documentation__000175__Inlined.Name = `_Inlined`
	__Documentation__000175__Inlined.Text = `The inverted-turn element has the shape which goes down
                            and then up.`
	__Documentation__000175__Inlined.Source = ``
	__Documentation__000175__Inlined.Lang = ``

	__Documentation__000176__Inlined.Name = `_Inlined`
	__Documentation__000176__Inlined.Text = `The part-clef element is used for transpositions that also
                        include a change of clef, as for instruments such as bass clarinet.`
	__Documentation__000176__Inlined.Source = ``
	__Documentation__000176__Inlined.Lang = ``

	__Documentation__000177__Inlined.Name = `_Inlined`
	__Documentation__000177__Inlined.Text = `The instruments element is only used if more than one
                        instrument is represented in the part (e.g., oboe I and II where they play
                        together most of the time). If absent, a value of 1 is assumed.`
	__Documentation__000177__Inlined.Source = ``
	__Documentation__000177__Inlined.Lang = ``

	__Documentation__000178__Inlined.Name = `_Inlined`
	__Documentation__000178__Inlined.Text = `The bass-alter element represents the chromatic alteration of
                        the bass of the current chord within the harmony element. In some chord
                        styles, the text for the bass-step element may include bass-alter
                        information. In that case, the print-object attribute of the bass-alter
                        element can be set to no. The location attribute indicates whether the
                        alteration should appear to the left or the right of the bass-step; it is
                        right if not specified.`
	__Documentation__000178__Inlined.Source = ``
	__Documentation__000178__Inlined.Lang = ``

	__Documentation__000179__Inlined.Name = `_Inlined`
	__Documentation__000179__Inlined.Text = `The tuplet-actual element provide optional full control over
                        how the actual part of the tuplet is displayed, including number and note
                        type (with dots). If any of these elements are absent, their values are
                        based on the time-modification element.`
	__Documentation__000179__Inlined.Source = ``
	__Documentation__000179__Inlined.Lang = ``

	__Documentation__000180__Inlined.Name = `_Inlined`
	__Documentation__000180__Inlined.Text = `The with-bar element indicates that the bend is to be done at
                        the bridge with a whammy or vibrato bar. The content of the element
                        indicates how this should be notated. Content values of "scoop" and "dip"
                        refer to the SMuFL guitarVibratoBarScoop and guitarVibratoBarDip glyphs.`
	__Documentation__000180__Inlined.Source = ``
	__Documentation__000180__Inlined.Lang = ``

	__Documentation__000181__Inlined.Name = `_Inlined`
	__Documentation__000181__Inlined.Text = `For unpitched instruments, the midi-unpitched element
                        specifies a MIDI 1.0 note number ranging from 1 to 128. It is usually used
                        with MIDI banks for percussion. Note that MIDI 1.0 note numbers are
                        generally specified from 0 to 127 rather than the 1 to 128 numbering used in
                        this element.`
	__Documentation__000181__Inlined.Source = ``
	__Documentation__000181__Inlined.Lang = ``

	__Documentation__000182__Inlined.Name = `_Inlined`
	__Documentation__000182__Inlined.Text = `The clef-octave-change element is used for transposing clefs.
                        A treble clef for tenors would have a value of -1.`
	__Documentation__000182__Inlined.Source = ``
	__Documentation__000182__Inlined.Lang = ``

	__Documentation__000183__Inlined.Name = `_Inlined`
	__Documentation__000183__Inlined.Text = `If the double element is present, it indicates that the music
                        is doubled one octave from what is currently written.`
	__Documentation__000183__Inlined.Source = ``
	__Documentation__000183__Inlined.Lang = ``

	__Documentation__000184__Inlined.Name = `_Inlined`
	__Documentation__000184__Inlined.Text = `The print-spacing attribute controls whether or not spacing is left
                for an invisible note or object. It is used only if no note, dot, or lyric is being
                printed. The value is yes (leave spacing) by default.`
	__Documentation__000184__Inlined.Source = ``
	__Documentation__000184__Inlined.Lang = ``

	__Documentation__000185__Inlined.Name = `_Inlined`
	__Documentation__000185__Inlined.Text = `The midi-channel element specifies a MIDI 1.0 channel numbers
                        ranging from 1 to 16.`
	__Documentation__000185__Inlined.Source = ``
	__Documentation__000185__Inlined.Lang = ``

	__Documentation__000186__Inlined.Name = `_Inlined`
	__Documentation__000186__Inlined.Text = `The trill-sound attribute group includes attributes used to guide the
                sound of trills, mordents, turns, shakes, and wavy lines. The default choices are:
                start-note = "upper" trill-step = "whole" two-note-turn = "none" accelerate = "no"
                beats = "4". Second-beat and last-beat are percentages for landing on the indicated
                beat, with defaults of 25 and 75 respectively. For mordent and inverted-mordent
                elements, the defaults are different: The default start-note is "main", not "upper".
                The default for beats is "3", not "4". The default for second-beat is "12", not
                "25". The default for last-beat is "24", not "75".`
	__Documentation__000186__Inlined.Source = ``
	__Documentation__000186__Inlined.Lang = ``

	__Documentation__000187__Inlined.Name = `_Inlined`
	__Documentation__000187__Inlined.Text = `The eyeglasses element represents the eyeglasses symbol,
                        common in commercial music.`
	__Documentation__000187__Inlined.Source = ``
	__Documentation__000187__Inlined.Lang = ``

	__Documentation__000188__Inlined.Name = `_Inlined`
	__Documentation__000188__Inlined.Text = `Line numbers are counted from the bottom of the staff. They
                        are only needed with the G, F, and C signs in order to position a pitch
                        correctly on the staff. Standard values are 2 for the G sign (treble clef),
                        4 for the F sign (bass clef), and 3 for the C sign (alto clef). Line values
                        can be used to specify positions outside the staff, such as a C clef
                        positioned in the middle of a grand staff.`
	__Documentation__000188__Inlined.Source = ``
	__Documentation__000188__Inlined.Lang = ``

	__Documentation__000189__Inlined.Name = `_Inlined`
	__Documentation__000189__Inlined.Text = `The other-percussion element represents percussion pictograms
                        not defined elsewhere.`
	__Documentation__000189__Inlined.Source = ``
	__Documentation__000189__Inlined.Lang = ``

	__Documentation__000190__Inlined.Name = `_Inlined`
	__Documentation__000190__Inlined.Text = `The player-name element is typically used within a software
                        application, rather than appearing on the printed page of a score.`
	__Documentation__000190__Inlined.Source = ``
	__Documentation__000190__Inlined.Lang = ``

	__Documentation__000191__Inlined.Name = `_Inlined`
	__Documentation__000191__Inlined.Text = `The name for this ornament is based on the German, to
                            avoid confusion with the more common slide element defined earlier.`
	__Documentation__000191__Inlined.Source = ``
	__Documentation__000191__Inlined.Lang = ``

	__Documentation__000192__Inlined.Name = `_Inlined`
	__Documentation__000192__Inlined.Text = `The delayed-turn element indicates a normal turn that is
                            delayed until the end of the current note.`
	__Documentation__000192__Inlined.Source = ``
	__Documentation__000192__Inlined.Lang = ``

	__Documentation__000193__Inlined.Name = `_Inlined`
	__Documentation__000193__Inlined.Text = `The accordion-middle element indicates the presence of 1 to 3
                        dots in the middle (8') section of the registration symbol. This element is
                        omitted if no dots are present.`
	__Documentation__000193__Inlined.Source = ``
	__Documentation__000193__Inlined.Lang = ``

	__Documentation__000194__Inlined.Name = `_Inlined`
	__Documentation__000194__Inlined.Text = `The chromatic element represents the number of semitones
                        needed to get from written to sounding pitch. This value does not include
                        octave-change values; the values for both elements need to be added to the
                        written pitch to get the correct sounding pitch.`
	__Documentation__000194__Inlined.Source = ``
	__Documentation__000194__Inlined.Lang = ``

	__Documentation__000195__Inlined.Name = `_Inlined`
	__Documentation__000195__Inlined.Text = `The open element represents the open symbol, which looks like
                        a circle. The smufl attribute can be used to distinguish different SMuFL
                        glyphs that have a similar appearance such as brassMuteOpen and
                        guitarOpenPedal. If not present, the default glyph is brassMuteOpen.`
	__Documentation__000195__Inlined.Source = ``
	__Documentation__000195__Inlined.Lang = ``

	__Documentation__000196__Inlined.Name = `_Inlined`
	__Documentation__000196__Inlined.Text = `The line-height attribute specifies text leading. Values are either
                "normal" or a number representing the percentage of the current font height to use
                for leading. The default is "normal". The exact normal value is
                implementation-dependent, but values between 100 and 120 are recommended.`
	__Documentation__000196__Inlined.Source = ``
	__Documentation__000196__Inlined.Lang = ``

	__Documentation__000197__Inlined.Name = `_Inlined`
	__Documentation__000197__Inlined.Text = `The part-symbol element indicates how a symbol for a
                        multi-staff part is indicated in the score.`
	__Documentation__000197__Inlined.Source = ``
	__Documentation__000197__Inlined.Lang = ``

	__Documentation__000198__Inlined.Name = `_Inlined`
	__Documentation__000198__Inlined.Text = `The stopped element represents the stopped symbol, which looks
                        like a plus sign. The smufl attribute distinguishes different SMuFL glyphs
                        that have a similar appearance such as handbellsMalletBellSuspended and
                        guitarClosePedal. If not present, the default glyph is brassMuteClosed.`
	__Documentation__000198__Inlined.Source = ``
	__Documentation__000198__Inlined.Lang = ``

	__Documentation__000199__Inlined.Name = `_Inlined`
	__Documentation__000199__Inlined.Text = `The damp-all element specifies a harp damping mark for all
                        strings.`
	__Documentation__000199__Inlined.Source = ``
	__Documentation__000199__Inlined.Lang = ``

	__Documentation__000200__Inlined.Name = `_Inlined`
	__Documentation__000200__Inlined.Text = `The bend-alter element indicates the number of semitones in
                        the bend, similar to the alter element. As with the alter element, numbers
                        like 0.5 can be used to indicate microtones. Negative values indicate
                        pre-bends or releases. The pre-bend and release elements are used to
                        distinguish what is intended. Because the bend-alter element represents the
                        number of steps in the bend, a release after a bend has a negative
                        bend-alter value, not a zero value.`
	__Documentation__000200__Inlined.Source = ``
	__Documentation__000200__Inlined.Lang = ``

	__Documentation__000201__Inlined.Name = `_Inlined`
	__Documentation__000201__Inlined.Text = `The optional hole-shape element indicates the shape of the
                        hole symbol; the default is a circle.`
	__Documentation__000201__Inlined.Source = ``
	__Documentation__000201__Inlined.Lang = ``

	__Documentation__000202__Inlined.Name = `_Inlined`
	__Documentation__000202__Inlined.Text = `The artificial element indicates that this is an
                            artificial harmonic.`
	__Documentation__000202__Inlined.Source = ``
	__Documentation__000202__Inlined.Lang = ``

	__Documentation__000203__Inlined.Name = `_Inlined`
	__Documentation__000203__Inlined.Text = `Formatting specified in the group-abbreviation-display element
                        overrides formatting specified in the group-abbreviation element.`
	__Documentation__000203__Inlined.Source = ``
	__Documentation__000203__Inlined.Lang = ``

	__Documentation__000204__Inlined.Name = `_Inlined`
	__Documentation__000204__Inlined.Text = `The stress element indicates a stressed note.`
	__Documentation__000204__Inlined.Source = ``
	__Documentation__000204__Inlined.Lang = ``

	__Documentation__000205__Inlined.Name = `_Inlined`
	__Documentation__000205__Inlined.Text = `The pre-bend element indicates that a bend is a pre-bend
                            rather than a normal bend or a release.`
	__Documentation__000205__Inlined.Source = ``
	__Documentation__000205__Inlined.Lang = ``

	__Documentation__000206__Inlined.Name = `_Inlined`
	__Documentation__000206__Inlined.Text = `The turn element is the normal turn shape which goes up
                            then down.`
	__Documentation__000206__Inlined.Source = ``
	__Documentation__000206__Inlined.Lang = ``

	__Documentation__000207__Inlined.Name = `_Inlined`
	__Documentation__000207__Inlined.Text = `The base pitch is the pitch at which the string is played
                            before touching to create the harmonic.`
	__Documentation__000207__Inlined.Source = ``
	__Documentation__000207__Inlined.Lang = ``

	__Documentation__000208__Inlined.Name = `_Inlined`
	__Documentation__000208__Inlined.Text = `The brass-bend element represents the u-shaped bend symbol
                        used in brass notation, distinct from the bend element used in guitar music.`
	__Documentation__000208__Inlined.Source = ``
	__Documentation__000208__Inlined.Lang = ``

	__Documentation__000209__Inlined.Name = `_Inlined`
	__Documentation__000209__Inlined.Text = `The virtual-library element indicates the virtual instrument
                        library name.`
	__Documentation__000209__Inlined.Source = ``
	__Documentation__000209__Inlined.Lang = ``

	__Documentation__000210__Inlined.Name = `_Inlined`
	__Documentation__000210__Inlined.Text = `The work-title element specifies the title of a work, not
                        including its opus or other work number.`
	__Documentation__000210__Inlined.Source = ``
	__Documentation__000210__Inlined.Lang = ``

	__Documentation__000211__Inlined.Name = `_Inlined`
	__Documentation__000211__Inlined.Text = `The open-string element represents the zero-shaped open string
                        symbol.`
	__Documentation__000211__Inlined.Source = ``
	__Documentation__000211__Inlined.Lang = ``

	__Documentation__000212__Inlined.Name = `_Inlined`
	__Documentation__000212__Inlined.Text = `The printout attribute group collects the different controls over
                printing an object (e.g. a note or rest) and its parts, including augmentation dots
                and lyrics. This is especially useful for notes that overlap in different voices, or
                for chord sheets that contain lyrics and chords but no melody. By default, all these
                attributes are set to yes. If print-object is set to no, the print-dot and
                print-lyric attributes are interpreted to also be set to no if they are not present.`
	__Documentation__000212__Inlined.Source = ``
	__Documentation__000212__Inlined.Lang = ``

	__Documentation__000213__Inlined.Name = `_Inlined`
	__Documentation__000213__Inlined.Text = `The octave-change element indicates how many octaves to add to
                        get from written pitch to sounding pitch. The octave-change element should
                        be included when using transposition intervals of an octave or more, and
                        should not be present for intervals of less than an octave.`
	__Documentation__000213__Inlined.Source = ``
	__Documentation__000213__Inlined.Lang = ``

	__Documentation__000214__Inlined.Name = `_Inlined`
	__Documentation__000214__Inlined.Text = `Non-traditional key signatures are represented using a list of
                        altered tones. The key-accidental element indicates the accidental to be
                        displayed in the key signature, represented in the same manner as the
                        accidental element. It is used for disambiguating microtonal accidentals.`
	__Documentation__000214__Inlined.Source = ``
	__Documentation__000214__Inlined.Lang = ``

	__Documentation__000215__Inlined.Name = `_Inlined`
	__Documentation__000215__Inlined.Text = `The bezier attribute group is used to indicate the curvature of slurs
                and ties, representing the control points for a cubic bezier curve. For ties, the
                bezier attribute group is used with the tied element. Normal slurs, S-shaped slurs,
                and ties need only two bezier points: one associated with the start of the slur or
                tie, the other with the stop. Complex slurs and slurs divided over system breaks can
                specify additional bezier data at slur elements with a continue type. The bezier-x,
                bezier-y, and bezier-offset attributes describe the outgoing bezier point for slurs
                and ties with a start type, and the incoming bezier point for slurs and ties with
                types of stop or continue. The bezier-x2, bezier-y2, and bezier-offset2 attributes
                are only valid with slurs of type continue, and describe the outgoing bezier point.
                The bezier-x, bezier-y, bezier-x2, and bezier-y2 attributes are specified in tenths,
                relative to any position settings associated with the slur or tied element. The
                bezier-offset and bezier-offset2 attributes are measured in terms of musical
                divisions, like the offset element. The bezier-offset and bezier-offset2 attributes
                are deprecated as of MusicXML 3.1. If both the bezier-x and bezier-offset attributes
                are present, the bezier-x attribute takes priority. Similarly, the bezier-x2
                attribute takes priority over the bezier-offset2 attribute. The two types of bezier
                attributes are not additive.`
	__Documentation__000215__Inlined.Source = ``
	__Documentation__000215__Inlined.Lang = ``

	__Documentation__000216__Inlined.Name = `_Inlined`
	__Documentation__000216__Inlined.Text = `Non-traditional key signatures are represented using a list of
                        altered tones. The key-step element indicates the pitch step to be altered,
                        represented using the same names as in the step element.`
	__Documentation__000216__Inlined.Source = ``
	__Documentation__000216__Inlined.Lang = ``

	__Documentation__000217_above_below_Inlined_Inlined.Name = `above-below_Inlined_Inlined`
	__Documentation__000217_above_below_Inlined_Inlined.Text = `The above-below type is used to indicate whether one element appears
                above or below another element.`
	__Documentation__000217_above_below_Inlined_Inlined.Source = ``
	__Documentation__000217_above_below_Inlined_Inlined.Lang = ``

	__Documentation__000218_accidental_mark_Inlined_Inlined.Name = `accidental-mark_Inlined_Inlined`
	__Documentation__000218_accidental_mark_Inlined_Inlined.Text = `An accidental-mark can be used as a separate notation or as part of an
                ornament. When used in an ornament, position and placement are relative to the
                ornament, not relative to the note.`
	__Documentation__000218_accidental_mark_Inlined_Inlined.Source = ``
	__Documentation__000218_accidental_mark_Inlined_Inlined.Lang = ``

	__Documentation__000219_accidental_text_Inlined_Inlined.Name = `accidental-text_Inlined_Inlined`
	__Documentation__000219_accidental_text_Inlined_Inlined.Text = `The accidental-text type represents an element with an accidental
                value and text-formatting attributes.`
	__Documentation__000219_accidental_text_Inlined_Inlined.Source = ``
	__Documentation__000219_accidental_text_Inlined_Inlined.Lang = ``

	__Documentation__000220_accidental_value_Inlined_Inlined.Name = `accidental-value_Inlined_Inlined`
	__Documentation__000220_accidental_value_Inlined_Inlined.Text = `The accidental-value type represents notated accidentals supported by
                MusicXML. In the MusicXML 2.0 DTD this was a string with values that could be
                included. The XSD strengthens the data typing to an enumerated list. The quarter-
                and three-quarters- accidentals are Tartini-style quarter-tone accidentals. The
                -down and -up accidentals are quarter-tone accidentals that include arrows pointing
                down or up. The slash- accidentals are used in Turkish classical music. The numbered
                sharp and flat accidentals are superscripted versions of the accidental signs, used
                in Turkish folk music. The sori and koron accidentals are microtonal sharp and flat
                accidentals used in Iranian and Persian music. The other accidental covers
                accidentals other than those listed here. It is usually used in combination with the
                smufl attribute to specify a particular SMuFL accidental. The smufl attribute may be
                used with any accidental value to help specify the appearance of symbols that share
                the same MusicXML semantics.`
	__Documentation__000220_accidental_value_Inlined_Inlined.Source = ``
	__Documentation__000220_accidental_value_Inlined_Inlined.Lang = ``

	__Documentation__000221_accidental_Inlined_Inlined.Name = `accidental_Inlined_Inlined`
	__Documentation__000221_accidental_Inlined_Inlined.Text = `The accidental type represents actual notated accidentals. Editorial
                and cautionary indications are indicated by attributes. Values for these attributes
                are "no" if not present. Specific graphic display such as parentheses, brackets, and
                size are controlled by the level-display attribute group.`
	__Documentation__000221_accidental_Inlined_Inlined.Source = ``
	__Documentation__000221_accidental_Inlined_Inlined.Lang = ``

	__Documentation__000222_accord_Inlined_Inlined.Name = `accord_Inlined_Inlined`
	__Documentation__000222_accord_Inlined_Inlined.Text = `The accord type represents the tuning of a single string in the
                scordatura element. It uses the same group of elements as the staff-tuning element.
                Strings are numbered from high to low.`
	__Documentation__000222_accord_Inlined_Inlined.Source = ``
	__Documentation__000222_accord_Inlined_Inlined.Lang = ``

	__Documentation__000223_accordion_middle_Inlined_Inlined.Name = `accordion-middle_Inlined_Inlined`
	__Documentation__000223_accordion_middle_Inlined_Inlined.Text = `The accordion-middle type may have values of 1, 2, or 3, corresponding
                to having 1 to 3 dots in the middle section of the accordion registration symbol.
                This type is not used if no dots are present.`
	__Documentation__000223_accordion_middle_Inlined_Inlined.Source = ``
	__Documentation__000223_accordion_middle_Inlined_Inlined.Lang = ``

	__Documentation__000224_accordion_registration_Inlined_Inlined.Name = `accordion-registration_Inlined_Inlined`
	__Documentation__000224_accordion_registration_Inlined_Inlined.Text = `The accordion-registration type is used for accordion registration
                symbols. These are circular symbols divided horizontally into high, middle, and low
                sections that correspond to 4', 8', and 16' pipes. Each accordion-high,
                accordion-middle, and accordion-low element represents the presence of one or more
                dots in the registration diagram. An accordion-registration element needs to have at
                least one of the child elements present.`
	__Documentation__000224_accordion_registration_Inlined_Inlined.Source = ``
	__Documentation__000224_accordion_registration_Inlined_Inlined.Lang = ``

	__Documentation__000225_all_margins_Inlined_Inlined.Name = `all-margins_Inlined_Inlined`
	__Documentation__000225_all_margins_Inlined_Inlined.Text = `The all-margins group specifies both horizontal and vertical margins
                in tenths.`
	__Documentation__000225_all_margins_Inlined_Inlined.Source = ``
	__Documentation__000225_all_margins_Inlined_Inlined.Lang = ``

	__Documentation__000226_appearance_Inlined_Inlined.Name = `appearance_Inlined_Inlined`
	__Documentation__000226_appearance_Inlined_Inlined.Text = `The appearance type controls general graphical settings for the
                music's final form appearance on a printed page of display. This includes support
                for line widths, definitions for note sizes, and standard distances between notation
                elements, plus an extension element for other aspects of appearance.`
	__Documentation__000226_appearance_Inlined_Inlined.Source = ``
	__Documentation__000226_appearance_Inlined_Inlined.Lang = ``

	__Documentation__000227_arpeggiate_Inlined_Inlined.Name = `arpeggiate_Inlined_Inlined`
	__Documentation__000227_arpeggiate_Inlined_Inlined.Text = `The arpeggiate type indicates that this note is part of an arpeggiated
                chord. The number attribute can be used to distinguish between two simultaneous
                chords arpeggiated separately (different numbers) or together (same number). The
                direction attribute is used if there is an arrow on the arpeggio sign. By default,
                arpeggios go from the lowest to highest note. The length of the sign can be
                determined from the position attributes for the arpeggiate elements used with the
                top and bottom notes of the arpeggiated chord. If the unbroken attribute is set to
                yes, it indicates that the arpeggio continues onto another staff within the part.
                This serves as a hint to applications and is not required for cross-staff arpeggios.`
	__Documentation__000227_arpeggiate_Inlined_Inlined.Source = ``
	__Documentation__000227_arpeggiate_Inlined_Inlined.Lang = ``

	__Documentation__000228_arrow_direction_Inlined_Inlined.Name = `arrow-direction_Inlined_Inlined`
	__Documentation__000228_arrow_direction_Inlined_Inlined.Text = `The arrow-direction type represents the direction in which an arrow
                points, using Unicode arrow terminology.`
	__Documentation__000228_arrow_direction_Inlined_Inlined.Source = ``
	__Documentation__000228_arrow_direction_Inlined_Inlined.Lang = ``

	__Documentation__000229_arrow_style_Inlined_Inlined.Name = `arrow-style_Inlined_Inlined`
	__Documentation__000229_arrow_style_Inlined_Inlined.Text = `The arrow-style type represents the style of an arrow, using Unicode
                arrow terminology. Filled and hollow arrows indicate polygonal single arrows. Paired
                arrows are duplicate single arrows in the same direction. Combined arrows apply to
                double direction arrows like left right, indicating that an arrow in one direction
                should be combined with an arrow in the other direction.`
	__Documentation__000229_arrow_style_Inlined_Inlined.Source = ``
	__Documentation__000229_arrow_style_Inlined_Inlined.Lang = ``

	__Documentation__000230_arrow_Inlined_Inlined.Name = `arrow_Inlined_Inlined`
	__Documentation__000230_arrow_Inlined_Inlined.Text = `The arrow element represents an arrow used for a musical technical
                indication. It can represent both Unicode and SMuFL arrows. The presence of an
                arrowhead element indicates that only the arrowhead is displayed, not the arrow
                stem. The smufl attribute distinguishes different SMuFL glyphs that have an arrow
                appearance such as arrowBlackUp, guitarStrumUp, or handbellsSwingUp. The specified
                glyph should match the descriptive representation.`
	__Documentation__000230_arrow_Inlined_Inlined.Source = ``
	__Documentation__000230_arrow_Inlined_Inlined.Lang = ``

	__Documentation__000231_articulations_Inlined_Inlined.Name = `articulations_Inlined_Inlined`
	__Documentation__000231_articulations_Inlined_Inlined.Text = `Articulations and accents are grouped together here.`
	__Documentation__000231_articulations_Inlined_Inlined.Source = ``
	__Documentation__000231_articulations_Inlined_Inlined.Lang = ``

	__Documentation__000232_assess_Inlined_Inlined.Name = `assess_Inlined_Inlined`
	__Documentation__000232_assess_Inlined_Inlined.Text = `By default, an assessment application should assess all notes without
                a cue child element, and not assess any note with a cue child element. The assess
                type allows this default assessment to be overridden for individual notes. The
                optional player and time-only attributes restrict the type to apply to a single
                player or set of times through a repeated section, respectively. If missing, the
                type applies to all players or all times through the repeated section, respectively.
                The player attribute references the id attribute of a player element defined within
                the matching score-part.`
	__Documentation__000232_assess_Inlined_Inlined.Source = ``
	__Documentation__000232_assess_Inlined_Inlined.Lang = ``

	__Documentation__000233_attributes_Inlined_Inlined.Name = `attributes_Inlined_Inlined`
	__Documentation__000233_attributes_Inlined_Inlined.Text = `The attributes element contains musical information that typically
                changes on measure boundaries. This includes key and time signatures, clefs,
                transpositions, and staving. When attributes are changed mid-measure, it affects the
                music in score order, not in MusicXML document order.`
	__Documentation__000233_attributes_Inlined_Inlined.Source = ``
	__Documentation__000233_attributes_Inlined_Inlined.Lang = ``

	__Documentation__000234_backup_Inlined_Inlined.Name = `backup_Inlined_Inlined`
	__Documentation__000234_backup_Inlined_Inlined.Text = `The backup and forward elements are required to coordinate multiple
                voices in one part, including music on multiple staves. The backup type is generally
                used to move between voices and staves. Thus the backup element does not include
                voice or staff elements. Duration values should always be positive, and should not
                cross measure boundaries or mid-measure changes in the divisions value.`
	__Documentation__000234_backup_Inlined_Inlined.Source = ``
	__Documentation__000234_backup_Inlined_Inlined.Lang = ``

	__Documentation__000235_backward_forward_Inlined_Inlined.Name = `backward-forward_Inlined_Inlined`
	__Documentation__000235_backward_forward_Inlined_Inlined.Text = `The backward-forward type is used to specify repeat directions. The
                start of the repeat has a forward direction while the end of the repeat has a
                backward direction.`
	__Documentation__000235_backward_forward_Inlined_Inlined.Source = ``
	__Documentation__000235_backward_forward_Inlined_Inlined.Lang = ``

	__Documentation__000236_bar_style_color_Inlined_Inlined.Name = `bar-style-color_Inlined_Inlined`
	__Documentation__000236_bar_style_color_Inlined_Inlined.Text = `The bar-style-color type contains barline style and color information.`
	__Documentation__000236_bar_style_color_Inlined_Inlined.Source = ``
	__Documentation__000236_bar_style_color_Inlined_Inlined.Lang = ``

	__Documentation__000237_bar_style_Inlined_Inlined.Name = `bar-style_Inlined_Inlined`
	__Documentation__000237_bar_style_Inlined_Inlined.Text = `The bar-style type represents barline style information. Choices are
                regular, dotted, dashed, heavy, light-light, light-heavy, heavy-light, heavy-heavy,
                tick (a short stroke through the top line), short (a partial barline between the 2nd
                and 4th lines), and none.`
	__Documentation__000237_bar_style_Inlined_Inlined.Source = ``
	__Documentation__000237_bar_style_Inlined_Inlined.Lang = ``

	__Documentation__000238_barline_Inlined_Inlined.Name = `barline_Inlined_Inlined`
	__Documentation__000238_barline_Inlined_Inlined.Text = `If a barline is other than a normal single barline, it should be
                represented by a barline type that describes it. This includes information about
                repeats and multiple endings, as well as line style. Barline data is on the same
                level as the other musical data in a score - a child of a measure in a partwise
                score, or a part in a timewise score. This allows for barlines within measures, as
                in dotted barlines that subdivide measures in complex meters. The two fermata
                elements allow for fermatas on both sides of the barline (the lower one inverted).
                Barlines have a location attribute to make it easier to process barlines
                independently of the other musical data in a score. It is often easier to set up
                measures separately from entering notes. The location attribute must match where the
                barline element occurs within the rest of the musical data in the score. If location
                is left, it should be the first element in the measure, aside from the print,
                bookmark, and link elements. If location is right, it should be the last element,
                again with the possible exception of the print, bookmark, and link elements. If no
                location is specified, the right barline is the default. The segno, coda, and
                divisions attributes work the same way as in the sound element. They are used for
                playback when barline elements contain segno or coda child elements.`
	__Documentation__000238_barline_Inlined_Inlined.Source = ``
	__Documentation__000238_barline_Inlined_Inlined.Lang = ``

	__Documentation__000239_barre_Inlined_Inlined.Name = `barre_Inlined_Inlined`
	__Documentation__000239_barre_Inlined_Inlined.Text = `The barre element indicates placing a finger over multiple strings on
                a single fret. The type is "start" for the lowest pitched string (e.g., the string
                with the highest MusicXML number) and is "stop" for the highest pitched string.`
	__Documentation__000239_barre_Inlined_Inlined.Source = ``
	__Documentation__000239_barre_Inlined_Inlined.Lang = ``

	__Documentation__000240_bass_step_Inlined_Inlined.Name = `bass-step_Inlined_Inlined`
	__Documentation__000240_bass_step_Inlined_Inlined.Text = `The bass-step type represents the pitch step of the bass of the
                current chord within the harmony element. The text attribute indicates how the bass
                should appear in a score if not using the element contents.`
	__Documentation__000240_bass_step_Inlined_Inlined.Source = ``
	__Documentation__000240_bass_step_Inlined_Inlined.Lang = ``

	__Documentation__000241_bass_Inlined_Inlined.Name = `bass_Inlined_Inlined`
	__Documentation__000241_bass_Inlined_Inlined.Text = `The bass type is used to indicate a bass note in popular music chord
                symbols, e.g. G/C. It is generally not used in functional harmony, as inversion is
                generally not used in pop chord symbols. As with root, it is divided into step and
                alter elements, similar to pitches. The arrangement attribute specifies where the
                bass is displayed relative to what precedes it.`
	__Documentation__000241_bass_Inlined_Inlined.Source = ``
	__Documentation__000241_bass_Inlined_Inlined.Lang = ``

	__Documentation__000242_beam_level_Inlined_Inlined.Name = `beam-level_Inlined_Inlined`
	__Documentation__000242_beam_level_Inlined_Inlined.Text = `The MusicXML format supports six levels of beaming, up to 1024th
                notes. Unlike the number-level type, the beam-level type identifies concurrent beams
                in a beam group. It does not distinguish overlapping beams such as grace notes
                within regular notes, or beams used in different voices.`
	__Documentation__000242_beam_level_Inlined_Inlined.Source = ``
	__Documentation__000242_beam_level_Inlined_Inlined.Lang = ``

	__Documentation__000243_beam_value_Inlined_Inlined.Name = `beam-value_Inlined_Inlined`
	__Documentation__000243_beam_value_Inlined_Inlined.Text = `The beam-value type represents the type of beam associated with each
                of 8 beam levels (up to 1024th notes) available for each note.`
	__Documentation__000243_beam_value_Inlined_Inlined.Source = ``
	__Documentation__000243_beam_value_Inlined_Inlined.Lang = ``

	__Documentation__000244_beam_Inlined_Inlined.Name = `beam_Inlined_Inlined`
	__Documentation__000244_beam_Inlined_Inlined.Text = `Beam values include begin, continue, end, forward hook, and backward
                hook. Up to eight concurrent beams are available to cover up to 1024th notes. Each
                beam in a note is represented with a separate beam element, starting with the eighth
                note beam using a number attribute of 1. Note that the beam number does not
                distinguish sets of beams that overlap, as it does for slur and other elements.
                Beaming groups are distinguished by being in different voices and/or the presence or
                absence of grace and cue elements. Beams that have a begin value can also have a fan
                attribute to indicate accelerandos and ritardandos using fanned beams. The fan
                attribute may also be used with a continue value if the fanning direction changes on
                that note. The value is "none" if not specified. The repeater attribute has been
                deprecated in MusicXML 3.0. Formerly used for tremolos, it needs to be specified
                with a "yes" value for each beam using it.`
	__Documentation__000244_beam_Inlined_Inlined.Source = ``
	__Documentation__000244_beam_Inlined_Inlined.Lang = ``

	__Documentation__000245_beat_repeat_Inlined_Inlined.Name = `beat-repeat_Inlined_Inlined`
	__Documentation__000245_beat_repeat_Inlined_Inlined.Text = `The beat-repeat type is used to indicate that a single beat (but
                possibly many notes) is repeated. The slashes attribute specifies the number of
                slashes to use in the symbol. The use-dots attribute indicates whether or not to use
                dots as well (for instance, with mixed rhythm patterns). The value for slashes is 1
                and the value for use-dots is no if not specified. The stop type indicates the first
                beat where the repeats are no longer displayed. Both the start and stop of the beat
                being repeated should be specified unless the repeats are displayed through the end
                of the part. The beat-repeat element specifies a notation style for repetitions. The
                actual music being repeated needs to be repeated within the MusicXML file. This
                element specifies the notation that indicates the repeat.`
	__Documentation__000245_beat_repeat_Inlined_Inlined.Source = ``
	__Documentation__000245_beat_repeat_Inlined_Inlined.Lang = ``

	__Documentation__000246_beat_unit_tied_Inlined_Inlined.Name = `beat-unit-tied_Inlined_Inlined`
	__Documentation__000246_beat_unit_tied_Inlined_Inlined.Text = `The beat-unit-tied type indicates a beat-unit within a metronome mark
                that is tied to the preceding beat-unit. This allows two or more tied notes to be
                associated with a per-minute value in a metronome mark, whereas the metronome-tied
                element is restricted to metric relationship marks.`
	__Documentation__000246_beat_unit_tied_Inlined_Inlined.Source = ``
	__Documentation__000246_beat_unit_tied_Inlined_Inlined.Lang = ``

	__Documentation__000247_beat_unit_Inlined_Inlined.Name = `beat-unit_Inlined_Inlined`
	__Documentation__000247_beat_unit_Inlined_Inlined.Text = `The beat-unit group combines elements used repeatedly in the metronome
                element to specify a note within a metronome mark.`
	__Documentation__000247_beat_unit_Inlined_Inlined.Source = ``
	__Documentation__000247_beat_unit_Inlined_Inlined.Lang = ``

	__Documentation__000248_beater_value_Inlined_Inlined.Name = `beater-value_Inlined_Inlined`
	__Documentation__000248_beater_value_Inlined_Inlined.Text = `The beater-value type represents pictograms for beaters, mallets, and
                sticks that do not have different materials represented in the pictogram. The finger
                and hammer values are in addition to Stone's list.`
	__Documentation__000248_beater_value_Inlined_Inlined.Source = ``
	__Documentation__000248_beater_value_Inlined_Inlined.Lang = ``

	__Documentation__000249_beater_Inlined_Inlined.Name = `beater_Inlined_Inlined`
	__Documentation__000249_beater_Inlined_Inlined.Text = `The beater type represents pictograms for beaters, mallets, and sticks
                that do not have different materials represented in the pictogram.`
	__Documentation__000249_beater_Inlined_Inlined.Source = ``
	__Documentation__000249_beater_Inlined_Inlined.Lang = ``

	__Documentation__000250_bend_shape_Inlined_Inlined.Name = `bend-shape_Inlined_Inlined`
	__Documentation__000250_bend_shape_Inlined_Inlined.Text = `The bend-shape type distinguishes between the angled bend symbols
                commonly used in standard notation and the curved bend symbols commonly used in both
                tablature and standard notation.`
	__Documentation__000250_bend_shape_Inlined_Inlined.Source = ``
	__Documentation__000250_bend_shape_Inlined_Inlined.Lang = ``

	__Documentation__000251_bend_Inlined_Inlined.Name = `bend_Inlined_Inlined`
	__Documentation__000251_bend_Inlined_Inlined.Text = `The bend type is used in guitar notation and tablature. A single note
                with a bend and release will contain two bend elements: the first to represent the
                bend and the second to represent the release. The shape attribute distinguishes
                between the angled bend symbols commonly used in standard notation and the curved
                bend symbols commonly used in both tablature and standard notation.`
	__Documentation__000251_bend_Inlined_Inlined.Source = ``
	__Documentation__000251_bend_Inlined_Inlined.Lang = ``

	__Documentation__000252_bookmark_Inlined_Inlined.Name = `bookmark_Inlined_Inlined`
	__Documentation__000252_bookmark_Inlined_Inlined.Text = `The bookmark type serves as a well-defined target for an incoming
                simple XLink.`
	__Documentation__000252_bookmark_Inlined_Inlined.Source = ``
	__Documentation__000252_bookmark_Inlined_Inlined.Lang = ``

	__Documentation__000253_bracket_Inlined_Inlined.Name = `bracket_Inlined_Inlined`
	__Documentation__000253_bracket_Inlined_Inlined.Text = `Brackets are combined with words in a variety of modern directions.
                The line-end attribute specifies if there is a jog up or down (or both), an arrow,
                or nothing at the start or end of the bracket. If the line-end is up or down, the
                length of the jog can be specified using the end-length attribute. The line-type is
                solid if not specified.`
	__Documentation__000253_bracket_Inlined_Inlined.Source = ``
	__Documentation__000253_bracket_Inlined_Inlined.Lang = ``

	__Documentation__000254_breath_mark_value_Inlined_Inlined.Name = `breath-mark-value_Inlined_Inlined`
	__Documentation__000254_breath_mark_value_Inlined_Inlined.Text = `The breath-mark-value type represents the symbol used for a breath
                mark.`
	__Documentation__000254_breath_mark_value_Inlined_Inlined.Source = ``
	__Documentation__000254_breath_mark_value_Inlined_Inlined.Lang = ``

	__Documentation__000255_breath_mark_Inlined_Inlined.Name = `breath-mark_Inlined_Inlined`
	__Documentation__000255_breath_mark_Inlined_Inlined.Text = `The breath-mark element indicates a place to take a breath.`
	__Documentation__000255_breath_mark_Inlined_Inlined.Source = ``
	__Documentation__000255_breath_mark_Inlined_Inlined.Lang = ``

	__Documentation__000256_caesura_value_Inlined_Inlined.Name = `caesura-value_Inlined_Inlined`
	__Documentation__000256_caesura_value_Inlined_Inlined.Text = `The caesura-value type represents the shape of the caesura sign.`
	__Documentation__000256_caesura_value_Inlined_Inlined.Source = ``
	__Documentation__000256_caesura_value_Inlined_Inlined.Lang = ``

	__Documentation__000257_caesura_Inlined_Inlined.Name = `caesura_Inlined_Inlined`
	__Documentation__000257_caesura_Inlined_Inlined.Text = `The caesura element indicates a slight pause. It is notated using a
                "railroad tracks" symbol or other variations specified in the element content.`
	__Documentation__000257_caesura_Inlined_Inlined.Source = ``
	__Documentation__000257_caesura_Inlined_Inlined.Lang = ``

	__Documentation__000258_cancel_location_Inlined_Inlined.Name = `cancel-location_Inlined_Inlined`
	__Documentation__000258_cancel_location_Inlined_Inlined.Text = `The cancel-location type is used to indicate where a key signature
                cancellation appears relative to a new key signature: to the left, to the right, or
                before the barline and to the left. It is left by default. For mid-measure key
                elements, a cancel-location of before-barline should be treated like a
                cancel-location of left.`
	__Documentation__000258_cancel_location_Inlined_Inlined.Source = ``
	__Documentation__000258_cancel_location_Inlined_Inlined.Lang = ``

	__Documentation__000259_cancel_Inlined_Inlined.Name = `cancel_Inlined_Inlined`
	__Documentation__000259_cancel_Inlined_Inlined.Text = `A cancel element indicates that the old key signature should be
                cancelled before the new one appears. This will always happen when changing to C
                major or A minor and need not be specified then. The cancel value matches the fifths
                value of the cancelled key signature (e.g., a cancel of -2 will provide an explicit
                cancellation for changing from B flat major to F major). The optional location
                attribute indicates where the cancellation appears relative to the new key
                signature.`
	__Documentation__000259_cancel_Inlined_Inlined.Source = ``
	__Documentation__000259_cancel_Inlined_Inlined.Lang = ``

	__Documentation__000260_circular_arrow_Inlined_Inlined.Name = `circular-arrow_Inlined_Inlined`
	__Documentation__000260_circular_arrow_Inlined_Inlined.Text = `The circular-arrow type represents the direction in which a circular
                arrow points, using Unicode arrow terminology.`
	__Documentation__000260_circular_arrow_Inlined_Inlined.Source = ``
	__Documentation__000260_circular_arrow_Inlined_Inlined.Lang = ``

	__Documentation__000261_clef_sign_Inlined_Inlined.Name = `clef-sign_Inlined_Inlined`
	__Documentation__000261_clef_sign_Inlined_Inlined.Text = `The clef-sign type represents the different clef symbols. The jianpu
                sign indicates that the music that follows should be in jianpu numbered notation,
                just as the TAB sign indicates that the music that follows should be in tablature
                notation. Unlike TAB, a jianpu sign does not correspond to a visual clef notation.
                The none sign is deprecated as of MusicXML 4.0. Use the clef element's print-object
                attribute instead. When the none sign is used, notes should be displayed as if in
                treble clef.`
	__Documentation__000261_clef_sign_Inlined_Inlined.Source = ``
	__Documentation__000261_clef_sign_Inlined_Inlined.Lang = ``

	__Documentation__000262_clef_Inlined_Inlined.Name = `clef_Inlined_Inlined`
	__Documentation__000262_clef_Inlined_Inlined.Text = `Clefs are represented by a combination of sign, line, and
                clef-octave-change elements. The optional number attribute refers to staff numbers
                within the part. A value of 1 is assumed if not present. Sometimes clefs are added
                to the staff in non-standard line positions, either to indicate cue passages, or
                when there are multiple clefs present simultaneously on one staff. In this
                situation, the additional attribute is set to "yes" and the line value is ignored.
                The size attribute is used for clefs where the additional attribute is "yes". It is
                typically used to indicate cue clefs. Sometimes clefs at the start of a measure need
                to appear after the barline rather than before, as for cues or for use after a
                repeated section. The after-barline attribute is set to "yes" in this situation. The
                attribute is ignored for mid-measure clefs. Clefs appear at the start of each system
                unless the print-object attribute has been set to "no" or the additional attribute
                has been set to "yes".`
	__Documentation__000262_clef_Inlined_Inlined.Source = ``
	__Documentation__000262_clef_Inlined_Inlined.Lang = ``

	__Documentation__000263_clef_Inlined_Inlined.Name = `clef_Inlined_Inlined`
	__Documentation__000263_clef_Inlined_Inlined.Text = `Clefs are represented by a combination of sign, line, and
                clef-octave-change elements.`
	__Documentation__000263_clef_Inlined_Inlined.Source = ``
	__Documentation__000263_clef_Inlined_Inlined.Lang = ``

	__Documentation__000264_coda_Inlined_Inlined.Name = `coda_Inlined_Inlined`
	__Documentation__000264_coda_Inlined_Inlined.Text = `The coda type is the visual indicator of a coda sign. The exact glyph
                can be specified with the smufl attribute. A sound element is also needed to guide
                playback applications reliably.`
	__Documentation__000264_coda_Inlined_Inlined.Source = ``
	__Documentation__000264_coda_Inlined_Inlined.Lang = ``

	__Documentation__000265_color_Inlined_Inlined.Name = `color_Inlined_Inlined`
	__Documentation__000265_color_Inlined_Inlined.Text = `The color type indicates the color of an element. Color may be
                represented as hexadecimal RGB triples, as in HTML, or as hexadecimal ARGB tuples,
                with the A indicating alpha of transparency. An alpha value of 00 is totally
                transparent; FF is totally opaque. If RGB is used, the A value is assumed to be FF.
                For instance, the RGB value "#800080" represents purple. An ARGB value of
                "#40800080" would be a transparent purple. As in SVG 1.1, colors are defined in
                terms of the sRGB color space (IEC 61966).`
	__Documentation__000265_color_Inlined_Inlined.Source = ``
	__Documentation__000265_color_Inlined_Inlined.Lang = ``

	__Documentation__000266_comma_separated_text_Inlined_Inlined.Name = `comma-separated-text_Inlined_Inlined`
	__Documentation__000266_comma_separated_text_Inlined_Inlined.Text = `The comma-separated-text type is used to specify a comma-separated
                list of text elements, as is used by the font-family attribute.`
	__Documentation__000266_comma_separated_text_Inlined_Inlined.Source = ``
	__Documentation__000266_comma_separated_text_Inlined_Inlined.Lang = ``

	__Documentation__000267_credit_Inlined_Inlined.Name = `credit_Inlined_Inlined`
	__Documentation__000267_credit_Inlined_Inlined.Text = `The credit type represents the appearance of the title, composer,
                arranger, lyricist, copyright, dedication, and other text, symbols, and graphics
                that commonly appear on the first page of a score. The credit-words, credit-symbol,
                and credit-image elements are similar to the words, symbol, and image elements for
                directions. However, since the credit is not part of a measure, the default-x and
                default-y attributes adjust the origin relative to the bottom left-hand corner of
                the page. The enclosure for credit-words and credit-symbol is none by default. By
                default, a series of credit-words and credit-symbol elements within a single credit
                element follow one another in sequence visually. Non-positional formatting
                attributes are carried over from the previous element by default. The page attribute
                for the credit element specifies the page number where the credit should appear.
                This is an integer value that starts with 1 for the first page. Its value is 1 by
                default. Since credits occur before the music, these page numbers do not refer to
                the page numbering specified by the print element's page-number attribute. The
                credit-type element indicates the purpose behind a credit. Multiple types of data
                may be combined in a single credit, so multiple elements may be used. Standard
                values include page number, title, subtitle, composer, arranger, lyricist, rights,
                and part name. `
	__Documentation__000267_credit_Inlined_Inlined.Source = ``
	__Documentation__000267_credit_Inlined_Inlined.Lang = ``

	__Documentation__000268_css_font_size_Inlined_Inlined.Name = `css-font-size_Inlined_Inlined`
	__Documentation__000268_css_font_size_Inlined_Inlined.Text = `The css-font-size type includes the CSS font sizes used as an
                alternative to a numeric point size.`
	__Documentation__000268_css_font_size_Inlined_Inlined.Source = ``
	__Documentation__000268_css_font_size_Inlined_Inlined.Lang = ``

	__Documentation__000269_dashes_Inlined_Inlined.Name = `dashes_Inlined_Inlined`
	__Documentation__000269_dashes_Inlined_Inlined.Text = `The dashes type represents dashes, used for instance with cresc. and
                dim. marks.`
	__Documentation__000269_dashes_Inlined_Inlined.Source = ``
	__Documentation__000269_dashes_Inlined_Inlined.Lang = ``

	__Documentation__000270_defaults_Inlined_Inlined.Name = `defaults_Inlined_Inlined`
	__Documentation__000270_defaults_Inlined_Inlined.Text = `The defaults type specifies score-wide defaults for scaling; whether
                or not the file is a concert score; layout; and default values for the music font,
                word font, lyric font, and lyric language. Except for the concert-score element, if
                any defaults are missing, the choice of what to use is determined by the
                application.`
	__Documentation__000270_defaults_Inlined_Inlined.Source = ``
	__Documentation__000270_defaults_Inlined_Inlined.Lang = ``

	__Documentation__000271_degree_alter_Inlined_Inlined.Name = `degree-alter_Inlined_Inlined`
	__Documentation__000271_degree_alter_Inlined_Inlined.Text = `The degree-alter type represents the chromatic alteration for the
                current degree. If the degree-type value is alter or subtract, the degree-alter
                value is relative to the degree already in the chord based on its kind element. If
                the degree-type value is add, the degree-alter is relative to a dominant chord
                (major and perfect intervals except for a minor seventh). The plus-minus attribute
                is used to indicate if plus and minus symbols should be used instead of sharp and
                flat symbols to display the degree alteration. It is no if not specified.`
	__Documentation__000271_degree_alter_Inlined_Inlined.Source = ``
	__Documentation__000271_degree_alter_Inlined_Inlined.Lang = ``

	__Documentation__000272_degree_symbol_value_Inlined_Inlined.Name = `degree-symbol-value_Inlined_Inlined`
	__Documentation__000272_degree_symbol_value_Inlined_Inlined.Text = `The degree-symbol-value type indicates which symbol should be used in
                specifying a degree.`
	__Documentation__000272_degree_symbol_value_Inlined_Inlined.Source = ``
	__Documentation__000272_degree_symbol_value_Inlined_Inlined.Lang = ``

	__Documentation__000273_degree_type_value_Inlined_Inlined.Name = `degree-type-value_Inlined_Inlined`
	__Documentation__000273_degree_type_value_Inlined_Inlined.Text = `The degree-type-value type indicates whether the current degree
                element is an addition, alteration, or subtraction to the kind of the current chord
                in the harmony element.`
	__Documentation__000273_degree_type_value_Inlined_Inlined.Source = ``
	__Documentation__000273_degree_type_value_Inlined_Inlined.Lang = ``

	__Documentation__000274_degree_type_Inlined_Inlined.Name = `degree-type_Inlined_Inlined`
	__Documentation__000274_degree_type_Inlined_Inlined.Text = `The degree-type type indicates if this degree is an addition,
                alteration, or subtraction relative to the kind of the current chord. The value of
                the degree-type element affects the interpretation of the value of the degree-alter
                element. The text attribute specifies how the type of the degree should be
                displayed.`
	__Documentation__000274_degree_type_Inlined_Inlined.Source = ``
	__Documentation__000274_degree_type_Inlined_Inlined.Lang = ``

	__Documentation__000275_degree_value_Inlined_Inlined.Name = `degree-value_Inlined_Inlined`
	__Documentation__000275_degree_value_Inlined_Inlined.Text = `The content of the degree-value type is a number indicating the degree
                of the chord (1 for the root, 3 for third, etc). The text attribute specifies how
                the value of the degree should be displayed. The symbol attribute indicates that a
                symbol should be used in specifying the degree. If the symbol attribute is present,
                the value of the text attribute follows the symbol.`
	__Documentation__000275_degree_value_Inlined_Inlined.Source = ``
	__Documentation__000275_degree_value_Inlined_Inlined.Lang = ``

	__Documentation__000276_degree_Inlined_Inlined.Name = `degree_Inlined_Inlined`
	__Documentation__000276_degree_Inlined_Inlined.Text = `The degree type is used to add, alter, or subtract individual notes in
                the chord. The print-object attribute can be used to keep the degree from printing
                separately when it has already taken into account in the text attribute of the kind
                element. The degree-value and degree-type text attributes specify how the value and
                type of the degree should be displayed. A harmony of kind "other" can be spelled
                explicitly by using a series of degree elements together with a root.`
	__Documentation__000276_degree_Inlined_Inlined.Source = ``
	__Documentation__000276_degree_Inlined_Inlined.Lang = ``

	__Documentation__000277_direction_type_Inlined_Inlined.Name = `direction-type_Inlined_Inlined`
	__Documentation__000277_direction_type_Inlined_Inlined.Text = `Textual direction types may have more than 1 component due to multiple
                fonts. The dynamics element may also be used in the notations element. Attribute
                groups related to print suggestions apply to the individual direction-type, not to
                the overall direction.`
	__Documentation__000277_direction_type_Inlined_Inlined.Source = ``
	__Documentation__000277_direction_type_Inlined_Inlined.Lang = ``

	__Documentation__000278_direction_Inlined_Inlined.Name = `direction_Inlined_Inlined`
	__Documentation__000278_direction_Inlined_Inlined.Text = `A direction is a musical indication that is not necessarily attached
                to a specific note. Two or more may be combined to indicate words followed by the
                start of a dashed line, the end of a wedge followed by dynamics, etc. For
                applications where a specific direction is indeed attached to a specific note, the
                direction element can be associated with the first note element that follows it in
                score order that is not in a different voice. By default, a series of direction-type
                elements and a series of child elements of a direction-type within a single
                direction element follow one another in sequence visually. For a series of
                direction-type children, non-positional formatting attributes are carried over from
                the previous element by default.`
	__Documentation__000278_direction_Inlined_Inlined.Source = ``
	__Documentation__000278_direction_Inlined_Inlined.Lang = ``

	__Documentation__000279_display_step_octave_Inlined_Inlined.Name = `display-step-octave_Inlined_Inlined`
	__Documentation__000279_display_step_octave_Inlined_Inlined.Text = `The display-step-octave group contains the sequence of elements used
                by both the rest and unpitched elements. This group is used to place rests and
                unpitched elements on the staff without implying that these elements have pitch.
                Positioning follows the current clef. If percussion clef is used, the display-step
                and display-octave elements are interpreted as if in treble clef, with a G in octave
                4 on line 2.`
	__Documentation__000279_display_step_octave_Inlined_Inlined.Source = ``
	__Documentation__000279_display_step_octave_Inlined_Inlined.Lang = ``

	__Documentation__000280_distance_type_Inlined_Inlined.Name = `distance-type_Inlined_Inlined`
	__Documentation__000280_distance_type_Inlined_Inlined.Text = `The distance-type defines what type of distance is being defined in a
                distance element. Values include beam and hyphen. This is left as a string so that
                other application-specific types can be defined, but it is made a separate type so
                that it can be redefined more strictly.`
	__Documentation__000280_distance_type_Inlined_Inlined.Source = ``
	__Documentation__000280_distance_type_Inlined_Inlined.Lang = ``

	__Documentation__000281_distance_Inlined_Inlined.Name = `distance_Inlined_Inlined`
	__Documentation__000281_distance_Inlined_Inlined.Text = `The distance element represents standard distances between notation
                elements in tenths. The type attribute defines what type of distance is being
                defined. Valid values include hyphen (for hyphens in lyrics) and beam.`
	__Documentation__000281_distance_Inlined_Inlined.Source = ``
	__Documentation__000281_distance_Inlined_Inlined.Lang = ``

	__Documentation__000282_divisions_Inlined_Inlined.Name = `divisions_Inlined_Inlined`
	__Documentation__000282_divisions_Inlined_Inlined.Text = `The divisions type is used to express values in terms of the musical
                divisions defined by the divisions element. It is preferred that these be integer
                values both for MIDI interoperability and to avoid roundoff errors.`
	__Documentation__000282_divisions_Inlined_Inlined.Source = ``
	__Documentation__000282_divisions_Inlined_Inlined.Lang = ``

	__Documentation__000283_double_Inlined_Inlined.Name = `double_Inlined_Inlined`
	__Documentation__000283_double_Inlined_Inlined.Text = `The double type indicates that the music is doubled one octave from
                what is currently written. If the above attribute is set to yes, the doubling is one
                octave above what is written, as for mixed flute / piccolo parts in band literature.
                Otherwise the doubling is one octave below what is written, as for mixed cello /
                bass parts in orchestral literature.`
	__Documentation__000283_double_Inlined_Inlined.Source = ``
	__Documentation__000283_double_Inlined_Inlined.Lang = ``

	__Documentation__000284_duration_Inlined_Inlined.Name = `duration_Inlined_Inlined`
	__Documentation__000284_duration_Inlined_Inlined.Text = `The duration element is defined within a group due to its uses within
                the note, figured-bass, backup, and forward elements.`
	__Documentation__000284_duration_Inlined_Inlined.Source = ``
	__Documentation__000284_duration_Inlined_Inlined.Lang = ``

	__Documentation__000285_dynamics_Inlined_Inlined.Name = `dynamics_Inlined_Inlined`
	__Documentation__000285_dynamics_Inlined_Inlined.Text = `Dynamics can be associated either with a note or a general musical
                direction. To avoid inconsistencies between and amongst the letter abbreviations for
                dynamics (what is sf vs. sfz, standing alone or with a trailing dynamic that is not
                always piano), we use the actual letters as the names of these dynamic elements. The
                other-dynamics element allows other dynamic marks that are not covered here.
                Dynamics elements may also be combined to create marks not covered by a single
                element, such as sfmp. These letter dynamic symbols are separated from crescendo,
                decrescendo, and wedge indications. Dynamic representation is inconsistent in
                scores. Many things are assumed by the composer and left out, such as returns to
                original dynamics. The MusicXML format captures what is in the score, but does not
                try to be optimal for analysis or synthesis of dynamics. The placement attribute is
                used when the dynamics are associated with a note. It is ignored when the dynamics
                are associated with a direction. In that case the direction element's placement
                attribute is used instead.`
	__Documentation__000285_dynamics_Inlined_Inlined.Source = ``
	__Documentation__000285_dynamics_Inlined_Inlined.Lang = ``

	__Documentation__000286_editorial_voice_direction_Inlined_Inlined.Name = `editorial-voice-direction_Inlined_Inlined`
	__Documentation__000286_editorial_voice_direction_Inlined_Inlined.Text = `The editorial-voice-direction group supports the common combination of
                editorial and voice information for a direction element. It is separate from the
                editorial-voice element because extensions and restrictions might be different for
                directions than for the note and forward elements.`
	__Documentation__000286_editorial_voice_direction_Inlined_Inlined.Source = ``
	__Documentation__000286_editorial_voice_direction_Inlined_Inlined.Lang = ``

	__Documentation__000287_editorial_voice_Inlined_Inlined.Name = `editorial-voice_Inlined_Inlined`
	__Documentation__000287_editorial_voice_Inlined_Inlined.Text = `The editorial-voice group supports the common combination of editorial
                and voice information for a musical element.`
	__Documentation__000287_editorial_voice_Inlined_Inlined.Source = ``
	__Documentation__000287_editorial_voice_Inlined_Inlined.Lang = ``

	__Documentation__000288_editorial_Inlined_Inlined.Name = `editorial_Inlined_Inlined`
	__Documentation__000288_editorial_Inlined_Inlined.Text = `The editorial group specifies editorial information for a musical
                element.`
	__Documentation__000288_editorial_Inlined_Inlined.Source = ``
	__Documentation__000288_editorial_Inlined_Inlined.Lang = ``

	__Documentation__000289_effect_value_Inlined_Inlined.Name = `effect-value_Inlined_Inlined`
	__Documentation__000289_effect_value_Inlined_Inlined.Text = `The effect-value type represents pictograms for sound effect
                percussion instruments. The cannon, lotus flute, and megaphone values are in
                addition to Stone's list.`
	__Documentation__000289_effect_value_Inlined_Inlined.Source = ``
	__Documentation__000289_effect_value_Inlined_Inlined.Lang = ``

	__Documentation__000290_effect_Inlined_Inlined.Name = `effect_Inlined_Inlined`
	__Documentation__000290_effect_Inlined_Inlined.Text = `The effect type represents pictograms for sound effect percussion
                instruments. The smufl attribute is used to distinguish different SMuFL stylistic
                alternates.`
	__Documentation__000290_effect_Inlined_Inlined.Source = ``
	__Documentation__000290_effect_Inlined_Inlined.Lang = ``

	__Documentation__000291_elision_Inlined_Inlined.Name = `elision_Inlined_Inlined`
	__Documentation__000291_elision_Inlined_Inlined.Text = `The elision type represents an elision between lyric syllables. The
                text content specifies the symbol used to display the elision. Common values are a
                no-break space (Unicode 00A0), an underscore (Unicode 005F), or an undertie (Unicode
                203F). If the text content is empty, the smufl attribute is used to specify the
                symbol to use. Its value is a SMuFL canonical glyph name that starts with lyrics.
                The SMuFL attribute is ignored if the elision glyph is already specified by the text
                content. If neither text content nor a smufl attribute are present, the elision
                glyph is application-specific.`
	__Documentation__000291_elision_Inlined_Inlined.Source = ``
	__Documentation__000291_elision_Inlined_Inlined.Lang = ``

	__Documentation__000292_empty_font_Inlined_Inlined.Name = `empty-font_Inlined_Inlined`
	__Documentation__000292_empty_font_Inlined_Inlined.Text = `The empty-font type represents an empty element with font attributes.`
	__Documentation__000292_empty_font_Inlined_Inlined.Source = ``
	__Documentation__000292_empty_font_Inlined_Inlined.Lang = ``

	__Documentation__000293_empty_line_Inlined_Inlined.Name = `empty-line_Inlined_Inlined`
	__Documentation__000293_empty_line_Inlined_Inlined.Text = `The empty-line type represents an empty element with line-shape,
                line-type, line-length, dashed-formatting, print-style and placement attributes.`
	__Documentation__000293_empty_line_Inlined_Inlined.Source = ``
	__Documentation__000293_empty_line_Inlined_Inlined.Lang = ``

	__Documentation__000294_empty_placement_smufl_Inlined_Inlined.Name = `empty-placement-smufl_Inlined_Inlined`
	__Documentation__000294_empty_placement_smufl_Inlined_Inlined.Text = `The empty-placement-smufl type represents an empty element with
                print-style, placement, and smufl attributes.`
	__Documentation__000294_empty_placement_smufl_Inlined_Inlined.Source = ``
	__Documentation__000294_empty_placement_smufl_Inlined_Inlined.Lang = ``

	__Documentation__000295_empty_placement_Inlined_Inlined.Name = `empty-placement_Inlined_Inlined`
	__Documentation__000295_empty_placement_Inlined_Inlined.Text = `The empty-placement type represents an empty element with print-style
                and placement attributes.`
	__Documentation__000295_empty_placement_Inlined_Inlined.Source = ``
	__Documentation__000295_empty_placement_Inlined_Inlined.Lang = ``

	__Documentation__000296_empty_print_object_style_align_Inlined_Inlined.Name = `empty-print-object-style-align_Inlined_Inlined`
	__Documentation__000296_empty_print_object_style_align_Inlined_Inlined.Text = `The empty-print-style-align-object type represents an empty element
                with print-object and print-style-align attribute groups.`
	__Documentation__000296_empty_print_object_style_align_Inlined_Inlined.Source = ``
	__Documentation__000296_empty_print_object_style_align_Inlined_Inlined.Lang = ``

	__Documentation__000297_empty_print_style_align_id_Inlined_Inlined.Name = `empty-print-style-align-id_Inlined_Inlined`
	__Documentation__000297_empty_print_style_align_id_Inlined_Inlined.Text = `The empty-print-style-align-id type represents an empty element with
                print-style-align and optional-unique-id attribute groups.`
	__Documentation__000297_empty_print_style_align_id_Inlined_Inlined.Source = ``
	__Documentation__000297_empty_print_style_align_id_Inlined_Inlined.Lang = ``

	__Documentation__000298_empty_print_style_align_Inlined_Inlined.Name = `empty-print-style-align_Inlined_Inlined`
	__Documentation__000298_empty_print_style_align_Inlined_Inlined.Text = `The empty-print-style-align type represents an empty element with
                print-style-align attribute group.`
	__Documentation__000298_empty_print_style_align_Inlined_Inlined.Source = ``
	__Documentation__000298_empty_print_style_align_Inlined_Inlined.Lang = ``

	__Documentation__000299_empty_print_style_Inlined_Inlined.Name = `empty-print-style_Inlined_Inlined`
	__Documentation__000299_empty_print_style_Inlined_Inlined.Text = `The empty-print-style type represents an empty element with
                print-style attribute group.`
	__Documentation__000299_empty_print_style_Inlined_Inlined.Source = ``
	__Documentation__000299_empty_print_style_Inlined_Inlined.Lang = ``

	__Documentation__000300_empty_trill_sound_Inlined_Inlined.Name = `empty-trill-sound_Inlined_Inlined`
	__Documentation__000300_empty_trill_sound_Inlined_Inlined.Text = `The empty-trill-sound type represents an empty element with
                print-style, placement, and trill-sound attributes.`
	__Documentation__000300_empty_trill_sound_Inlined_Inlined.Source = ``
	__Documentation__000300_empty_trill_sound_Inlined_Inlined.Lang = ``

	__Documentation__000301_empty_Inlined_Inlined.Name = `empty_Inlined_Inlined`
	__Documentation__000301_empty_Inlined_Inlined.Text = `The empty type represents an empty element with no attributes.`
	__Documentation__000301_empty_Inlined_Inlined.Source = ``
	__Documentation__000301_empty_Inlined_Inlined.Lang = ``

	__Documentation__000302_enclosure_shape_Inlined_Inlined.Name = `enclosure-shape_Inlined_Inlined`
	__Documentation__000302_enclosure_shape_Inlined_Inlined.Text = `The enclosure-shape type describes the shape and presence / absence of
                an enclosure around text or symbols. A bracket enclosure is similar to a rectangle
                with the bottom line missing, as is common in jazz notation. An inverted-bracket
                enclosure is similar to a rectangle with the top line missing.`
	__Documentation__000302_enclosure_shape_Inlined_Inlined.Source = ``
	__Documentation__000302_enclosure_shape_Inlined_Inlined.Lang = ``

	__Documentation__000303_encoding_Inlined_Inlined.Name = `encoding_Inlined_Inlined`
	__Documentation__000303_encoding_Inlined_Inlined.Text = `The encoding element contains information about who did the digital
                encoding, when, with what software, and in what aspects. Standard type values for
                the encoder element are music, words, and arrangement, but other types may be used.
                The type attribute is only needed when there are multiple encoder elements.`
	__Documentation__000303_encoding_Inlined_Inlined.Source = ``
	__Documentation__000303_encoding_Inlined_Inlined.Lang = ``

	__Documentation__000304_ending_number_Inlined_Inlined.Name = `ending-number_Inlined_Inlined`
	__Documentation__000304_ending_number_Inlined_Inlined.Text = `The ending-number type is used to specify either a comma-separated
                list of positive integers without leading zeros, or a string of zero or more spaces.
                It is used for the number attribute of the ending element. The zero or more spaces
                version is used when software knows that an ending is present, but cannot determine
                the type of the ending.`
	__Documentation__000304_ending_number_Inlined_Inlined.Source = ``
	__Documentation__000304_ending_number_Inlined_Inlined.Lang = ``

	__Documentation__000305_ending_Inlined_Inlined.Name = `ending_Inlined_Inlined`
	__Documentation__000305_ending_Inlined_Inlined.Text = `The ending type represents multiple (e.g. first and second) endings.
                Typically, the start type is associated with the left barline of the first measure
                in an ending. The stop and discontinue types are associated with the right barline
                of the last measure in an ending. Stop is used when the ending mark concludes with a
                downward jog, as is typical for first endings. Discontinue is used when there is no
                downward jog, as is typical for second endings that do not conclude a piece. The
                length of the jog can be specified using the end-length attribute. The text-x and
                text-y attributes are offsets that specify where the baseline of the start of the
                ending text appears, relative to the start of the ending line. The number attribute
                indicates which times the ending is played, similar to the time-only attribute used
                by other elements. While this often represents the numeric values for what is under
                the ending line, it can also indicate whether an ending is played during a larger
                dal segno or da capo repeat. Single endings such as "1" or comma-separated multiple
                endings such as "1,2" may be used. The ending element text is used when the text
                displayed in the ending is different than what appears in the number attribute. The
                print-object attribute is used to indicate when an ending is present but not
                printed, as is often the case for many parts in a full score.`
	__Documentation__000305_ending_Inlined_Inlined.Source = ``
	__Documentation__000305_ending_Inlined_Inlined.Lang = ``

	__Documentation__000306_extend_Inlined_Inlined.Name = `extend_Inlined_Inlined`
	__Documentation__000306_extend_Inlined_Inlined.Text = `The extend type represents lyric word extension / melisma lines as
                well as figured bass extensions. The optional type and position attributes are added
                in Version 3.0 to provide better formatting control.`
	__Documentation__000306_extend_Inlined_Inlined.Source = ``
	__Documentation__000306_extend_Inlined_Inlined.Lang = ``

	__Documentation__000307_fan_Inlined_Inlined.Name = `fan_Inlined_Inlined`
	__Documentation__000307_fan_Inlined_Inlined.Text = `The fan type represents the type of beam fanning present on a note,
                used to represent accelerandos and ritardandos.`
	__Documentation__000307_fan_Inlined_Inlined.Source = ``
	__Documentation__000307_fan_Inlined_Inlined.Lang = ``

	__Documentation__000308_feature_Inlined_Inlined.Name = `feature_Inlined_Inlined`
	__Documentation__000308_feature_Inlined_Inlined.Text = `The feature type is a part of the grouping element used for musical
                analysis. The type attribute represents the type of the feature and the element
                content represents its value. This type is flexible to allow for different analyses.`
	__Documentation__000308_feature_Inlined_Inlined.Source = ``
	__Documentation__000308_feature_Inlined_Inlined.Lang = ``

	__Documentation__000309_fermata_shape_Inlined_Inlined.Name = `fermata-shape_Inlined_Inlined`
	__Documentation__000309_fermata_shape_Inlined_Inlined.Text = `The fermata-shape type represents the shape of the fermata sign. The
                empty value is equivalent to the normal value.`
	__Documentation__000309_fermata_shape_Inlined_Inlined.Source = ``
	__Documentation__000309_fermata_shape_Inlined_Inlined.Lang = ``

	__Documentation__000310_fermata_Inlined_Inlined.Name = `fermata_Inlined_Inlined`
	__Documentation__000310_fermata_Inlined_Inlined.Text = `The fermata text content represents the shape of the fermata sign. An
                empty fermata element represents a normal fermata. The fermata type is upright if
                not specified.`
	__Documentation__000310_fermata_Inlined_Inlined.Source = ``
	__Documentation__000310_fermata_Inlined_Inlined.Lang = ``

	__Documentation__000311_fifths_Inlined_Inlined.Name = `fifths_Inlined_Inlined`
	__Documentation__000311_fifths_Inlined_Inlined.Text = `The fifths type represents the number of flats or sharps in a
                traditional key signature. Negative numbers are used for flats and positive numbers
                for sharps, reflecting the key's placement within the circle of fifths (hence the
                type name).`
	__Documentation__000311_fifths_Inlined_Inlined.Source = ``
	__Documentation__000311_fifths_Inlined_Inlined.Lang = ``

	__Documentation__000312_figure_Inlined_Inlined.Name = `figure_Inlined_Inlined`
	__Documentation__000312_figure_Inlined_Inlined.Text = `The figure type represents a single figure within a figured-bass
                element.`
	__Documentation__000312_figure_Inlined_Inlined.Source = ``
	__Documentation__000312_figure_Inlined_Inlined.Lang = ``

	__Documentation__000313_figured_bass_Inlined_Inlined.Name = `figured-bass_Inlined_Inlined`
	__Documentation__000313_figured_bass_Inlined_Inlined.Text = `The figured-bass element represents figured bass notation. Figured
                bass elements take their position from the first regular note (not a grace note or
                chord note) that follows in score order. The optional duration element is used to
                indicate changes of figures under a note. Figures are ordered from top to bottom.
                The value of parentheses is "no" if not present.`
	__Documentation__000313_figured_bass_Inlined_Inlined.Source = ``
	__Documentation__000313_figured_bass_Inlined_Inlined.Lang = ``

	__Documentation__000314_fingering_Inlined_Inlined.Name = `fingering_Inlined_Inlined`
	__Documentation__000314_fingering_Inlined_Inlined.Text = `Fingering is typically indicated 1,2,3,4,5. Multiple fingerings may be
                given, typically to substitute fingerings in the middle of a note. The substitution
                and alternate values are "no" if the attribute is not present. For guitar and other
                fretted instruments, the fingering element represents the fretting finger; the pluck
                element represents the plucking finger.`
	__Documentation__000314_fingering_Inlined_Inlined.Source = ``
	__Documentation__000314_fingering_Inlined_Inlined.Lang = ``

	__Documentation__000315_first_fret_Inlined_Inlined.Name = `first-fret_Inlined_Inlined`
	__Documentation__000315_first_fret_Inlined_Inlined.Text = `The first-fret type indicates which fret is shown in the top space of
                the frame; it is fret 1 if the element is not present. The optional text attribute
                indicates how this is represented in the fret diagram, while the location attribute
                indicates whether the text appears to the left or right of the frame.`
	__Documentation__000315_first_fret_Inlined_Inlined.Source = ``
	__Documentation__000315_first_fret_Inlined_Inlined.Lang = ``

	__Documentation__000316_font_family_Inlined_Inlined.Name = `font-family_Inlined_Inlined`
	__Documentation__000316_font_family_Inlined_Inlined.Text = `The font-family is a comma-separated list of font names. These can be
                specific font styles such as Maestro or Opus, or one of several generic font styles:
                music, engraved, handwritten, text, serif, sans-serif, handwritten, cursive,
                fantasy, and monospace. The music, engraved, and handwritten values refer to music
                fonts; the rest refer to text fonts. The fantasy style refers to decorative text
                such as found in older German-style printing.`
	__Documentation__000316_font_family_Inlined_Inlined.Source = ``
	__Documentation__000316_font_family_Inlined_Inlined.Lang = ``

	__Documentation__000317_font_size_Inlined_Inlined.Name = `font-size_Inlined_Inlined`
	__Documentation__000317_font_size_Inlined_Inlined.Text = `The font-size can be one of the CSS font sizes (xx-small, x-small,
                small, medium, large, x-large, xx-large) or a numeric point size.`
	__Documentation__000317_font_size_Inlined_Inlined.Source = ``
	__Documentation__000317_font_size_Inlined_Inlined.Lang = ``

	__Documentation__000318_font_style_Inlined_Inlined.Name = `font-style_Inlined_Inlined`
	__Documentation__000318_font_style_Inlined_Inlined.Text = `The font-style type represents a simplified version of the CSS
                font-style property.`
	__Documentation__000318_font_style_Inlined_Inlined.Source = ``
	__Documentation__000318_font_style_Inlined_Inlined.Lang = ``

	__Documentation__000319_font_weight_Inlined_Inlined.Name = `font-weight_Inlined_Inlined`
	__Documentation__000319_font_weight_Inlined_Inlined.Text = `The font-weight type represents a simplified version of the CSS
                font-weight property.`
	__Documentation__000319_font_weight_Inlined_Inlined.Source = ``
	__Documentation__000319_font_weight_Inlined_Inlined.Lang = ``

	__Documentation__000320_footnote_Inlined_Inlined.Name = `footnote_Inlined_Inlined`
	__Documentation__000320_footnote_Inlined_Inlined.Text = `The footnote element specifies editorial information that appears in
                footnotes in the printed score. It is defined within a group due to its multiple
                uses within the MusicXML schema.`
	__Documentation__000320_footnote_Inlined_Inlined.Source = ``
	__Documentation__000320_footnote_Inlined_Inlined.Lang = ``

	__Documentation__000321_for_part_Inlined_Inlined.Name = `for-part_Inlined_Inlined`
	__Documentation__000321_for_part_Inlined_Inlined.Text = `The for-part type is used in a concert score to indicate the
                transposition for a transposed part created from that score. It is only used in
                score files that contain a concert-score element in the defaults. This allows
                concert scores with transposed parts to be represented in a single uncompressed
                MusicXML file. The optional number attribute refers to staff numbers, from top to
                bottom on the system. If absent, the child elements apply to all staves in the
                created part.`
	__Documentation__000321_for_part_Inlined_Inlined.Source = ``
	__Documentation__000321_for_part_Inlined_Inlined.Lang = ``

	__Documentation__000322_formatted_symbol_id_Inlined_Inlined.Name = `formatted-symbol-id_Inlined_Inlined`
	__Documentation__000322_formatted_symbol_id_Inlined_Inlined.Text = `The formatted-symbol-id type represents a SMuFL musical symbol element
                with formatting and id attributes.`
	__Documentation__000322_formatted_symbol_id_Inlined_Inlined.Source = ``
	__Documentation__000322_formatted_symbol_id_Inlined_Inlined.Lang = ``

	__Documentation__000323_formatted_symbol_Inlined_Inlined.Name = `formatted-symbol_Inlined_Inlined`
	__Documentation__000323_formatted_symbol_Inlined_Inlined.Text = `The formatted-symbol type represents a SMuFL musical symbol element
                with formatting attributes.`
	__Documentation__000323_formatted_symbol_Inlined_Inlined.Source = ``
	__Documentation__000323_formatted_symbol_Inlined_Inlined.Lang = ``

	__Documentation__000324_formatted_text_id_Inlined_Inlined.Name = `formatted-text-id_Inlined_Inlined`
	__Documentation__000324_formatted_text_id_Inlined_Inlined.Text = `The formatted-text-id type represents a text element with
                text-formatting and id attributes.`
	__Documentation__000324_formatted_text_id_Inlined_Inlined.Source = ``
	__Documentation__000324_formatted_text_id_Inlined_Inlined.Lang = ``

	__Documentation__000325_formatted_text_Inlined_Inlined.Name = `formatted-text_Inlined_Inlined`
	__Documentation__000325_formatted_text_Inlined_Inlined.Text = `The formatted-text type represents a text element with text-formatting
                attributes.`
	__Documentation__000325_formatted_text_Inlined_Inlined.Source = ``
	__Documentation__000325_formatted_text_Inlined_Inlined.Lang = ``

	__Documentation__000326_forward_Inlined_Inlined.Name = `forward_Inlined_Inlined`
	__Documentation__000326_forward_Inlined_Inlined.Text = `The backup and forward elements are required to coordinate multiple
                voices in one part, including music on multiple staves. The forward element is
                generally used within voices and staves. Duration values should always be positive,
                and should not cross measure boundaries or mid-measure changes in the divisions
                value.`
	__Documentation__000326_forward_Inlined_Inlined.Source = ``
	__Documentation__000326_forward_Inlined_Inlined.Lang = ``

	__Documentation__000327_frame_note_Inlined_Inlined.Name = `frame-note_Inlined_Inlined`
	__Documentation__000327_frame_note_Inlined_Inlined.Text = `The frame-note type represents each note included in the frame. An
                open string will have a fret value of 0, while a muted string will not be associated
                with a frame-note element.`
	__Documentation__000327_frame_note_Inlined_Inlined.Source = ``
	__Documentation__000327_frame_note_Inlined_Inlined.Lang = ``

	__Documentation__000328_frame_Inlined_Inlined.Name = `frame_Inlined_Inlined`
	__Documentation__000328_frame_Inlined_Inlined.Text = `The frame type represents a frame or fretboard diagram used together
                with a chord symbol. The representation is based on the NIFF guitar grid with
                additional information. The frame type's unplayed attribute indicates what to
                display above a string that has no associated frame-note element. Typical values are
                x and the empty string. If the attribute is not present, the display of the unplayed
                string is application-defined.`
	__Documentation__000328_frame_Inlined_Inlined.Source = ``
	__Documentation__000328_frame_Inlined_Inlined.Lang = ``

	__Documentation__000329_fret_Inlined_Inlined.Name = `fret_Inlined_Inlined`
	__Documentation__000329_fret_Inlined_Inlined.Text = `The fret element is used with tablature notation and chord diagrams.
                Fret numbers start with 0 for an open string and 1 for the first fret.`
	__Documentation__000329_fret_Inlined_Inlined.Source = ``
	__Documentation__000329_fret_Inlined_Inlined.Lang = ``

	__Documentation__000330_full_note_Inlined_Inlined.Name = `full-note_Inlined_Inlined`
	__Documentation__000330_full_note_Inlined_Inlined.Text = `The full-note group is a sequence of the common note elements between
                cue/grace notes and regular (full) notes: pitch, chord, and rest information, but
                not duration (cue and grace notes do not have duration encoded). Unpitched elements
                are used for unpitched percussion, speaking voice, and other musical elements
                lacking determinate pitch.`
	__Documentation__000330_full_note_Inlined_Inlined.Source = ``
	__Documentation__000330_full_note_Inlined_Inlined.Lang = ``

	__Documentation__000331_glass_value_Inlined_Inlined.Name = `glass-value_Inlined_Inlined`
	__Documentation__000331_glass_value_Inlined_Inlined.Text = `The glass-value type represents pictograms for glass percussion
                instruments.`
	__Documentation__000331_glass_value_Inlined_Inlined.Source = ``
	__Documentation__000331_glass_value_Inlined_Inlined.Lang = ``

	__Documentation__000332_glass_Inlined_Inlined.Name = `glass_Inlined_Inlined`
	__Documentation__000332_glass_Inlined_Inlined.Text = `The glass type represents pictograms for glass percussion instruments.
                The smufl attribute is used to distinguish different SMuFL glyphs for wind chimes in
                the Chimes pictograms range, including those made of materials other than glass.`
	__Documentation__000332_glass_Inlined_Inlined.Source = ``
	__Documentation__000332_glass_Inlined_Inlined.Lang = ``

	__Documentation__000333_glissando_Inlined_Inlined.Name = `glissando_Inlined_Inlined`
	__Documentation__000333_glissando_Inlined_Inlined.Text = `Glissando and slide types both indicate rapidly moving from one pitch
                to the other so that individual notes are not discerned. A glissando sounds the
                distinct notes in between the two pitches and defaults to a wavy line. The optional
                text is printed alongside the line.`
	__Documentation__000333_glissando_Inlined_Inlined.Source = ``
	__Documentation__000333_glissando_Inlined_Inlined.Lang = ``

	__Documentation__000334_glyph_type_Inlined_Inlined.Name = `glyph-type_Inlined_Inlined`
	__Documentation__000334_glyph_type_Inlined_Inlined.Text = `The glyph-type defines what type of glyph is being defined in a glyph
                element. Values include quarter-rest, g-clef-ottava-bassa, c-clef, f-clef,
                percussion-clef, octave-shift-up-8, octave-shift-down-8, octave-shift-continue-8,
                octave-shift-down-15, octave-shift-up-15, octave-shift-continue-15,
                octave-shift-down-22, octave-shift-up-22, and octave-shift-continue-22. This is left
                as a string so that other application-specific types can be defined, but it is made
                a separate type so that it can be redefined more strictly. A quarter-rest type
                specifies the glyph to use when a note has a rest element and a type value of
                quarter. The c-clef, f-clef, and percussion-clef types specify the glyph to use when
                a clef sign element value is C, F, or percussion respectively. The
                g-clef-ottava-bassa type specifies the glyph to use when a clef sign element value
                is G and the clef-octave-change element value is -1. The octave-shift types specify
                the glyph to use when an octave-shift type attribute value is up, down, or continue
                and the octave-shift size attribute value is 8, 15, or 22.`
	__Documentation__000334_glyph_type_Inlined_Inlined.Source = ``
	__Documentation__000334_glyph_type_Inlined_Inlined.Lang = ``

	__Documentation__000335_glyph_Inlined_Inlined.Name = `glyph_Inlined_Inlined`
	__Documentation__000335_glyph_Inlined_Inlined.Text = `The glyph element represents what SMuFL glyph should be used for
                different variations of symbols that are semantically identical. The type attribute
                specifies what type of glyph is being defined. The element value specifies what
                SMuFL glyph to use, including recommended stylistic alternates. The SMuFL glyph name
                should match the type. For instance, a type of quarter-rest would use values
                restQuarter, restQuarterOld, or restQuarterZ. A type of g-clef-ottava-bassa would
                use values gClef8vb, gClef8vbOld, or gClef8vbCClef. A type of octave-shift-up-8
                would use values ottava, ottavaBassa, ottavaBassaBa, ottavaBassaVb, or octaveBassa.`
	__Documentation__000335_glyph_Inlined_Inlined.Source = ``
	__Documentation__000335_glyph_Inlined_Inlined.Lang = ``

	__Documentation__000336_grace_Inlined_Inlined.Name = `grace_Inlined_Inlined`
	__Documentation__000336_grace_Inlined_Inlined.Text = `The grace type indicates the presence of a grace note. The slash
                attribute for a grace note is yes for slashed grace notes. The steal-time-previous
                attribute indicates the percentage of time to steal from the previous note for the
                grace note. The steal-time-following attribute indicates the percentage of time to
                steal from the following note for the grace note, as for appoggiaturas. The
                make-time attribute indicates to make time, not steal time; the units are in
                real-time divisions for the grace note.`
	__Documentation__000336_grace_Inlined_Inlined.Source = ``
	__Documentation__000336_grace_Inlined_Inlined.Lang = ``

	__Documentation__000337_group_barline_value_Inlined_Inlined.Name = `group-barline-value_Inlined_Inlined`
	__Documentation__000337_group_barline_value_Inlined_Inlined.Text = `The group-barline-value type indicates if the group should have common
                barlines.`
	__Documentation__000337_group_barline_value_Inlined_Inlined.Source = ``
	__Documentation__000337_group_barline_value_Inlined_Inlined.Lang = ``

	__Documentation__000338_group_barline_Inlined_Inlined.Name = `group-barline_Inlined_Inlined`
	__Documentation__000338_group_barline_Inlined_Inlined.Text = `The group-barline type indicates if the group should have common
                barlines.`
	__Documentation__000338_group_barline_Inlined_Inlined.Source = ``
	__Documentation__000338_group_barline_Inlined_Inlined.Lang = ``

	__Documentation__000339_group_name_Inlined_Inlined.Name = `group-name_Inlined_Inlined`
	__Documentation__000339_group_name_Inlined_Inlined.Text = `The group-name type describes the name or abbreviation of a part-group
                element. Formatting attributes in the group-name type are deprecated in Version 2.0
                in favor of the new group-name-display and group-abbreviation-display elements.`
	__Documentation__000339_group_name_Inlined_Inlined.Source = ``
	__Documentation__000339_group_name_Inlined_Inlined.Lang = ``

	__Documentation__000340_group_symbol_value_Inlined_Inlined.Name = `group-symbol-value_Inlined_Inlined`
	__Documentation__000340_group_symbol_value_Inlined_Inlined.Text = `The group-symbol-value type indicates how the symbol for a group or
                multi-staff part is indicated in the score.`
	__Documentation__000340_group_symbol_value_Inlined_Inlined.Source = ``
	__Documentation__000340_group_symbol_value_Inlined_Inlined.Lang = ``

	__Documentation__000341_group_symbol_Inlined_Inlined.Name = `group-symbol_Inlined_Inlined`
	__Documentation__000341_group_symbol_Inlined_Inlined.Text = `The group-symbol type indicates how the symbol for a group is
                indicated in the score. It is none if not specified.`
	__Documentation__000341_group_symbol_Inlined_Inlined.Source = ``
	__Documentation__000341_group_symbol_Inlined_Inlined.Lang = ``

	__Documentation__000342_grouping_Inlined_Inlined.Name = `grouping_Inlined_Inlined`
	__Documentation__000342_grouping_Inlined_Inlined.Text = `The grouping type is used for musical analysis. When the type
                attribute is "start" or "single", it usually contains one or more feature elements.
                The number attribute is used for distinguishing between overlapping and hierarchical
                groupings. The member-of attribute allows for easy distinguishing of what grouping
                elements are in what hierarchy. Feature elements contained within a "stop" type of
                grouping may be ignored. This element is flexible to allow for different types of
                analyses. Future versions of the MusicXML format may add elements that can represent
                more standardized categories of analysis data, allowing for easier data sharing.`
	__Documentation__000342_grouping_Inlined_Inlined.Source = ``
	__Documentation__000342_grouping_Inlined_Inlined.Lang = ``

	__Documentation__000343_hammer_on_pull_off_Inlined_Inlined.Name = `hammer-on-pull-off_Inlined_Inlined`
	__Documentation__000343_hammer_on_pull_off_Inlined_Inlined.Text = `The hammer-on and pull-off elements are used in guitar and fretted
                instrument notation. Since a single slur can be marked over many notes, the
                hammer-on and pull-off elements are separate so the individual pair of notes can be
                specified. The element content can be used to specify how the hammer-on or pull-off
                should be notated. An empty element leaves this choice up to the application.`
	__Documentation__000343_hammer_on_pull_off_Inlined_Inlined.Source = ``
	__Documentation__000343_hammer_on_pull_off_Inlined_Inlined.Lang = ``

	__Documentation__000344_handbell_value_Inlined_Inlined.Name = `handbell-value_Inlined_Inlined`
	__Documentation__000344_handbell_value_Inlined_Inlined.Text = `The handbell-value type represents the type of handbell technique
                being notated.`
	__Documentation__000344_handbell_value_Inlined_Inlined.Source = ``
	__Documentation__000344_handbell_value_Inlined_Inlined.Lang = ``

	__Documentation__000345_handbell_Inlined_Inlined.Name = `handbell_Inlined_Inlined`
	__Documentation__000345_handbell_Inlined_Inlined.Text = `The handbell element represents notation for various techniques used
                in handbell and handchime music.`
	__Documentation__000345_handbell_Inlined_Inlined.Source = ``
	__Documentation__000345_handbell_Inlined_Inlined.Lang = ``

	__Documentation__000346_harmon_closed_location_Inlined_Inlined.Name = `harmon-closed-location_Inlined_Inlined`
	__Documentation__000346_harmon_closed_location_Inlined_Inlined.Text = `The harmon-closed-location type indicates which portion of the symbol
                is filled in when the corresponding harmon-closed-value is half.`
	__Documentation__000346_harmon_closed_location_Inlined_Inlined.Source = ``
	__Documentation__000346_harmon_closed_location_Inlined_Inlined.Lang = ``

	__Documentation__000347_harmon_closed_value_Inlined_Inlined.Name = `harmon-closed-value_Inlined_Inlined`
	__Documentation__000347_harmon_closed_value_Inlined_Inlined.Text = `The harmon-closed-value type represents whether the harmon mute is
                closed, open, or half-open.`
	__Documentation__000347_harmon_closed_value_Inlined_Inlined.Source = ``
	__Documentation__000347_harmon_closed_value_Inlined_Inlined.Lang = ``

	__Documentation__000348_harmon_closed_Inlined_Inlined.Name = `harmon-closed_Inlined_Inlined`
	__Documentation__000348_harmon_closed_Inlined_Inlined.Text = `The harmon-closed type represents whether the harmon mute is closed,
                open, or half-open. The optional location attribute indicates which portion of the
                symbol is filled in when the element value is half.`
	__Documentation__000348_harmon_closed_Inlined_Inlined.Source = ``
	__Documentation__000348_harmon_closed_Inlined_Inlined.Lang = ``

	__Documentation__000349_harmon_mute_Inlined_Inlined.Name = `harmon-mute_Inlined_Inlined`
	__Documentation__000349_harmon_mute_Inlined_Inlined.Text = `The harmon-mute type represents the symbols used for harmon mutes in
                brass notation.`
	__Documentation__000349_harmon_mute_Inlined_Inlined.Source = ``
	__Documentation__000349_harmon_mute_Inlined_Inlined.Lang = ``

	__Documentation__000350_harmonic_Inlined_Inlined.Name = `harmonic_Inlined_Inlined`
	__Documentation__000350_harmonic_Inlined_Inlined.Text = `The harmonic type indicates natural and artificial harmonics. Allowing
                the type of pitch to be specified, combined with controls for appearance/playback
                differences, allows both the notation and the sound to be represented. Artificial
                harmonics can add a notated touching pitch; artificial pinch harmonics will usually
                not notate a touching pitch. The attributes for the harmonic element refer to the
                use of the circular harmonic symbol, typically but not always used with natural
                harmonics.`
	__Documentation__000350_harmonic_Inlined_Inlined.Source = ``
	__Documentation__000350_harmonic_Inlined_Inlined.Lang = ``

	__Documentation__000351_harmony_alter_Inlined_Inlined.Name = `harmony-alter_Inlined_Inlined`
	__Documentation__000351_harmony_alter_Inlined_Inlined.Text = `The harmony-alter type represents the chromatic alteration of the
                root, numeral, or bass of the current harmony-chord group within the harmony
                element. In some chord styles, the text of the preceding element may include
                alteration information. In that case, the print-object attribute of this type can be
                set to no. The location attribute indicates whether the alteration should appear to
                the left or the right of the preceding element. Its default value varies by element.`
	__Documentation__000351_harmony_alter_Inlined_Inlined.Source = ``
	__Documentation__000351_harmony_alter_Inlined_Inlined.Lang = ``

	__Documentation__000352_harmony_arrangement_Inlined_Inlined.Name = `harmony-arrangement_Inlined_Inlined`
	__Documentation__000352_harmony_arrangement_Inlined_Inlined.Text = `The harmony-arrangement type indicates how stacked chords and bass
                notes are displayed within a harmony element. The vertical value specifies that the
                second element appears below the first. The horizontal value specifies that the
                second element appears to the right of the first. The diagonal value specifies that
                the second element appears both below and to the right of the first.`
	__Documentation__000352_harmony_arrangement_Inlined_Inlined.Source = ``
	__Documentation__000352_harmony_arrangement_Inlined_Inlined.Lang = ``

	__Documentation__000353_harmony_chord_Inlined_Inlined.Name = `harmony-chord_Inlined_Inlined`
	__Documentation__000353_harmony_chord_Inlined_Inlined.Text = `A harmony element can contain many stacked chords (e.g. V of II). A
                sequence of harmony-chord groups is used for this type of secondary function, where
                V of II would be represented by a harmony-chord with a 5 numeral followed by a
                harmony-chord with a 2 numeral. A root is a pitch name like C, D, E, while a numeral
                is a scale degree like 1, 2, 3. The root element is generally used with pop chord
                symbols, while the numeral element is generally used with classical functional
                harmony and Nashville numbers. It is an either/or choice to avoid data
                inconsistency. The function element, which represents Roman numerals with roman
                numeral text, has been deprecated as of MusicXML 4.0.`
	__Documentation__000353_harmony_chord_Inlined_Inlined.Source = ``
	__Documentation__000353_harmony_chord_Inlined_Inlined.Lang = ``

	__Documentation__000354_harmony_type_Inlined_Inlined.Name = `harmony-type_Inlined_Inlined`
	__Documentation__000354_harmony_type_Inlined_Inlined.Text = `The harmony-type type differentiates different types of harmonies when
                alternate harmonies are possible. Explicit harmonies have all note present in the
                music; implied have some notes missing but implied; alternate represents alternate
                analyses.`
	__Documentation__000354_harmony_type_Inlined_Inlined.Source = ``
	__Documentation__000354_harmony_type_Inlined_Inlined.Lang = ``

	__Documentation__000355_harmony_Inlined_Inlined.Name = `harmony_Inlined_Inlined`
	__Documentation__000355_harmony_Inlined_Inlined.Text = `The harmony type represents harmony analysis, including chord symbols
                in popular music as well as functional harmony analysis in classical music. If there
                are alternate harmonies possible, this can be specified using multiple harmony
                elements differentiated by type. Explicit harmonies have all note present in the
                music; implied have some notes missing but implied; alternate represents alternate
                analyses. The print-object attribute controls whether or not anything is printed due
                to the harmony element. The print-frame attribute controls printing of a frame or
                fretboard diagram. The print-style attribute group sets the default for the harmony,
                but individual elements can override this with their own print-style values. The
                arrangement attribute specifies how multiple harmony-chord groups are arranged
                relative to each other. Harmony-chords with vertical arrangement are separated by
                horizontal lines. Harmony-chords with diagonal or horizontal arrangement are
                separated by diagonal lines or slashes.`
	__Documentation__000355_harmony_Inlined_Inlined.Source = ``
	__Documentation__000355_harmony_Inlined_Inlined.Lang = ``

	__Documentation__000356_harp_pedals_Inlined_Inlined.Name = `harp-pedals_Inlined_Inlined`
	__Documentation__000356_harp_pedals_Inlined_Inlined.Text = `The harp-pedals type is used to create harp pedal diagrams. The
                pedal-step and pedal-alter elements use the same values as the step and alter
                elements. For easiest reading, the pedal-tuning elements should follow standard harp
                pedal order, with pedal-step values of D, C, B, E, F, G, and A.`
	__Documentation__000356_harp_pedals_Inlined_Inlined.Source = ``
	__Documentation__000356_harp_pedals_Inlined_Inlined.Lang = ``

	__Documentation__000357_heel_toe_Inlined_Inlined.Name = `heel-toe_Inlined_Inlined`
	__Documentation__000357_heel_toe_Inlined_Inlined.Text = `The heel and toe elements are used with organ pedals. The substitution
                value is "no" if the attribute is not present.`
	__Documentation__000357_heel_toe_Inlined_Inlined.Source = ``
	__Documentation__000357_heel_toe_Inlined_Inlined.Lang = ``

	__Documentation__000358_hole_closed_location_Inlined_Inlined.Name = `hole-closed-location_Inlined_Inlined`
	__Documentation__000358_hole_closed_location_Inlined_Inlined.Text = `The hole-closed-location type indicates which portion of the hole is
                filled in when the corresponding hole-closed-value is half.`
	__Documentation__000358_hole_closed_location_Inlined_Inlined.Source = ``
	__Documentation__000358_hole_closed_location_Inlined_Inlined.Lang = ``

	__Documentation__000359_hole_closed_value_Inlined_Inlined.Name = `hole-closed-value_Inlined_Inlined`
	__Documentation__000359_hole_closed_value_Inlined_Inlined.Text = `The hole-closed-value type represents whether the hole is closed,
                open, or half-open.`
	__Documentation__000359_hole_closed_value_Inlined_Inlined.Source = ``
	__Documentation__000359_hole_closed_value_Inlined_Inlined.Lang = ``

	__Documentation__000360_hole_closed_Inlined_Inlined.Name = `hole-closed_Inlined_Inlined`
	__Documentation__000360_hole_closed_Inlined_Inlined.Text = `The hole-closed type represents whether the hole is closed, open, or
                half-open. The optional location attribute indicates which portion of the hole is
                filled in when the element value is half.`
	__Documentation__000360_hole_closed_Inlined_Inlined.Source = ``
	__Documentation__000360_hole_closed_Inlined_Inlined.Lang = ``

	__Documentation__000361_hole_Inlined_Inlined.Name = `hole_Inlined_Inlined`
	__Documentation__000361_hole_Inlined_Inlined.Text = `The hole type represents the symbols used for woodwind and brass
                fingerings as well as other notations.`
	__Documentation__000361_hole_Inlined_Inlined.Source = ``
	__Documentation__000361_hole_Inlined_Inlined.Lang = ``

	__Documentation__000362_horizontal_turn_Inlined_Inlined.Name = `horizontal-turn_Inlined_Inlined`
	__Documentation__000362_horizontal_turn_Inlined_Inlined.Text = `The horizontal-turn type represents turn elements that are horizontal
                rather than vertical. These are empty elements with print-style, placement,
                trill-sound, and slash attributes. If the slash attribute is yes, then a vertical
                line is used to slash the turn. It is no if not specified.`
	__Documentation__000362_horizontal_turn_Inlined_Inlined.Source = ``
	__Documentation__000362_horizontal_turn_Inlined_Inlined.Lang = ``

	__Documentation__000363_identification_Inlined_Inlined.Name = `identification_Inlined_Inlined`
	__Documentation__000363_identification_Inlined_Inlined.Text = `Identification contains basic metadata about the score. It includes
                information that may apply at a score-wide, movement-wide, or part-wide level. The
                creator, rights, source, and relation elements are based on Dublin Core.`
	__Documentation__000363_identification_Inlined_Inlined.Source = ``
	__Documentation__000363_identification_Inlined_Inlined.Lang = ``

	__Documentation__000364_image_Inlined_Inlined.Name = `image_Inlined_Inlined`
	__Documentation__000364_image_Inlined_Inlined.Text = `The image type is used to include graphical images in a score.`
	__Documentation__000364_image_Inlined_Inlined.Source = ``
	__Documentation__000364_image_Inlined_Inlined.Lang = ``

	__Documentation__000365_instrument_change_Inlined_Inlined.Name = `instrument-change_Inlined_Inlined`
	__Documentation__000365_instrument_change_Inlined_Inlined.Text = `The instrument-change element type represents a change to the virtual
                instrument sound for a given score-instrument. The id attribute refers to the
                score-instrument affected by the change. All instrument-change child elements can
                also be initially specified within the score-instrument element.`
	__Documentation__000365_instrument_change_Inlined_Inlined.Source = ``
	__Documentation__000365_instrument_change_Inlined_Inlined.Lang = ``

	__Documentation__000366_instrument_link_Inlined_Inlined.Name = `instrument-link_Inlined_Inlined`
	__Documentation__000366_instrument_link_Inlined_Inlined.Text = `Multiple part-link elements can link a condensed part within a score
                file to multiple MusicXML parts files. For example, a "Clarinet 1 and 2" part in a
                score file could link to separate "Clarinet 1" and "Clarinet 2" part files. The
                instrument-link type distinguish which of the score-instruments within a score-part
                are in which part file. The instrument-link id attribute refers to a
                score-instrument id attribute.`
	__Documentation__000366_instrument_link_Inlined_Inlined.Source = ``
	__Documentation__000366_instrument_link_Inlined_Inlined.Lang = ``

	__Documentation__000367_instrument_Inlined_Inlined.Name = `instrument_Inlined_Inlined`
	__Documentation__000367_instrument_Inlined_Inlined.Text = `The instrument type distinguishes between score-instrument elements in
                a score-part. The id attribute is an IDREF back to the score-instrument ID. If
                multiple score-instruments are specified in a score-part, there should be an
                instrument element for each note in the part. Notes that are shared between multiple
                score-instruments can have more than one instrument element.`
	__Documentation__000367_instrument_Inlined_Inlined.Source = ``
	__Documentation__000367_instrument_Inlined_Inlined.Lang = ``

	__Documentation__000368_interchangeable_Inlined_Inlined.Name = `interchangeable_Inlined_Inlined`
	__Documentation__000368_interchangeable_Inlined_Inlined.Text = `The interchangeable type is used to represent the second in a pair of
                interchangeable dual time signatures, such as the 6/8 in 3/4 (6/8). A separate
                symbol attribute value is available compared to the time element's symbol attribute,
                which applies to the first of the dual time signatures.`
	__Documentation__000368_interchangeable_Inlined_Inlined.Source = ``
	__Documentation__000368_interchangeable_Inlined_Inlined.Lang = ``

	__Documentation__000369_inversion_Inlined_Inlined.Name = `inversion_Inlined_Inlined`
	__Documentation__000369_inversion_Inlined_Inlined.Text = `The inversion type represents harmony inversions. The value is a
                number indicating which inversion is used: 0 for root position, 1 for first
                inversion, etc. The text attribute indicates how the inversion should be displayed
                in a score.`
	__Documentation__000369_inversion_Inlined_Inlined.Source = ``
	__Documentation__000369_inversion_Inlined_Inlined.Lang = ``

	__Documentation__000370_key_accidental_Inlined_Inlined.Name = `key-accidental_Inlined_Inlined`
	__Documentation__000370_key_accidental_Inlined_Inlined.Text = `The key-accidental type indicates the accidental to be displayed in a
                non-traditional key signature, represented in the same manner as the accidental type
                without the formatting attributes.`
	__Documentation__000370_key_accidental_Inlined_Inlined.Source = ``
	__Documentation__000370_key_accidental_Inlined_Inlined.Lang = ``

	__Documentation__000371_key_octave_Inlined_Inlined.Name = `key-octave_Inlined_Inlined`
	__Documentation__000371_key_octave_Inlined_Inlined.Text = `The key-octave type specifies in which octave an element of a key
                signature appears. The content specifies the octave value using the same values as
                the display-octave element. The number attribute is a positive integer that refers
                to the key signature element in left-to-right order. If the cancel attribute is set
                to yes, then this number refers to the canceling key signature specified by the
                cancel element in the parent key element. The cancel attribute cannot be set to yes
                if there is no corresponding cancel element within the parent key element. It is no
                by default.`
	__Documentation__000371_key_octave_Inlined_Inlined.Source = ``
	__Documentation__000371_key_octave_Inlined_Inlined.Lang = ``

	__Documentation__000372_key_Inlined_Inlined.Name = `key_Inlined_Inlined`
	__Documentation__000372_key_Inlined_Inlined.Text = `The key type represents a key signature. Both traditional and
                non-traditional key signatures are supported. The optional number attribute refers
                to staff numbers. If absent, the key signature applies to all staves in the part.
                Key signatures appear at the start of each system unless the print-object attribute
                has been set to "no".`
	__Documentation__000372_key_Inlined_Inlined.Source = ``
	__Documentation__000372_key_Inlined_Inlined.Lang = ``

	__Documentation__000373_kind_value_Inlined_Inlined.Name = `kind-value_Inlined_Inlined`
	__Documentation__000373_kind_value_Inlined_Inlined.Text = `A kind-value indicates the type of chord. Degree elements can then
                add, subtract, or alter from these starting points. Values include: Triads: major
                (major third, perfect fifth) minor (minor third, perfect fifth) augmented (major
                third, augmented fifth) diminished (minor third, diminished fifth) Sevenths:
                dominant (major triad, minor seventh) major-seventh (major triad, major seventh)
                minor-seventh (minor triad, minor seventh) diminished-seventh (diminished triad,
                diminished seventh) augmented-seventh (augmented triad, minor seventh)
                half-diminished (diminished triad, minor seventh) major-minor (minor triad, major
                seventh) Sixths: major-sixth (major triad, added sixth) minor-sixth (minor triad,
                added sixth) Ninths: dominant-ninth (dominant-seventh, major ninth) major-ninth
                (major-seventh, major ninth) minor-ninth (minor-seventh, major ninth) 11ths (usually
                as the basis for alteration): dominant-11th (dominant-ninth, perfect 11th)
                major-11th (major-ninth, perfect 11th) minor-11th (minor-ninth, perfect 11th) 13ths
                (usually as the basis for alteration): dominant-13th (dominant-11th, major 13th)
                major-13th (major-11th, major 13th) minor-13th (minor-11th, major 13th) Suspended:
                suspended-second (major second, perfect fifth) suspended-fourth (perfect fourth,
                perfect fifth) Functional sixths: Neapolitan Italian French German Other: pedal
                (pedal-point bass) power (perfect fifth) Tristan The "other" kind is used when the
                harmony is entirely composed of add elements. The "none" kind is used to explicitly
                encode absence of chords or functional harmony. In this case, the root, numeral, or
                function element has no meaning. When using the root or numeral element, the
                root-step or numeral-step text attribute should be set to the empty string to keep
                the root or numeral from being displayed.`
	__Documentation__000373_kind_value_Inlined_Inlined.Source = ``
	__Documentation__000373_kind_value_Inlined_Inlined.Lang = ``

	__Documentation__000374_kind_Inlined_Inlined.Name = `kind_Inlined_Inlined`
	__Documentation__000374_kind_Inlined_Inlined.Text = `Kind indicates the type of chord. Degree elements can then add,
                subtract, or alter from these starting points The attributes are used to indicate
                the formatting of the symbol. Since the kind element is the constant in all the
                harmony-chord groups that can make up a polychord, many formatting attributes are
                here. The use-symbols attribute is yes if the kind should be represented when
                possible with harmony symbols rather than letters and numbers. These symbols
                include: major: a triangle, like Unicode 25B3 minor: -, like Unicode 002D augmented:
                +, like Unicode 002B diminished: °, like Unicode 00B0 half-diminished: ø, like
                Unicode 00F8 For the major-minor kind, only the minor symbol is used when
                use-symbols is yes. The major symbol is set using the symbol attribute in the
                degree-value element. The corresponding degree-alter value will usually be 0 in this
                case. The text attribute describes how the kind should be spelled in a score. If
                use-symbols is yes, the value of the text attribute follows the symbol. The
                stack-degrees attribute is yes if the degree elements should be stacked above each
                other. The parentheses-degrees attribute is yes if all the degrees should be in
                parentheses. The bracket-degrees attribute is yes if all the degrees should be in a
                bracket. If not specified, these values are implementation-specific. The alignment
                attributes are for the entire harmony-chord group of which this kind element is a
                part. The text attribute may use strings such as "13sus" that refer to both the kind
                and one or more degree elements. In this case, the corresponding degree elements
                should have the print-object attribute set to "no" to keep redundant alterations
                from being displayed.`
	__Documentation__000374_kind_Inlined_Inlined.Source = ``
	__Documentation__000374_kind_Inlined_Inlined.Lang = ``

	__Documentation__000375_layout_Inlined_Inlined.Name = `layout_Inlined_Inlined`
	__Documentation__000375_layout_Inlined_Inlined.Text = `The layout group specifies the sequence of page, system, and staff
                layout elements that is common to both the defaults and print elements.`
	__Documentation__000375_layout_Inlined_Inlined.Source = ``
	__Documentation__000375_layout_Inlined_Inlined.Lang = ``

	__Documentation__000376_left_center_right_Inlined_Inlined.Name = `left-center-right_Inlined_Inlined`
	__Documentation__000376_left_center_right_Inlined_Inlined.Text = `The left-center-right type is used to define horizontal alignment and
                text justification.`
	__Documentation__000376_left_center_right_Inlined_Inlined.Source = ``
	__Documentation__000376_left_center_right_Inlined_Inlined.Lang = ``

	__Documentation__000377_left_right_margins_Inlined_Inlined.Name = `left-right-margins_Inlined_Inlined`
	__Documentation__000377_left_right_margins_Inlined_Inlined.Text = `The left-right-margins group specifies horizontal margins in tenths.`
	__Documentation__000377_left_right_margins_Inlined_Inlined.Source = ``
	__Documentation__000377_left_right_margins_Inlined_Inlined.Lang = ``

	__Documentation__000378_left_right_Inlined_Inlined.Name = `left-right_Inlined_Inlined`
	__Documentation__000378_left_right_Inlined_Inlined.Text = `The left-right type is used to indicate whether one element appears to
                the left or the right of another element.`
	__Documentation__000378_left_right_Inlined_Inlined.Source = ``
	__Documentation__000378_left_right_Inlined_Inlined.Lang = ``

	__Documentation__000379_level_Inlined_Inlined.Name = `level_Inlined_Inlined`
	__Documentation__000379_level_Inlined_Inlined.Text = `The level element specifies editorial information for different
                MusicXML elements. It is defined within a group due to its multiple uses within the
                MusicXML schema.`
	__Documentation__000379_level_Inlined_Inlined.Source = ``
	__Documentation__000379_level_Inlined_Inlined.Lang = ``

	__Documentation__000380_level_Inlined_Inlined.Name = `level_Inlined_Inlined`
	__Documentation__000380_level_Inlined_Inlined.Text = `The level type is used to specify editorial information for different
                MusicXML elements. The content contains identifying and/or descriptive text about
                the editorial status of the parent element. If the reference attribute is yes, this
                indicates editorial information that is for display only and should not affect
                playback. For instance, a modern edition of older music may set reference="yes" on
                the attributes containing the music's original clef, key, and time signature. It is
                no if not specified. The type attribute indicates whether the editorial information
                applies to the start of a series of symbols, the end of a series of symbols, or a
                single symbol. It is single if not specified for compatibility with earlier MusicXML
                versions.`
	__Documentation__000380_level_Inlined_Inlined.Source = ``
	__Documentation__000380_level_Inlined_Inlined.Lang = ``

	__Documentation__000381_line_detail_Inlined_Inlined.Name = `line-detail_Inlined_Inlined`
	__Documentation__000381_line_detail_Inlined_Inlined.Text = `If the staff-lines element is present, the appearance of each line may
                be individually specified with a line-detail type. Staff lines are numbered from
                bottom to top. The print-object attribute allows lines to be hidden within a staff.
                This is used in special situations such as a widely-spaced percussion staff where a
                note placed below the higher line is distinct from a note placed above the lower
                line. Hidden staff lines are included when specifying clef lines and determining
                display-step / display-octave values, but are not counted as lines for the purposes
                of the system-layout and staff-layout elements.`
	__Documentation__000381_line_detail_Inlined_Inlined.Source = ``
	__Documentation__000381_line_detail_Inlined_Inlined.Lang = ``

	__Documentation__000382_line_end_Inlined_Inlined.Name = `line-end_Inlined_Inlined`
	__Documentation__000382_line_end_Inlined_Inlined.Text = `The line-end type specifies if there is a jog up or down (or both), an
                arrow, or nothing at the start or end of a bracket.`
	__Documentation__000382_line_end_Inlined_Inlined.Source = ``
	__Documentation__000382_line_end_Inlined_Inlined.Lang = ``

	__Documentation__000383_line_length_Inlined_Inlined.Name = `line-length_Inlined_Inlined`
	__Documentation__000383_line_length_Inlined_Inlined.Text = `The line-length type distinguishes between different line lengths for
                doit, falloff, plop, and scoop articulations.`
	__Documentation__000383_line_length_Inlined_Inlined.Source = ``
	__Documentation__000383_line_length_Inlined_Inlined.Lang = ``

	__Documentation__000384_line_shape_Inlined_Inlined.Name = `line-shape_Inlined_Inlined`
	__Documentation__000384_line_shape_Inlined_Inlined.Text = `The line-shape type distinguishes between straight and curved lines.`
	__Documentation__000384_line_shape_Inlined_Inlined.Source = ``
	__Documentation__000384_line_shape_Inlined_Inlined.Lang = ``

	__Documentation__000385_line_type_Inlined_Inlined.Name = `line-type_Inlined_Inlined`
	__Documentation__000385_line_type_Inlined_Inlined.Text = `The line-type type distinguishes between solid, dashed, dotted, and
                wavy lines.`
	__Documentation__000385_line_type_Inlined_Inlined.Source = ``
	__Documentation__000385_line_type_Inlined_Inlined.Lang = ``

	__Documentation__000386_line_width_type_Inlined_Inlined.Name = `line-width-type_Inlined_Inlined`
	__Documentation__000386_line_width_type_Inlined_Inlined.Text = `The line-width-type defines what type of line is being defined in a
                line-width element. Values include beam, bracket, dashes, enclosure, ending, extend,
                heavy barline, leger, light barline, octave shift, pedal, slur middle, slur tip,
                staff, stem, tie middle, tie tip, tuplet bracket, and wedge. This is left as a
                string so that other application-specific types can be defined, but it is made a
                separate type so that it can be redefined more strictly.`
	__Documentation__000386_line_width_type_Inlined_Inlined.Source = ``
	__Documentation__000386_line_width_type_Inlined_Inlined.Lang = ``

	__Documentation__000387_line_width_Inlined_Inlined.Name = `line-width_Inlined_Inlined`
	__Documentation__000387_line_width_Inlined_Inlined.Text = `The line-width type indicates the width of a line type in tenths. The
                type attribute defines what type of line is being defined. Values include beam,
                bracket, dashes, enclosure, ending, extend, heavy barline, leger, light barline,
                octave shift, pedal, slur middle, slur tip, staff, stem, tie middle, tie tip, tuplet
                bracket, and wedge. The text content is expressed in tenths.`
	__Documentation__000387_line_width_Inlined_Inlined.Source = ``
	__Documentation__000387_line_width_Inlined_Inlined.Lang = ``

	__Documentation__000388_link_Inlined_Inlined.Name = `link_Inlined_Inlined`
	__Documentation__000388_link_Inlined_Inlined.Text = `The link type serves as an outgoing simple XLink. If a relative link
                is used within a document that is part of a compressed MusicXML file, the link is
                relative to the root folder of the zip file.`
	__Documentation__000388_link_Inlined_Inlined.Source = ``
	__Documentation__000388_link_Inlined_Inlined.Lang = ``

	__Documentation__000389_listen_Inlined_Inlined.Name = `listen_Inlined_Inlined`
	__Documentation__000389_listen_Inlined_Inlined.Text = `The listen and listening types, new in Version 4.0, specify different
                ways that a score following or machine listening application can interact with a
                performer. The listen type handles interactions that are specific to a note. If
                multiple child elements of the same type are present, they should have distinct
                player and/or time-only attributes.`
	__Documentation__000389_listen_Inlined_Inlined.Source = ``
	__Documentation__000389_listen_Inlined_Inlined.Lang = ``

	__Documentation__000390_listening_Inlined_Inlined.Name = `listening_Inlined_Inlined`
	__Documentation__000390_listening_Inlined_Inlined.Text = `The listen and listening types, new in Version 4.0, specify different
                ways that a score following or machine listening application can interact with a
                performer. The listening type handles interactions that change the state of the
                listening application from the specified point in the performance onward. If
                multiple child elements of the same type are present, they should have distinct
                player and/or time-only attributes. The offset element is used to indicate that the
                listening change takes place offset from the current score position. If the
                listening element is a child of a direction element, the listening offset element
                overrides the direction offset element if both elements are present. Note that the
                offset reflects the intended musical position for the change in state. It should not
                be used to compensate for latency issues in particular hardware configurations.`
	__Documentation__000390_listening_Inlined_Inlined.Source = ``
	__Documentation__000390_listening_Inlined_Inlined.Lang = ``

	__Documentation__000391_lyric_font_Inlined_Inlined.Name = `lyric-font_Inlined_Inlined`
	__Documentation__000391_lyric_font_Inlined_Inlined.Text = `The lyric-font type specifies the default font for a particular name
                and number of lyric.`
	__Documentation__000391_lyric_font_Inlined_Inlined.Source = ``
	__Documentation__000391_lyric_font_Inlined_Inlined.Lang = ``

	__Documentation__000392_lyric_language_Inlined_Inlined.Name = `lyric-language_Inlined_Inlined`
	__Documentation__000392_lyric_language_Inlined_Inlined.Text = `The lyric-language type specifies the default language for a
                particular name and number of lyric.`
	__Documentation__000392_lyric_language_Inlined_Inlined.Source = ``
	__Documentation__000392_lyric_language_Inlined_Inlined.Lang = ``

	__Documentation__000393_lyric_Inlined_Inlined.Name = `lyric_Inlined_Inlined`
	__Documentation__000393_lyric_Inlined_Inlined.Text = `The lyric type represents text underlays for lyrics. Two text elements
                that are not separated by an elision element are part of the same syllable, but may
                have different text formatting. The MusicXML XSD is more strict than the DTD in
                enforcing this by disallowing a second syllabic element unless preceded by an
                elision element. The lyric number indicates multiple lines, though a name can be
                used as well. Common name examples are verse and chorus. Justification is center by
                default; placement is below by default. Vertical alignment is to the baseline of the
                text and horizontal alignment matches justification. The print-object attribute can
                override a note's print-lyric attribute in cases where only some lyrics on a note
                are printed, as when lyrics for later verses are printed in a block of text rather
                than with each note. The time-only attribute precisely specifies which lyrics are to
                be sung which time through a repeated section.`
	__Documentation__000393_lyric_Inlined_Inlined.Source = ``
	__Documentation__000393_lyric_Inlined_Inlined.Lang = ``

	__Documentation__000394_margin_type_Inlined_Inlined.Name = `margin-type_Inlined_Inlined`
	__Documentation__000394_margin_type_Inlined_Inlined.Text = `The margin-type type specifies whether margins apply to even page, odd
                pages, or both.`
	__Documentation__000394_margin_type_Inlined_Inlined.Source = ``
	__Documentation__000394_margin_type_Inlined_Inlined.Lang = ``

	__Documentation__000395_measure_layout_Inlined_Inlined.Name = `measure-layout_Inlined_Inlined`
	__Documentation__000395_measure_layout_Inlined_Inlined.Text = `The measure-layout type includes the horizontal distance from the
                previous measure. It applies to the current measure only.`
	__Documentation__000395_measure_layout_Inlined_Inlined.Source = ``
	__Documentation__000395_measure_layout_Inlined_Inlined.Lang = ``

	__Documentation__000396_measure_numbering_value_Inlined_Inlined.Name = `measure-numbering-value_Inlined_Inlined`
	__Documentation__000396_measure_numbering_value_Inlined_Inlined.Text = `The measure-numbering-value type describes how measure numbers are
                displayed on this part: no numbers, numbers every measure, or numbers every system.`
	__Documentation__000396_measure_numbering_value_Inlined_Inlined.Source = ``
	__Documentation__000396_measure_numbering_value_Inlined_Inlined.Lang = ``

	__Documentation__000397_measure_numbering_Inlined_Inlined.Name = `measure-numbering_Inlined_Inlined`
	__Documentation__000397_measure_numbering_Inlined_Inlined.Text = `The measure-numbering type describes how frequently measure numbers
                are displayed on this part. The text attribute from the measure element is used for
                display, or the number attribute if the text attribute is not present. Measures with
                an implicit attribute set to "yes" never display a measure number, regardless of the
                measure-numbering setting. The optional staff attribute refers to staff numbers
                within the part, from top to bottom on the system. It indicates which staff is used
                as the reference point for vertical positioning. A value of 1 is assumed if not
                present. The optional multiple-rest-always and multiple-rest-range attributes
                describe how measure numbers are shown on multiple rests when the measure-numbering
                value is not set to none. The multiple-rest-always attribute is set to yes when the
                measure number should always be shown, even if the multiple rest starts midway
                through a system when measure numbering is set to system level. The
                multiple-rest-range attribute is set to yes when measure numbers on multiple rests
                display the range of numbers for the first and last measure, rather than just the
                number of the first measure.`
	__Documentation__000397_measure_numbering_Inlined_Inlined.Source = ``
	__Documentation__000397_measure_numbering_Inlined_Inlined.Lang = ``

	__Documentation__000398_measure_repeat_Inlined_Inlined.Name = `measure-repeat_Inlined_Inlined`
	__Documentation__000398_measure_repeat_Inlined_Inlined.Text = `The measure-repeat type is used for both single and multiple measure
                repeats. The text of the element indicates the number of measures to be repeated in
                a single pattern. The slashes attribute specifies the number of slashes to use in
                the repeat sign. It is 1 if not specified. The text of the element is ignored when
                the type is stop. The stop type indicates the first measure where the repeats are no
                longer displayed. Both the start and the stop of the measure-repeat should be
                specified unless the repeats are displayed through the end of the part. The
                measure-repeat element specifies a notation style for repetitions. The actual music
                being repeated needs to be repeated within each measure of the MusicXML file. This
                element specifies the notation that indicates the repeat.`
	__Documentation__000398_measure_repeat_Inlined_Inlined.Source = ``
	__Documentation__000398_measure_repeat_Inlined_Inlined.Lang = ``

	__Documentation__000399_measure_style_Inlined_Inlined.Name = `measure-style_Inlined_Inlined`
	__Documentation__000399_measure_style_Inlined_Inlined.Text = `A measure-style indicates a special way to print partial to multiple
                measures within a part. This includes multiple rests over several measures, repeats
                of beats, single, or multiple measures, and use of slash notation. The multiple-rest
                and measure-repeat elements indicate the number of measures covered in the element
                content. The beat-repeat and slash elements can cover partial measures. All but the
                multiple-rest element use a type attribute to indicate starting and stopping the use
                of the style. The optional number attribute specifies the staff number from top to
                bottom on the system, as with clef.`
	__Documentation__000399_measure_style_Inlined_Inlined.Source = ``
	__Documentation__000399_measure_style_Inlined_Inlined.Lang = ``

	__Documentation__000400_measure_text_Inlined_Inlined.Name = `measure-text_Inlined_Inlined`
	__Documentation__000400_measure_text_Inlined_Inlined.Text = `The measure-text type is used for the text attribute of measure
                elements. It has at least one character. The implicit attribute of the measure
                element should be set to "yes" rather than setting the text attribute to an empty
                string.`
	__Documentation__000400_measure_text_Inlined_Inlined.Source = ``
	__Documentation__000400_measure_text_Inlined_Inlined.Lang = ``

	__Documentation__000401_membrane_value_Inlined_Inlined.Name = `membrane-value_Inlined_Inlined`
	__Documentation__000401_membrane_value_Inlined_Inlined.Text = `The membrane-value type represents pictograms for membrane percussion
                instruments.`
	__Documentation__000401_membrane_value_Inlined_Inlined.Source = ``
	__Documentation__000401_membrane_value_Inlined_Inlined.Lang = ``

	__Documentation__000402_membrane_Inlined_Inlined.Name = `membrane_Inlined_Inlined`
	__Documentation__000402_membrane_Inlined_Inlined.Text = `The membrane type represents pictograms for membrane percussion
                instruments. The smufl attribute is used to distinguish different SMuFL stylistic
                alternates.`
	__Documentation__000402_membrane_Inlined_Inlined.Source = ``
	__Documentation__000402_membrane_Inlined_Inlined.Lang = ``

	__Documentation__000403_metal_value_Inlined_Inlined.Name = `metal-value_Inlined_Inlined`
	__Documentation__000403_metal_value_Inlined_Inlined.Text = `The metal-value type represents pictograms for metal percussion
                instruments. The hi-hat value refers to a pictogram like Stone's high-hat cymbals
                but without the long vertical line at the bottom.`
	__Documentation__000403_metal_value_Inlined_Inlined.Source = ``
	__Documentation__000403_metal_value_Inlined_Inlined.Lang = ``

	__Documentation__000404_metal_Inlined_Inlined.Name = `metal_Inlined_Inlined`
	__Documentation__000404_metal_Inlined_Inlined.Text = `The metal type represents pictograms for metal percussion instruments.
                The smufl attribute is used to distinguish different SMuFL stylistic alternates.`
	__Documentation__000404_metal_Inlined_Inlined.Source = ``
	__Documentation__000404_metal_Inlined_Inlined.Lang = ``

	__Documentation__000405_metronome_beam_Inlined_Inlined.Name = `metronome-beam_Inlined_Inlined`
	__Documentation__000405_metronome_beam_Inlined_Inlined.Text = `The metronome-beam type works like the beam type in defining metric
                relationships, but does not include all the attributes available in the beam type.`
	__Documentation__000405_metronome_beam_Inlined_Inlined.Source = ``
	__Documentation__000405_metronome_beam_Inlined_Inlined.Lang = ``

	__Documentation__000406_metronome_note_Inlined_Inlined.Name = `metronome-note_Inlined_Inlined`
	__Documentation__000406_metronome_note_Inlined_Inlined.Text = `The metronome-note type defines the appearance of a note within a
                metric relationship mark.`
	__Documentation__000406_metronome_note_Inlined_Inlined.Source = ``
	__Documentation__000406_metronome_note_Inlined_Inlined.Lang = ``

	__Documentation__000407_metronome_tied_Inlined_Inlined.Name = `metronome-tied_Inlined_Inlined`
	__Documentation__000407_metronome_tied_Inlined_Inlined.Text = `The metronome-tied indicates the presence of a tie within a metric
                relationship mark. As with the tied element, both the start and stop of the tie
                should be specified, in this case within separate metronome-note elements.`
	__Documentation__000407_metronome_tied_Inlined_Inlined.Source = ``
	__Documentation__000407_metronome_tied_Inlined_Inlined.Lang = ``

	__Documentation__000408_metronome_tuplet_Inlined_Inlined.Name = `metronome-tuplet_Inlined_Inlined`
	__Documentation__000408_metronome_tuplet_Inlined_Inlined.Text = `The metronome-tuplet type uses the same element structure as the
                time-modification element along with some attributes from the tuplet element.`
	__Documentation__000408_metronome_tuplet_Inlined_Inlined.Source = ``
	__Documentation__000408_metronome_tuplet_Inlined_Inlined.Lang = ``

	__Documentation__000409_metronome_Inlined_Inlined.Name = `metronome_Inlined_Inlined`
	__Documentation__000409_metronome_Inlined_Inlined.Text = `The metronome type represents metronome marks and other metric
                relationships. The beat-unit group and per-minute element specify regular metronome
                marks. The metronome-note and metronome-relation elements allow for the
                specification of metric modulations and other metric relationships, such as swing
                tempo marks where two eighths are equated to a quarter note / eighth note triplet.
                Tied notes can be represented in both types of metronome marks by using the
                beat-unit-tied and metronome-tied elements. The parentheses attribute indicates
                whether or not to put the metronome mark in parentheses; its value is no if not
                specified. The print-object attribute is set to no in cases where the metronome
                element represents a relationship or range that is not displayed in the music
                notation.`
	__Documentation__000409_metronome_Inlined_Inlined.Source = ``
	__Documentation__000409_metronome_Inlined_Inlined.Lang = ``

	__Documentation__000410_midi_128_Inlined_Inlined.Name = `midi-128_Inlined_Inlined`
	__Documentation__000410_midi_128_Inlined_Inlined.Text = `The midi-128 type is used to express MIDI 1.0 values that range from 1
                to 128.`
	__Documentation__000410_midi_128_Inlined_Inlined.Source = ``
	__Documentation__000410_midi_128_Inlined_Inlined.Lang = ``

	__Documentation__000411_midi_16384_Inlined_Inlined.Name = `midi-16384_Inlined_Inlined`
	__Documentation__000411_midi_16384_Inlined_Inlined.Text = `The midi-16384 type is used to express MIDI 1.0 values that range from
                1 to 16,384.`
	__Documentation__000411_midi_16384_Inlined_Inlined.Source = ``
	__Documentation__000411_midi_16384_Inlined_Inlined.Lang = ``

	__Documentation__000412_midi_16_Inlined_Inlined.Name = `midi-16_Inlined_Inlined`
	__Documentation__000412_midi_16_Inlined_Inlined.Text = `The midi-16 type is used to express MIDI 1.0 values that range from 1
                to 16.`
	__Documentation__000412_midi_16_Inlined_Inlined.Source = ``
	__Documentation__000412_midi_16_Inlined_Inlined.Lang = ``

	__Documentation__000413_midi_device_Inlined_Inlined.Name = `midi-device_Inlined_Inlined`
	__Documentation__000413_midi_device_Inlined_Inlined.Text = `The midi-device type corresponds to the DeviceName meta event in
                Standard MIDI Files. The optional port attribute is a number from 1 to 16 that can
                be used with the unofficial MIDI 1.0 port (or cable) meta event. Unlike the
                DeviceName meta event, there can be multiple midi-device elements per MusicXML part.
                The optional id attribute refers to the score-instrument assigned to this device. If
                missing, the device assignment affects all score-instrument elements in the
                score-part.`
	__Documentation__000413_midi_device_Inlined_Inlined.Source = ``
	__Documentation__000413_midi_device_Inlined_Inlined.Lang = ``

	__Documentation__000414_midi_instrument_Inlined_Inlined.Name = `midi-instrument_Inlined_Inlined`
	__Documentation__000414_midi_instrument_Inlined_Inlined.Text = `The midi-instrument type defines MIDI 1.0 instrument playback. The
                midi-instrument element can be a part of either the score-instrument element at the
                start of a part, or the sound element within a part. The id attribute refers to the
                score-instrument affected by the change.`
	__Documentation__000414_midi_instrument_Inlined_Inlined.Source = ``
	__Documentation__000414_midi_instrument_Inlined_Inlined.Lang = ``

	__Documentation__000415_millimeters_Inlined_Inlined.Name = `millimeters_Inlined_Inlined`
	__Documentation__000415_millimeters_Inlined_Inlined.Text = `The millimeters type is a number representing millimeters. This is
                used in the scaling element to provide a default scaling from tenths to physical
                units.`
	__Documentation__000415_millimeters_Inlined_Inlined.Source = ``
	__Documentation__000415_millimeters_Inlined_Inlined.Lang = ``

	__Documentation__000416_milliseconds_Inlined_Inlined.Name = `milliseconds_Inlined_Inlined`
	__Documentation__000416_milliseconds_Inlined_Inlined.Text = `The milliseconds type represents an integral number of milliseconds.`
	__Documentation__000416_milliseconds_Inlined_Inlined.Source = ``
	__Documentation__000416_milliseconds_Inlined_Inlined.Lang = ``

	__Documentation__000417_miscellaneous_field_Inlined_Inlined.Name = `miscellaneous-field_Inlined_Inlined`
	__Documentation__000417_miscellaneous_field_Inlined_Inlined.Text = `If a program has other metadata not yet supported in the MusicXML
                format, each type of metadata can go in a miscellaneous-field element. The required
                name attribute indicates the type of metadata the element content represents.`
	__Documentation__000417_miscellaneous_field_Inlined_Inlined.Source = ``
	__Documentation__000417_miscellaneous_field_Inlined_Inlined.Lang = ``

	__Documentation__000418_miscellaneous_Inlined_Inlined.Name = `miscellaneous_Inlined_Inlined`
	__Documentation__000418_miscellaneous_Inlined_Inlined.Text = `If a program has other metadata not yet supported in the MusicXML
                format, it can go in the miscellaneous element. The miscellaneous type puts each
                separate part of metadata into its own miscellaneous-field type.`
	__Documentation__000418_miscellaneous_Inlined_Inlined.Source = ``
	__Documentation__000418_miscellaneous_Inlined_Inlined.Lang = ``

	__Documentation__000419_mode_Inlined_Inlined.Name = `mode_Inlined_Inlined`
	__Documentation__000419_mode_Inlined_Inlined.Text = `The mode type is used to specify major/minor and other mode
                distinctions. Valid mode values include major, minor, dorian, phrygian, lydian,
                mixolydian, aeolian, ionian, locrian, and none.`
	__Documentation__000419_mode_Inlined_Inlined.Source = ``
	__Documentation__000419_mode_Inlined_Inlined.Lang = ``

	__Documentation__000420_mordent_Inlined_Inlined.Name = `mordent_Inlined_Inlined`
	__Documentation__000420_mordent_Inlined_Inlined.Text = `The mordent type is used for both represents the mordent sign with the
                vertical line and the inverted-mordent sign without the line. The long attribute is
                "no" by default. The approach and departure attributes are used for compound
                ornaments, indicating how the beginning and ending of the ornament look relative to
                the main part of the mordent.`
	__Documentation__000420_mordent_Inlined_Inlined.Source = ``
	__Documentation__000420_mordent_Inlined_Inlined.Lang = ``

	__Documentation__000421_multiple_rest_Inlined_Inlined.Name = `multiple-rest_Inlined_Inlined`
	__Documentation__000421_multiple_rest_Inlined_Inlined.Text = `The text of the multiple-rest type indicates the number of measures in
                the multiple rest. Multiple rests may use the 1-bar / 2-bar / 4-bar rest symbols, or
                a single shape. The use-symbols attribute indicates which to use; it is no if not
                specified.`
	__Documentation__000421_multiple_rest_Inlined_Inlined.Source = ``
	__Documentation__000421_multiple_rest_Inlined_Inlined.Lang = ``

	__Documentation__000422_music_data_Inlined_Inlined.Name = `music-data_Inlined_Inlined`
	__Documentation__000422_music_data_Inlined_Inlined.Text = `The music-data group contains the basic musical data that is either
                associated with a part or a measure, depending on whether the partwise or timewise
                hierarchy is used.`
	__Documentation__000422_music_data_Inlined_Inlined.Source = ``
	__Documentation__000422_music_data_Inlined_Inlined.Lang = ``

	__Documentation__000423_mute_Inlined_Inlined.Name = `mute_Inlined_Inlined`
	__Documentation__000423_mute_Inlined_Inlined.Text = `The mute type represents muting for different instruments, including
                brass, winds, and strings. The on and off values are used for undifferentiated
                mutes. The remaining values represent specific mutes.`
	__Documentation__000423_mute_Inlined_Inlined.Source = ``
	__Documentation__000423_mute_Inlined_Inlined.Lang = ``

	__Documentation__000424_name_display_Inlined_Inlined.Name = `name-display_Inlined_Inlined`
	__Documentation__000424_name_display_Inlined_Inlined.Text = `The name-display type is used for exact formatting of multi-font text
                in part and group names to the left of the system. The print-object attribute can be
                used to determine what, if anything, is printed at the start of each system.
                Enclosure for the display-text element is none by default. Language for the
                display-text element is Italian ("it") by default.`
	__Documentation__000424_name_display_Inlined_Inlined.Source = ``
	__Documentation__000424_name_display_Inlined_Inlined.Lang = ``

	__Documentation__000425_non_arpeggiate_Inlined_Inlined.Name = `non-arpeggiate_Inlined_Inlined`
	__Documentation__000425_non_arpeggiate_Inlined_Inlined.Text = `The non-arpeggiate type indicates that this note is at the top or
                bottom of a bracket indicating to not arpeggiate these notes. Since this does not
                involve playback, it is only used on the top or bottom notes, not on each note as
                for the arpeggiate type.`
	__Documentation__000425_non_arpeggiate_Inlined_Inlined.Source = ``
	__Documentation__000425_non_arpeggiate_Inlined_Inlined.Lang = ``

	__Documentation__000426_non_negative_decimal_Inlined_Inlined.Name = `non-negative-decimal_Inlined_Inlined`
	__Documentation__000426_non_negative_decimal_Inlined_Inlined.Text = `The non-negative-decimal type specifies a non-negative decimal value.`
	__Documentation__000426_non_negative_decimal_Inlined_Inlined.Source = ``
	__Documentation__000426_non_negative_decimal_Inlined_Inlined.Lang = ``

	__Documentation__000427_non_traditional_key_Inlined_Inlined.Name = `non-traditional-key_Inlined_Inlined`
	__Documentation__000427_non_traditional_key_Inlined_Inlined.Text = `The non-traditional-key group represents a single alteration within a
                non-traditional key signature. A sequence of these groups makes up a non-traditional
                key signature`
	__Documentation__000427_non_traditional_key_Inlined_Inlined.Source = ``
	__Documentation__000427_non_traditional_key_Inlined_Inlined.Lang = ``

	__Documentation__000428_notations_Inlined_Inlined.Name = `notations_Inlined_Inlined`
	__Documentation__000428_notations_Inlined_Inlined.Text = `Notations refer to musical notations, not XML notations. Multiple
                notations are allowed in order to represent multiple editorial levels. The
                print-object attribute, added in Version 3.0, allows notations to represent details
                of performance technique, such as fingerings, without having them appear in the
                score.`
	__Documentation__000428_notations_Inlined_Inlined.Source = ``
	__Documentation__000428_notations_Inlined_Inlined.Lang = ``

	__Documentation__000429_note_size_type_Inlined_Inlined.Name = `note-size-type_Inlined_Inlined`
	__Documentation__000429_note_size_type_Inlined_Inlined.Text = `The note-size-type type indicates the type of note being defined by a
                note-size element. The grace-cue type is used for notes of grace-cue size. The grace
                type is used for notes of cue size that include a grace element. The cue type is
                used for all other notes with cue size, whether defined explicitly or implicitly via
                a cue element. The large type is used for notes of large size.`
	__Documentation__000429_note_size_type_Inlined_Inlined.Source = ``
	__Documentation__000429_note_size_type_Inlined_Inlined.Lang = ``

	__Documentation__000430_note_size_Inlined_Inlined.Name = `note-size_Inlined_Inlined`
	__Documentation__000430_note_size_Inlined_Inlined.Text = `The note-size type indicates the percentage of the regular note size
                to use for notes with a cue and large size as defined in the type element. The grace
                type is used for notes of cue size that that include a grace element. The cue type
                is used for all other notes with cue size, whether defined explicitly or implicitly
                via a cue element. The large type is used for notes of large size. The text content
                represent the numeric percentage. A value of 100 would be identical to the size of a
                regular note as defined by the music font.`
	__Documentation__000430_note_size_Inlined_Inlined.Source = ``
	__Documentation__000430_note_size_Inlined_Inlined.Lang = ``

	__Documentation__000431_note_type_value_Inlined_Inlined.Name = `note-type-value_Inlined_Inlined`
	__Documentation__000431_note_type_value_Inlined_Inlined.Text = `The note-type-value type is used for the MusicXML type element and
                represents the graphic note type, from 1024th (shortest) to maxima (longest).`
	__Documentation__000431_note_type_value_Inlined_Inlined.Source = ``
	__Documentation__000431_note_type_value_Inlined_Inlined.Lang = ``

	__Documentation__000432_note_type_Inlined_Inlined.Name = `note-type_Inlined_Inlined`
	__Documentation__000432_note_type_Inlined_Inlined.Text = `The note-type type indicates the graphic note type. Values range from
                1024th to maxima. The size attribute indicates full, cue, grace-cue, or large size.
                The default is full for regular notes, grace-cue for notes that contain both grace
                and cue elements, and cue for notes that contain either a cue or a grace element,
                but not both.`
	__Documentation__000432_note_type_Inlined_Inlined.Source = ``
	__Documentation__000432_note_type_Inlined_Inlined.Lang = ``

	__Documentation__000433_note_Inlined_Inlined.Name = `note_Inlined_Inlined`
	__Documentation__000433_note_Inlined_Inlined.Text = `Notes are the most common type of MusicXML data. The MusicXML format
                distinguishes between elements used for sound information and elements used for
                notation information (e.g., tie is used for sound, tied for notation). Thus grace
                notes do not have a duration element. Cue notes have a duration element, as do
                forward elements, but no tie elements. Having these two types of information
                available can make interchange easier, as some programs handle one type of
                information more readily than the other. The print-leger attribute is used to
                indicate whether leger lines are printed. Notes without leger lines are used to
                indicate indeterminate high and low notes. By default, it is set to yes. If
                print-object is set to no, print-leger is interpreted to also be set to no if not
                present. This attribute is ignored for rests. The dynamics and end-dynamics
                attributes correspond to MIDI 1.0's Note On and Note Off velocities, respectively.
                They are expressed in terms of percentages of the default forte value (90 for MIDI
                1.0). The attack and release attributes are used to alter the starting and stopping
                time of the note from when it would otherwise occur based on the flow of durations -
                information that is specific to a performance. They are expressed in terms of
                divisions, either positive or negative. A note that starts a tie should not have a
                release attribute, and a note that stops a tie should not have an attack attribute.
                The attack and release attributes are independent of each other. The attack
                attribute only changes the starting time of a note, and the release attribute only
                changes the stopping time of a note. If a note is played only particular times
                through a repeat, the time-only attribute shows which times to play the note. The
                pizzicato attribute is used when just this note is sounded pizzicato, vs. the
                pizzicato element which changes overall playback between pizzicato and arco.`
	__Documentation__000433_note_Inlined_Inlined.Source = ``
	__Documentation__000433_note_Inlined_Inlined.Lang = ``

	__Documentation__000434_notehead_text_Inlined_Inlined.Name = `notehead-text_Inlined_Inlined`
	__Documentation__000434_notehead_text_Inlined_Inlined.Text = `The notehead-text type represents text that is displayed inside a
                notehead, as is done in some educational music. It is not needed for the numbers
                used in tablature or jianpu notation. The presence of a TAB or jianpu clefs is
                sufficient to indicate that numbers are used. The display-text and accidental-text
                elements allow display of fully formatted text and accidentals.`
	__Documentation__000434_notehead_text_Inlined_Inlined.Source = ``
	__Documentation__000434_notehead_text_Inlined_Inlined.Lang = ``

	__Documentation__000435_notehead_value_Inlined_Inlined.Name = `notehead-value_Inlined_Inlined`
	__Documentation__000435_notehead_value_Inlined_Inlined.Text = ` The notehead-value type indicates shapes other than the open and
                closed ovals associated with note durations. The values do, re, mi, fa, fa up, so,
                la, and ti correspond to Aikin's 7-shape system. The fa up shape is typically used
                with upstems; the fa shape is typically used with downstems or no stems. The arrow
                shapes differ from triangle and inverted triangle by being centered on the stem.
                Slashed and back slashed notes include both the normal notehead and a slash. The
                triangle shape has the tip of the triangle pointing up; the inverted triangle shape
                has the tip of the triangle pointing down. The left triangle shape is a right
                triangle with the hypotenuse facing up and to the left. The other notehead covers
                noteheads other than those listed here. It is usually used in combination with the
                smufl attribute to specify a particular SMuFL notehead. The smufl attribute may be
                used with any notehead value to help specify the appearance of symbols that share
                the same MusicXML semantics. Noteheads in the SMuFL Note name noteheads and Note
                name noteheads supplement ranges (U+E150–U+E1AF and U+EEE0–U+EEFF) should not use
                the smufl attribute or the "other" value, but instead use the notehead-text element.`
	__Documentation__000435_notehead_value_Inlined_Inlined.Source = ``
	__Documentation__000435_notehead_value_Inlined_Inlined.Lang = ``

	__Documentation__000436_notehead_Inlined_Inlined.Name = `notehead_Inlined_Inlined`
	__Documentation__000436_notehead_Inlined_Inlined.Text = `The notehead type indicates shapes other than the open and closed
                ovals associated with note durations. The smufl attribute can be used to specify a
                particular notehead, allowing application interoperability without requiring every
                SMuFL glyph to have a MusicXML element equivalent. This attribute can be used either
                with the "other" value, or to refine a specific notehead value such as "cluster".
                Noteheads in the SMuFL Note name noteheads and Note name noteheads supplement ranges
                (U+E150–U+E1AF and U+EEE0–U+EEFF) should not use the smufl attribute or the "other"
                value, but instead use the notehead-text element. For the enclosed shapes, the
                default is to be hollow for half notes and longer, and filled otherwise. The filled
                attribute can be set to change this if needed. If the parentheses attribute is set
                to yes, the notehead is parenthesized. It is no by default.`
	__Documentation__000436_notehead_Inlined_Inlined.Source = ``
	__Documentation__000436_notehead_Inlined_Inlined.Lang = ``

	__Documentation__000437_number_level_Inlined_Inlined.Name = `number-level_Inlined_Inlined`
	__Documentation__000437_number_level_Inlined_Inlined.Text = `Slurs, tuplets, and many other features can be concurrent and overlap
                within a single musical part. The number-level entity distinguishes up to 16
                concurrent objects of the same type when the objects overlap in MusicXML document
                order. Values greater than 6 are usually only needed for music with a large number
                of divisi staves in a single part, or if there are more than 6 cross-staff arpeggios
                in a single measure. When a number-level value is implied, the value is 1 by
                default. When polyphonic parts are involved, the ordering within a MusicXML document
                can differ from musical score order. As an example, say we have a piano part in 4/4
                where within a single measure, all the notes on the top staff are followed by all
                the notes on the bottom staff. In this example, each staff has a slur that starts on
                beat 2 and stops on beat 3, and there is a third slur that goes from beat 1 of one
                staff to beat 4 of the other staff. In this situation, the two mid-measure slurs can
                use the same number because they do not overlap in MusicXML document order, even
                though they do overlap in musical score order. Within the MusicXML document, the top
                staff slur will both start and stop before the bottom staff slur starts and stops.
                If the cross-staff slur starts in the top staff and stops in the bottom staff, it
                will need a separate number from the mid-measure slurs because it overlaps those
                slurs in MusicXML document order. However, if the cross-staff slur starts in the
                bottom staff and stops in the top staff, all three slurs can use the same number.
                None of them overlap within the MusicXML document, even though they all overlap each
                other in the musical score order. Within the MusicXML document, the start and stop
                of the top-staff slur will be followed by the stop and start of the cross-staff
                slur, followed by the start and stop of the bottom-staff slur. As this example
                demonstrates, a reading program should be prepared to handle cases where the
                number-levels start and stop in an arbitrary order. Because the start and stop
                values refer to musical score order, a program may find the stopping point of an
                object earlier in the MusicXML document than it will find its starting point.`
	__Documentation__000437_number_level_Inlined_Inlined.Source = ``
	__Documentation__000437_number_level_Inlined_Inlined.Lang = ``

	__Documentation__000438_number_of_lines_Inlined_Inlined.Name = `number-of-lines_Inlined_Inlined`
	__Documentation__000438_number_of_lines_Inlined_Inlined.Text = `The number-of-lines type is used to specify the number of lines in
                text decoration attributes.`
	__Documentation__000438_number_of_lines_Inlined_Inlined.Source = ``
	__Documentation__000438_number_of_lines_Inlined_Inlined.Lang = ``

	__Documentation__000439_number_or_normal_Inlined_Inlined.Name = `number-or-normal_Inlined_Inlined`
	__Documentation__000439_number_or_normal_Inlined_Inlined.Text = `The number-or-normal values can be either a decimal number or the
                string "normal". This is used by the line-height and letter-spacing attributes.`
	__Documentation__000439_number_or_normal_Inlined_Inlined.Source = ``
	__Documentation__000439_number_or_normal_Inlined_Inlined.Lang = ``

	__Documentation__000440_numeral_key_Inlined_Inlined.Name = `numeral-key_Inlined_Inlined`
	__Documentation__000440_numeral_key_Inlined_Inlined.Text = `The numeral-key type is used when the key for the numeral is different
                than the key specified by the key signature. The numeral-fifths element specifies
                the key in the same way as the fifths element. The numeral-mode element specifies
                the mode similar to the mode element, but with a restricted set of values`
	__Documentation__000440_numeral_key_Inlined_Inlined.Source = ``
	__Documentation__000440_numeral_key_Inlined_Inlined.Lang = ``

	__Documentation__000441_numeral_mode_Inlined_Inlined.Name = `numeral-mode_Inlined_Inlined`
	__Documentation__000441_numeral_mode_Inlined_Inlined.Text = `The numeral-mode type specifies the mode similar to the mode type, but
                with a restricted set of values. The different minor values are used to interpret
                numeral-root values of 6 and 7 when present in a minor key. The harmonic minor value
                sharpens the 7 and the melodic minor value sharpens both 6 and 7. If a minor mode is
                used without qualification, either in the mode or numeral-mode elements, natural
                minor is used.`
	__Documentation__000441_numeral_mode_Inlined_Inlined.Source = ``
	__Documentation__000441_numeral_mode_Inlined_Inlined.Lang = ``

	__Documentation__000442_numeral_root_Inlined_Inlined.Name = `numeral-root_Inlined_Inlined`
	__Documentation__000442_numeral_root_Inlined_Inlined.Text = `The numeral-root type represents the Roman numeral or Nashville number
                as a positive integer from 1 to 7. The text attribute indicates how the numeral
                should appear in the score. A numeral-root value of 5 with a kind of major would
                have a text attribute of "V" if displayed as a Roman numeral, and "5" if displayed
                as a Nashville number. If the text attribute is not specified, the display is
                application-dependent.`
	__Documentation__000442_numeral_root_Inlined_Inlined.Source = ``
	__Documentation__000442_numeral_root_Inlined_Inlined.Lang = ``

	__Documentation__000443_numeral_value_Inlined_Inlined.Name = `numeral-value_Inlined_Inlined`
	__Documentation__000443_numeral_value_Inlined_Inlined.Text = `The numeral-value type represents a Roman numeral or Nashville number
                value as a positive integer from 1 to 7.`
	__Documentation__000443_numeral_value_Inlined_Inlined.Source = ``
	__Documentation__000443_numeral_value_Inlined_Inlined.Lang = ``

	__Documentation__000444_numeral_Inlined_Inlined.Name = `numeral_Inlined_Inlined`
	__Documentation__000444_numeral_Inlined_Inlined.Text = `The numeral type represents the Roman numeral or Nashville number part
                of a harmony. It requires that the key be specified in the encoding, either with a
                key or numeral-key element.`
	__Documentation__000444_numeral_Inlined_Inlined.Source = ``
	__Documentation__000444_numeral_Inlined_Inlined.Lang = ``

	__Documentation__000445_octave_shift_Inlined_Inlined.Name = `octave-shift_Inlined_Inlined`
	__Documentation__000445_octave_shift_Inlined_Inlined.Text = `The octave shift type indicates where notes are shifted up or down
                from their true pitched values because of printing difficulty. Thus a treble clef
                line noted with 8va will be indicated with an octave-shift down from the pitch data
                indicated in the notes. A size of 8 indicates one octave; a size of 15 indicates two
                octaves.`
	__Documentation__000445_octave_shift_Inlined_Inlined.Source = ``
	__Documentation__000445_octave_shift_Inlined_Inlined.Lang = ``

	__Documentation__000446_octave_Inlined_Inlined.Name = `octave_Inlined_Inlined`
	__Documentation__000446_octave_Inlined_Inlined.Text = `Octaves are represented by the numbers 0 to 9, where 4 indicates the
                octave started by middle C.`
	__Documentation__000446_octave_Inlined_Inlined.Source = ``
	__Documentation__000446_octave_Inlined_Inlined.Lang = ``

	__Documentation__000447_offset_Inlined_Inlined.Name = `offset_Inlined_Inlined`
	__Documentation__000447_offset_Inlined_Inlined.Text = `An offset is represented in terms of divisions, and indicates where
                the direction will appear relative to the current musical location. The current
                musical location is always within the current measure, even at the end of a measure.
                The offset affects the visual appearance of the direction. If the sound attribute is
                "yes", then the offset affects playback and listening too. If the sound attribute is
                "no", then any sound or listening associated with the direction takes effect at the
                current location. The sound attribute is "no" by default for compatibility with
                earlier versions of the MusicXML format. If an element within a direction includes a
                default-x attribute, the offset value will be ignored when determining the
                appearance of that element.`
	__Documentation__000447_offset_Inlined_Inlined.Source = ``
	__Documentation__000447_offset_Inlined_Inlined.Lang = ``

	__Documentation__000448_on_off_Inlined_Inlined.Name = `on-off_Inlined_Inlined`
	__Documentation__000448_on_off_Inlined_Inlined.Text = `The on-off type is used for notation elements such as string mutes.`
	__Documentation__000448_on_off_Inlined_Inlined.Source = ``
	__Documentation__000448_on_off_Inlined_Inlined.Lang = ``

	__Documentation__000449_opus_Inlined_Inlined.Name = `opus_Inlined_Inlined`
	__Documentation__000449_opus_Inlined_Inlined.Text = `The opus type represents a link to a MusicXML opus document that
                composes multiple MusicXML scores into a collection.`
	__Documentation__000449_opus_Inlined_Inlined.Source = ``
	__Documentation__000449_opus_Inlined_Inlined.Lang = ``

	__Documentation__000450_ornaments_Inlined_Inlined.Name = `ornaments_Inlined_Inlined`
	__Documentation__000450_ornaments_Inlined_Inlined.Text = `Ornaments can be any of several types, followed optionally by
                accidentals. The accidental-mark element's content is represented the same as an
                accidental element, but with a different name to reflect the different musical
                meaning.`
	__Documentation__000450_ornaments_Inlined_Inlined.Source = ``
	__Documentation__000450_ornaments_Inlined_Inlined.Lang = ``

	__Documentation__000451_other_appearance_Inlined_Inlined.Name = `other-appearance_Inlined_Inlined`
	__Documentation__000451_other_appearance_Inlined_Inlined.Text = `The other-appearance type is used to define any graphical settings not
                yet in the current version of the MusicXML format. This allows extended
                representation, though without application interoperability.`
	__Documentation__000451_other_appearance_Inlined_Inlined.Source = ``
	__Documentation__000451_other_appearance_Inlined_Inlined.Lang = ``

	__Documentation__000452_other_direction_Inlined_Inlined.Name = `other-direction_Inlined_Inlined`
	__Documentation__000452_other_direction_Inlined_Inlined.Text = `The other-direction type is used to define any direction symbols not
                yet in the MusicXML format. The smufl attribute can be used to specify a particular
                direction symbol, allowing application interoperability without requiring every
                SMuFL glyph to have a MusicXML element equivalent. Using the other-direction type
                without the smufl attribute allows for extended representation, though without
                application interoperability.`
	__Documentation__000452_other_direction_Inlined_Inlined.Source = ``
	__Documentation__000452_other_direction_Inlined_Inlined.Lang = ``

	__Documentation__000453_other_listening_Inlined_Inlined.Name = `other-listening_Inlined_Inlined`
	__Documentation__000453_other_listening_Inlined_Inlined.Text = `The other-listening type represents other types of listening control
                and interaction. The required type attribute indicates the type of listening to
                which the element content applies. The optional player and time-only attributes
                restrict the element to apply to a single player or set of times through a repeated
                section, respectively.`
	__Documentation__000453_other_listening_Inlined_Inlined.Source = ``
	__Documentation__000453_other_listening_Inlined_Inlined.Lang = ``

	__Documentation__000454_other_notation_Inlined_Inlined.Name = `other-notation_Inlined_Inlined`
	__Documentation__000454_other_notation_Inlined_Inlined.Text = `The other-notation type is used to define any notations not yet in the
                MusicXML format. It handles notations where more specific extension elements such as
                other-dynamics and other-technical are not appropriate. The smufl attribute can be
                used to specify a particular notation, allowing application interoperability without
                requiring every SMuFL glyph to have a MusicXML element equivalent. Using the
                other-notation type without the smufl attribute allows for extended representation,
                though without application interoperability.`
	__Documentation__000454_other_notation_Inlined_Inlined.Source = ``
	__Documentation__000454_other_notation_Inlined_Inlined.Lang = ``

	__Documentation__000455_other_placement_text_Inlined_Inlined.Name = `other-placement-text_Inlined_Inlined`
	__Documentation__000455_other_placement_text_Inlined_Inlined.Text = `The other-placement-text type represents a text element with
                print-style, placement, and smufl attribute groups. This type is used by MusicXML
                notation extension elements to allow specification of specific SMuFL glyphs without
                needed to add every glyph as a MusicXML element.`
	__Documentation__000455_other_placement_text_Inlined_Inlined.Source = ``
	__Documentation__000455_other_placement_text_Inlined_Inlined.Lang = ``

	__Documentation__000456_other_play_Inlined_Inlined.Name = `other-play_Inlined_Inlined`
	__Documentation__000456_other_play_Inlined_Inlined.Text = `The other-play element represents other types of playback. The
                required type attribute indicates the type of playback to which the element content
                applies.`
	__Documentation__000456_other_play_Inlined_Inlined.Source = ``
	__Documentation__000456_other_play_Inlined_Inlined.Lang = ``

	__Documentation__000457_other_text_Inlined_Inlined.Name = `other-text_Inlined_Inlined`
	__Documentation__000457_other_text_Inlined_Inlined.Text = `The other-text type represents a text element with a smufl attribute
                group. This type is used by MusicXML direction extension elements to allow
                specification of specific SMuFL glyphs without needed to add every glyph as a
                MusicXML element.`
	__Documentation__000457_other_text_Inlined_Inlined.Source = ``
	__Documentation__000457_other_text_Inlined_Inlined.Lang = ``

	__Documentation__000458_over_under_Inlined_Inlined.Name = `over-under_Inlined_Inlined`
	__Documentation__000458_over_under_Inlined_Inlined.Text = `The over-under type is used to indicate whether the tips of curved
                lines such as slurs and ties are overhand (tips down) or underhand (tips up).`
	__Documentation__000458_over_under_Inlined_Inlined.Source = ``
	__Documentation__000458_over_under_Inlined_Inlined.Lang = ``

	__Documentation__000459_page_layout_Inlined_Inlined.Name = `page-layout_Inlined_Inlined`
	__Documentation__000459_page_layout_Inlined_Inlined.Text = `Page layout can be defined both in score-wide defaults and in the
                print element. Page margins are specified either for both even and odd pages, or via
                separate odd and even page number values. The type is not needed when used as part
                of a print element. If omitted when used in the defaults element, "both" is the
                default. If no page-layout element is present in the defaults element, default page
                layout values are chosen by the application. When used in the print element, the
                page-layout element affects the appearance of the current page only. All other pages
                use the default values as determined by the defaults element. If any child elements
                are missing from the page-layout element in a print element, the values determined
                by the defaults element are used there as well.`
	__Documentation__000459_page_layout_Inlined_Inlined.Source = ``
	__Documentation__000459_page_layout_Inlined_Inlined.Lang = ``

	__Documentation__000460_page_margins_Inlined_Inlined.Name = `page-margins_Inlined_Inlined`
	__Documentation__000460_page_margins_Inlined_Inlined.Text = `Page margins are specified either for both even and odd pages, or via
                separate odd and even page number values. The type attribute is not needed when used
                as part of a print element. If omitted when the page-margins type is used in the
                defaults element, "both" is the default value.`
	__Documentation__000460_page_margins_Inlined_Inlined.Source = ``
	__Documentation__000460_page_margins_Inlined_Inlined.Lang = ``

	__Documentation__000461_part_clef_Inlined_Inlined.Name = `part-clef_Inlined_Inlined`
	__Documentation__000461_part_clef_Inlined_Inlined.Text = `The child elements of the part-clef type have the same meaning as for
                the clef type. However that meaning applies to a transposed part created from the
                existing score file.`
	__Documentation__000461_part_clef_Inlined_Inlined.Source = ``
	__Documentation__000461_part_clef_Inlined_Inlined.Lang = ``

	__Documentation__000462_part_group_Inlined_Inlined.Name = `part-group_Inlined_Inlined`
	__Documentation__000462_part_group_Inlined_Inlined.Text = `The part-group element indicates groupings of parts in the score,
                usually indicated by braces and brackets. Braces that are used for multi-staff parts
                should be defined in the attributes element for that part. The part-group start
                element appears before the first score-part in the group. The part-group stop
                element appears after the last score-part in the group. The number attribute is used
                to distinguish overlapping and nested part-groups, not the sequence of groups. As
                with parts, groups can have a name and abbreviation. Values for the child elements
                are ignored at the stop of a group. A part-group element is not needed for a single
                multi-staff part. By default, multi-staff parts include a brace symbol and (if
                appropriate given the bar-style) common barlines. The symbol formatting for a
                multi-staff part can be more fully specified using the part-symbol element.`
	__Documentation__000462_part_group_Inlined_Inlined.Source = ``
	__Documentation__000462_part_group_Inlined_Inlined.Lang = ``

	__Documentation__000463_part_group_Inlined_Inlined.Name = `part-group_Inlined_Inlined`
	__Documentation__000463_part_group_Inlined_Inlined.Text = `The part-group element is defined within a group due to its multiple
                uses within the part-list element.`
	__Documentation__000463_part_group_Inlined_Inlined.Source = ``
	__Documentation__000463_part_group_Inlined_Inlined.Lang = ``

	__Documentation__000464_part_link_Inlined_Inlined.Name = `part-link_Inlined_Inlined`
	__Documentation__000464_part_link_Inlined_Inlined.Text = `The part-link type allows MusicXML data for both score and parts to be
                contained within a single compressed MusicXML file. It links a score-part from a
                score document to MusicXML documents that contain parts data. In the case of a
                single compressed MusicXML file, the link href values are paths that are relative to
                the root folder of the zip file.`
	__Documentation__000464_part_link_Inlined_Inlined.Source = ``
	__Documentation__000464_part_link_Inlined_Inlined.Lang = ``

	__Documentation__000465_part_list_Inlined_Inlined.Name = `part-list_Inlined_Inlined`
	__Documentation__000465_part_list_Inlined_Inlined.Text = `The part-list identifies the different musical parts in this document.
                Each part has an ID that is used later within the musical data. Since parts may be
                encoded separately and combined later, identification elements are present at both
                the score and score-part levels. There must be at least one score-part, combined as
                desired with part-group elements that indicate braces and brackets. Parts are
                ordered from top to bottom in a score based on the order in which they appear in the
                part-list.`
	__Documentation__000465_part_list_Inlined_Inlined.Source = ``
	__Documentation__000465_part_list_Inlined_Inlined.Lang = ``

	__Documentation__000466_part_name_Inlined_Inlined.Name = `part-name_Inlined_Inlined`
	__Documentation__000466_part_name_Inlined_Inlined.Text = `The part-name type describes the name or abbreviation of a score-part
                element. Formatting attributes for the part-name element are deprecated in Version
                2.0 in favor of the new part-name-display and part-abbreviation-display elements.`
	__Documentation__000466_part_name_Inlined_Inlined.Source = ``
	__Documentation__000466_part_name_Inlined_Inlined.Lang = ``

	__Documentation__000467_part_symbol_Inlined_Inlined.Name = `part-symbol_Inlined_Inlined`
	__Documentation__000467_part_symbol_Inlined_Inlined.Text = `The part-symbol type indicates how a symbol for a multi-staff part is
                indicated in the score; brace is the default value. The top-staff and bottom-staff
                attributes are used when the brace does not extend across the entire part. For
                example, in a 3-staff organ part, the top-staff will typically be 1 for the right
                hand, while the bottom-staff will typically be 2 for the left hand. Staff 3 for the
                pedals is usually outside the brace. By default, the presence of a part-symbol
                element that does not extend across the entire part also indicates a corresponding
                change in the common barlines within a part.`
	__Documentation__000467_part_symbol_Inlined_Inlined.Source = ``
	__Documentation__000467_part_symbol_Inlined_Inlined.Lang = ``

	__Documentation__000468_part_transpose_Inlined_Inlined.Name = `part-transpose_Inlined_Inlined`
	__Documentation__000468_part_transpose_Inlined_Inlined.Text = `The child elements of the part-transpose type have the same meaning as
                for the transpose type. However that meaning applies to a transposed part created
                from the existing score file.`
	__Documentation__000468_part_transpose_Inlined_Inlined.Source = ``
	__Documentation__000468_part_transpose_Inlined_Inlined.Lang = ``

	__Documentation__000469_pedal_tuning_Inlined_Inlined.Name = `pedal-tuning_Inlined_Inlined`
	__Documentation__000469_pedal_tuning_Inlined_Inlined.Text = `The pedal-tuning type specifies the tuning of a single harp pedal.`
	__Documentation__000469_pedal_tuning_Inlined_Inlined.Source = ``
	__Documentation__000469_pedal_tuning_Inlined_Inlined.Lang = ``

	__Documentation__000470_pedal_type_Inlined_Inlined.Name = `pedal-type_Inlined_Inlined`
	__Documentation__000470_pedal_type_Inlined_Inlined.Text = `The pedal-type simple type is used to distinguish types of pedal
                directions. The start value indicates the start of a damper pedal, while the
                sostenuto value indicates the start of a sostenuto pedal. The other values can be
                used with either the damper or sostenuto pedal. The soft pedal is not included here
                because there is no special symbol or graphic used for it beyond what can be
                specified with words and bracket elements. The change, continue, discontinue, and
                resume types are used when the line attribute is yes. The change type indicates a
                pedal lift and retake indicated with an inverted V marking. The continue type allows
                more precise formatting across system breaks and for more complex pedaling lines.
                The discontinue type indicates the end of a pedal line that does not include the
                explicit lift represented by the stop type. The resume type indicates the start of a
                pedal line that does not include the downstroke represented by the start type. It
                can be used when a line resumes after being discontinued, or to start a pedal line
                that is preceded by a text or symbol representation of the pedal.`
	__Documentation__000470_pedal_type_Inlined_Inlined.Source = ``
	__Documentation__000470_pedal_type_Inlined_Inlined.Lang = ``

	__Documentation__000471_pedal_Inlined_Inlined.Name = `pedal_Inlined_Inlined`
	__Documentation__000471_pedal_Inlined_Inlined.Text = `The pedal type represents piano pedal marks, including damper and
                sostenuto pedal marks. The line attribute is yes if pedal lines are used. The sign
                attribute is yes if Ped, Sost, and * signs are used. For compatibility with older
                versions, the sign attribute is yes by default if the line attribute is no, and is
                no by default if the line attribute is yes. If the sign attribute is set to yes and
                the type is start or sostenuto, the abbreviated attribute is yes if the short P and
                S signs are used, and no if the full Ped and Sost signs are used. It is no by
                default. Otherwise the abbreviated attribute is ignored. The alignment attributes
                are ignored if the sign attribute is no.`
	__Documentation__000471_pedal_Inlined_Inlined.Source = ``
	__Documentation__000471_pedal_Inlined_Inlined.Lang = ``

	__Documentation__000472_per_minute_Inlined_Inlined.Name = `per-minute_Inlined_Inlined`
	__Documentation__000472_per_minute_Inlined_Inlined.Text = `The per-minute type can be a number, or a text description including
                numbers. If a font is specified, it overrides the font specified for the overall
                metronome element. This allows separate specification of a music font for the
                beat-unit and a text font for the numeric value, in cases where a single metronome
                font is not used.`
	__Documentation__000472_per_minute_Inlined_Inlined.Source = ``
	__Documentation__000472_per_minute_Inlined_Inlined.Lang = ``

	__Documentation__000473_percent_Inlined_Inlined.Name = `percent_Inlined_Inlined`
	__Documentation__000473_percent_Inlined_Inlined.Text = `The percent type specifies a percentage from 0 to 100.`
	__Documentation__000473_percent_Inlined_Inlined.Source = ``
	__Documentation__000473_percent_Inlined_Inlined.Lang = ``

	__Documentation__000474_percussion_Inlined_Inlined.Name = `percussion_Inlined_Inlined`
	__Documentation__000474_percussion_Inlined_Inlined.Text = `The percussion element is used to define percussion pictogram symbols.
                Definitions for these symbols can be found in Kurt Stone's "Music Notation in the
                Twentieth Century" on pages 206-212 and 223. Some values are added to these based on
                how usage has evolved in the 30 years since Stone's book was published.`
	__Documentation__000474_percussion_Inlined_Inlined.Source = ``
	__Documentation__000474_percussion_Inlined_Inlined.Lang = ``

	__Documentation__000475_pitch_Inlined_Inlined.Name = `pitch_Inlined_Inlined`
	__Documentation__000475_pitch_Inlined_Inlined.Text = `Pitch is represented as a combination of the step of the diatonic
                scale, the chromatic alteration, and the octave.`
	__Documentation__000475_pitch_Inlined_Inlined.Source = ``
	__Documentation__000475_pitch_Inlined_Inlined.Lang = ``

	__Documentation__000476_pitched_value_Inlined_Inlined.Name = `pitched-value_Inlined_Inlined`
	__Documentation__000476_pitched_value_Inlined_Inlined.Text = `The pitched-value type represents pictograms for pitched percussion
                instruments. The chimes and tubular chimes values distinguish the single-line and
                double-line versions of the pictogram.`
	__Documentation__000476_pitched_value_Inlined_Inlined.Source = ``
	__Documentation__000476_pitched_value_Inlined_Inlined.Lang = ``

	__Documentation__000477_pitched_Inlined_Inlined.Name = `pitched_Inlined_Inlined`
	__Documentation__000477_pitched_Inlined_Inlined.Text = `The pitched-value type represents pictograms for pitched percussion
                instruments. The smufl attribute is used to distinguish different SMuFL glyphs for a
                particular pictogram within the Tuned mallet percussion pictograms range.`
	__Documentation__000477_pitched_Inlined_Inlined.Source = ``
	__Documentation__000477_pitched_Inlined_Inlined.Lang = ``

	__Documentation__000478_placement_text_Inlined_Inlined.Name = `placement-text_Inlined_Inlined`
	__Documentation__000478_placement_text_Inlined_Inlined.Text = `The placement-text type represents a text element with print-style and
                placement attribute groups.`
	__Documentation__000478_placement_text_Inlined_Inlined.Source = ``
	__Documentation__000478_placement_text_Inlined_Inlined.Lang = ``

	__Documentation__000479_play_Inlined_Inlined.Name = `play_Inlined_Inlined`
	__Documentation__000479_play_Inlined_Inlined.Text = `The play type specifies playback techniques to be used in conjunction
                with the instrument-sound element. When used as part of a sound element, it applies
                to all notes going forward in score order. In multi-instrument parts, the affected
                instrument should be specified using the id attribute. When used as part of a note
                element, it applies to the current note only.`
	__Documentation__000479_play_Inlined_Inlined.Source = ``
	__Documentation__000479_play_Inlined_Inlined.Lang = ``

	__Documentation__000480_player_Inlined_Inlined.Name = `player_Inlined_Inlined`
	__Documentation__000480_player_Inlined_Inlined.Text = `The player type allows for multiple players per score-part for use in
                listening applications. One player may play multiple instruments, while a single
                instrument may include multiple players in divisi sections.`
	__Documentation__000480_player_Inlined_Inlined.Source = ``
	__Documentation__000480_player_Inlined_Inlined.Lang = ``

	__Documentation__000481_positive_decimal_Inlined_Inlined.Name = `positive-decimal_Inlined_Inlined`
	__Documentation__000481_positive_decimal_Inlined_Inlined.Text = `The positive-decimal type specifies a positive decimal value.`
	__Documentation__000481_positive_decimal_Inlined_Inlined.Source = ``
	__Documentation__000481_positive_decimal_Inlined_Inlined.Lang = ``

	__Documentation__000482_positive_divisions_Inlined_Inlined.Name = `positive-divisions_Inlined_Inlined`
	__Documentation__000482_positive_divisions_Inlined_Inlined.Text = `The positive-divisions type restricts divisions values to positive
                numbers.`
	__Documentation__000482_positive_divisions_Inlined_Inlined.Source = ``
	__Documentation__000482_positive_divisions_Inlined_Inlined.Lang = ``

	__Documentation__000483_positive_integer_or_empty_Inlined_Inlined.Name = `positive-integer-or-empty_Inlined_Inlined`
	__Documentation__000483_positive_integer_or_empty_Inlined_Inlined.Text = `The positive-integer-or-empty values can be either a positive integer
                or an empty string.`
	__Documentation__000483_positive_integer_or_empty_Inlined_Inlined.Source = ``
	__Documentation__000483_positive_integer_or_empty_Inlined_Inlined.Lang = ``

	__Documentation__000484_principal_voice_symbol_Inlined_Inlined.Name = `principal-voice-symbol_Inlined_Inlined`
	__Documentation__000484_principal_voice_symbol_Inlined_Inlined.Text = `The principal-voice-symbol type represents the type of symbol used to
                indicate a principal or secondary voice. The "plain" value represents a plain square
                bracket. The value of "none" is used for analysis markup when the principal-voice
                element does not have a corresponding appearance in the score.`
	__Documentation__000484_principal_voice_symbol_Inlined_Inlined.Source = ``
	__Documentation__000484_principal_voice_symbol_Inlined_Inlined.Lang = ``

	__Documentation__000485_principal_voice_Inlined_Inlined.Name = `principal-voice_Inlined_Inlined`
	__Documentation__000485_principal_voice_Inlined_Inlined.Text = `The principal-voice type represents principal and secondary voices in
                a score, either for analysis or for square bracket symbols that appear in a score.
                The element content is used for analysis and may be any text value. The symbol
                attribute indicates the type of symbol used. When used for analysis separate from
                any printed score markings, it should be set to none. Otherwise if the type is stop
                it should be set to plain.`
	__Documentation__000485_principal_voice_Inlined_Inlined.Source = ``
	__Documentation__000485_principal_voice_Inlined_Inlined.Lang = ``

	__Documentation__000486_print_Inlined_Inlined.Name = `print_Inlined_Inlined`
	__Documentation__000486_print_Inlined_Inlined.Text = `The print type contains general printing parameters, including layout
                elements. The part-name-display and part-abbreviation-display elements may also be
                used here to change how a part name or abbreviation is displayed over the course of
                a piece. They take effect when the current measure or a succeeding measure starts a
                new system. Layout group elements in a print element only apply to the current page,
                system, or staff. Music that follows continues to take the default values from the
                layout determined by the defaults element.`
	__Documentation__000486_print_Inlined_Inlined.Source = ``
	__Documentation__000486_print_Inlined_Inlined.Lang = ``

	__Documentation__000487_release_Inlined_Inlined.Name = `release_Inlined_Inlined`
	__Documentation__000487_release_Inlined_Inlined.Text = `The release type indicates that a bend is a release rather than a
                normal bend or pre-bend. The offset attribute specifies where the release starts in
                terms of divisions relative to the current note. The first-beat and last-beat
                attributes of the parent bend element are relative to the original note position,
                not this offset value.`
	__Documentation__000487_release_Inlined_Inlined.Source = ``
	__Documentation__000487_release_Inlined_Inlined.Lang = ``

	__Documentation__000488_repeat_Inlined_Inlined.Name = `repeat_Inlined_Inlined`
	__Documentation__000488_repeat_Inlined_Inlined.Text = `The repeat type represents repeat marks. The start of the repeat has a
                forward direction while the end of the repeat has a backward direction. The times
                and after-jump attributes are only used with backward repeats that are not part of
                an ending. The times attribute indicates the number of times the repeated section is
                played. The after-jump attribute indicates if the repeats are played after a jump
                due to a da capo or dal segno.`
	__Documentation__000488_repeat_Inlined_Inlined.Source = ``
	__Documentation__000488_repeat_Inlined_Inlined.Lang = ``

	__Documentation__000489_rest_Inlined_Inlined.Name = `rest_Inlined_Inlined`
	__Documentation__000489_rest_Inlined_Inlined.Text = `The rest element indicates notated rests or silences. Rest elements
                are usually empty, but placement on the staff can be specified using display-step
                and display-octave elements. If the measure attribute is set to yes, this indicates
                this is a complete measure rest.`
	__Documentation__000489_rest_Inlined_Inlined.Source = ``
	__Documentation__000489_rest_Inlined_Inlined.Lang = ``

	__Documentation__000490_right_left_middle_Inlined_Inlined.Name = `right-left-middle_Inlined_Inlined`
	__Documentation__000490_right_left_middle_Inlined_Inlined.Text = `The right-left-middle type is used to specify barline location.`
	__Documentation__000490_right_left_middle_Inlined_Inlined.Source = ``
	__Documentation__000490_right_left_middle_Inlined_Inlined.Lang = ``

	__Documentation__000491_root_step_Inlined_Inlined.Name = `root-step_Inlined_Inlined`
	__Documentation__000491_root_step_Inlined_Inlined.Text = `The root-step type represents the pitch step of the root of the
                current chord within the harmony element. The text attribute indicates how the root
                should appear in a score if not using the element contents.`
	__Documentation__000491_root_step_Inlined_Inlined.Source = ``
	__Documentation__000491_root_step_Inlined_Inlined.Lang = ``

	__Documentation__000492_root_Inlined_Inlined.Name = `root_Inlined_Inlined`
	__Documentation__000492_root_Inlined_Inlined.Text = `The root type indicates a pitch like C, D, E vs. a scale degree like
                1, 2, 3. It is used with chord symbols in popular music. The root element has a
                root-step and optional root-alter element similar to the step and alter elements,
                but renamed to distinguish the different musical meanings.`
	__Documentation__000492_root_Inlined_Inlined.Source = ``
	__Documentation__000492_root_Inlined_Inlined.Lang = ``

	__Documentation__000493_rotation_degrees_Inlined_Inlined.Name = `rotation-degrees_Inlined_Inlined`
	__Documentation__000493_rotation_degrees_Inlined_Inlined.Text = `The rotation-degrees type specifies rotation, pan, and elevation
                values in degrees. Values range from -180 to 180.`
	__Documentation__000493_rotation_degrees_Inlined_Inlined.Source = ``
	__Documentation__000493_rotation_degrees_Inlined_Inlined.Lang = ``

	__Documentation__000494_scaling_Inlined_Inlined.Name = `scaling_Inlined_Inlined`
	__Documentation__000494_scaling_Inlined_Inlined.Text = `Margins, page sizes, and distances are all measured in tenths to keep
                MusicXML data in a consistent coordinate system as much as possible. The translation
                to absolute units is done with the scaling type, which specifies how many
                millimeters are equal to how many tenths. For a staff height of 7 mm, millimeters
                would be set to 7 while tenths is set to 40. The ability to set a formula rather
                than a single scaling factor helps avoid roundoff errors.`
	__Documentation__000494_scaling_Inlined_Inlined.Source = ``
	__Documentation__000494_scaling_Inlined_Inlined.Lang = ``

	__Documentation__000495_scordatura_Inlined_Inlined.Name = `scordatura_Inlined_Inlined`
	__Documentation__000495_scordatura_Inlined_Inlined.Text = `Scordatura string tunings are represented by a series of accord
                elements, similar to the staff-tuning elements. Strings are numbered from high to
                low.`
	__Documentation__000495_scordatura_Inlined_Inlined.Source = ``
	__Documentation__000495_scordatura_Inlined_Inlined.Lang = ``

	__Documentation__000496_score_header_Inlined_Inlined.Name = `score-header_Inlined_Inlined`
	__Documentation__000496_score_header_Inlined_Inlined.Text = `The score-header group contains basic score metadata about the work
                and movement, score-wide defaults for layout and fonts, credits that appear on the
                first or following pages, and the part list.`
	__Documentation__000496_score_header_Inlined_Inlined.Source = ``
	__Documentation__000496_score_header_Inlined_Inlined.Lang = ``

	__Documentation__000497_score_instrument_Inlined_Inlined.Name = `score-instrument_Inlined_Inlined`
	__Documentation__000497_score_instrument_Inlined_Inlined.Text = `The score-instrument type represents a single instrument within a
                score-part. As with the score-part type, each score-instrument has a required ID
                attribute, a name, and an optional abbreviation. A score-instrument type is also
                required if the score specifies MIDI 1.0 channels, banks, or programs. An initial
                midi-instrument assignment can also be made here. MusicXML software should be able
                to automatically assign reasonable channels and instruments without these elements
                in simple cases, such as where part names match General MIDI instrument names. The
                score-instrument element can also distinguish multiple instruments of the same type
                that are on the same part, such as Clarinet 1 and Clarinet 2 instruments within a
                Clarinets 1 and 2 part.`
	__Documentation__000497_score_instrument_Inlined_Inlined.Source = ``
	__Documentation__000497_score_instrument_Inlined_Inlined.Lang = ``

	__Documentation__000498_score_part_Inlined_Inlined.Name = `score-part_Inlined_Inlined`
	__Documentation__000498_score_part_Inlined_Inlined.Text = `The score-part type collects part-wide information for each part in a
                score. Often, each MusicXML part corresponds to a track in a Standard MIDI Format 1
                file. In this case, the midi-device element is used to make a MIDI device or port
                assignment for the given track or specific MIDI instruments. Initial midi-instrument
                assignments may be made here as well. The score-instrument elements are used when
                there are multiple instruments per track.`
	__Documentation__000498_score_part_Inlined_Inlined.Source = ``
	__Documentation__000498_score_part_Inlined_Inlined.Lang = ``

	__Documentation__000499_score_part_Inlined_Inlined.Name = `score-part_Inlined_Inlined`
	__Documentation__000499_score_part_Inlined_Inlined.Text = `The score-part element is defined within a group due to its multiple
                uses within the part-list element.`
	__Documentation__000499_score_part_Inlined_Inlined.Source = ``
	__Documentation__000499_score_part_Inlined_Inlined.Lang = ``

	__Documentation__000500_segno_Inlined_Inlined.Name = `segno_Inlined_Inlined`
	__Documentation__000500_segno_Inlined_Inlined.Text = `The segno type is the visual indicator of a segno sign. The exact
                glyph can be specified with the smufl attribute. A sound element is also needed to
                guide playback applications reliably.`
	__Documentation__000500_segno_Inlined_Inlined.Source = ``
	__Documentation__000500_segno_Inlined_Inlined.Lang = ``

	__Documentation__000501_semi_pitched_Inlined_Inlined.Name = `semi-pitched_Inlined_Inlined`
	__Documentation__000501_semi_pitched_Inlined_Inlined.Text = `The semi-pitched type represents categories of indefinite pitch for
                percussion instruments.`
	__Documentation__000501_semi_pitched_Inlined_Inlined.Source = ``
	__Documentation__000501_semi_pitched_Inlined_Inlined.Lang = ``

	__Documentation__000502_semitones_Inlined_Inlined.Name = `semitones_Inlined_Inlined`
	__Documentation__000502_semitones_Inlined_Inlined.Text = `The semitones type is a number representing semitones, used for
                chromatic alteration. A value of -1 corresponds to a flat and a value of 1 to a
                sharp. Decimal values like 0.5 (quarter tone sharp) are used for microtones.`
	__Documentation__000502_semitones_Inlined_Inlined.Source = ``
	__Documentation__000502_semitones_Inlined_Inlined.Lang = ``

	__Documentation__000503_show_frets_Inlined_Inlined.Name = `show-frets_Inlined_Inlined`
	__Documentation__000503_show_frets_Inlined_Inlined.Text = `The show-frets type indicates whether to show tablature frets as
                numbers (0, 1, 2) or letters (a, b, c). The default choice is numbers.`
	__Documentation__000503_show_frets_Inlined_Inlined.Source = ``
	__Documentation__000503_show_frets_Inlined_Inlined.Lang = ``

	__Documentation__000504_show_tuplet_Inlined_Inlined.Name = `show-tuplet_Inlined_Inlined`
	__Documentation__000504_show_tuplet_Inlined_Inlined.Text = `The show-tuplet type indicates whether to show a part of a tuplet
                relating to the tuplet-actual element, both the tuplet-actual and tuplet-normal
                elements, or neither.`
	__Documentation__000504_show_tuplet_Inlined_Inlined.Source = ``
	__Documentation__000504_show_tuplet_Inlined_Inlined.Lang = ``

	__Documentation__000505_slash_Inlined_Inlined.Name = `slash_Inlined_Inlined`
	__Documentation__000505_slash_Inlined_Inlined.Text = `The slash type is used to indicate that slash notation is to be used.
                If the slash is on every beat, use-stems is no (the default). To indicate rhythms
                but not pitches, use-stems is set to yes. The type attribute indicates whether this
                is the start or stop of a slash notation style. The use-dots attribute works as for
                the beat-repeat element, and only has effect if use-stems is no.`
	__Documentation__000505_slash_Inlined_Inlined.Source = ``
	__Documentation__000505_slash_Inlined_Inlined.Lang = ``

	__Documentation__000506_slash_Inlined_Inlined.Name = `slash_Inlined_Inlined`
	__Documentation__000506_slash_Inlined_Inlined.Text = `The slash group combines elements used for more complete specification
                of the slash and beat-repeat measure-style elements. They have the same values as
                the type and dot elements, and define what the beat is for the display of repetition
                marks. If not present, the beat is based on the current time signature.`
	__Documentation__000506_slash_Inlined_Inlined.Source = ``
	__Documentation__000506_slash_Inlined_Inlined.Lang = ``

	__Documentation__000507_slide_Inlined_Inlined.Name = `slide_Inlined_Inlined`
	__Documentation__000507_slide_Inlined_Inlined.Text = `Glissando and slide types both indicate rapidly moving from one pitch
                to the other so that individual notes are not discerned. A slide is continuous
                between the two pitches and defaults to a solid line. The optional text for a is
                printed alongside the line.`
	__Documentation__000507_slide_Inlined_Inlined.Source = ``
	__Documentation__000507_slide_Inlined_Inlined.Lang = ``

	__Documentation__000508_slur_Inlined_Inlined.Name = `slur_Inlined_Inlined`
	__Documentation__000508_slur_Inlined_Inlined.Text = `Slur types are empty. Most slurs are represented with two elements:
                one with a start type, and one with a stop type. Slurs can add more elements using a
                continue type. This is typically used to specify the formatting of cross-system
                slurs, or to specify the shape of very complex slurs.`
	__Documentation__000508_slur_Inlined_Inlined.Source = ``
	__Documentation__000508_slur_Inlined_Inlined.Lang = ``

	__Documentation__000509_smufl_accidental_glyph_name_Inlined_Inlined.Name = `smufl-accidental-glyph-name_Inlined_Inlined`
	__Documentation__000509_smufl_accidental_glyph_name_Inlined_Inlined.Text = `The smufl-accidental-glyph-name type is used to reference a specific
                Standard Music Font Layout (SMuFL) accidental character. The value is a SMuFL
                canonical glyph name that starts with one of the strings used at the start of glyph
                names for SMuFL accidentals.`
	__Documentation__000509_smufl_accidental_glyph_name_Inlined_Inlined.Source = ``
	__Documentation__000509_smufl_accidental_glyph_name_Inlined_Inlined.Lang = ``

	__Documentation__000510_smufl_coda_glyph_name_Inlined_Inlined.Name = `smufl-coda-glyph-name_Inlined_Inlined`
	__Documentation__000510_smufl_coda_glyph_name_Inlined_Inlined.Text = `The smufl-coda-glyph-name type is used to reference a specific
                Standard Music Font Layout (SMuFL) coda character. The value is a SMuFL canonical
                glyph name that starts with coda.`
	__Documentation__000510_smufl_coda_glyph_name_Inlined_Inlined.Source = ``
	__Documentation__000510_smufl_coda_glyph_name_Inlined_Inlined.Lang = ``

	__Documentation__000511_smufl_glyph_name_Inlined_Inlined.Name = `smufl-glyph-name_Inlined_Inlined`
	__Documentation__000511_smufl_glyph_name_Inlined_Inlined.Text = `The smufl-glyph-name type is used for attributes that reference a
                specific Standard Music Font Layout (SMuFL) character. The value is a SMuFL
                canonical glyph name, not a code point. For instance, the value for a standard piano
                pedal mark would be keyboardPedalPed, not U+E650.`
	__Documentation__000511_smufl_glyph_name_Inlined_Inlined.Source = ``
	__Documentation__000511_smufl_glyph_name_Inlined_Inlined.Lang = ``

	__Documentation__000512_smufl_lyrics_glyph_name_Inlined_Inlined.Name = `smufl-lyrics-glyph-name_Inlined_Inlined`
	__Documentation__000512_smufl_lyrics_glyph_name_Inlined_Inlined.Text = `The smufl-lyrics-glyph-name type is used to reference a specific
                Standard Music Font Layout (SMuFL) lyrics elision character. The value is a SMuFL
                canonical glyph name that starts with lyrics.`
	__Documentation__000512_smufl_lyrics_glyph_name_Inlined_Inlined.Source = ``
	__Documentation__000512_smufl_lyrics_glyph_name_Inlined_Inlined.Lang = ``

	__Documentation__000513_smufl_pictogram_glyph_name_Inlined_Inlined.Name = `smufl-pictogram-glyph-name_Inlined_Inlined`
	__Documentation__000513_smufl_pictogram_glyph_name_Inlined_Inlined.Text = `The smufl-pictogram-glyph-name type is used to reference a specific
                Standard Music Font Layout (SMuFL) percussion pictogram character. The value is a
                SMuFL canonical glyph name that starts with pict.`
	__Documentation__000513_smufl_pictogram_glyph_name_Inlined_Inlined.Source = ``
	__Documentation__000513_smufl_pictogram_glyph_name_Inlined_Inlined.Lang = ``

	__Documentation__000514_smufl_segno_glyph_name_Inlined_Inlined.Name = `smufl-segno-glyph-name_Inlined_Inlined`
	__Documentation__000514_smufl_segno_glyph_name_Inlined_Inlined.Text = `The smufl-segno-glyph-name type is used to reference a specific
                Standard Music Font Layout (SMuFL) segno character. The value is a SMuFL canonical
                glyph name that starts with segno.`
	__Documentation__000514_smufl_segno_glyph_name_Inlined_Inlined.Source = ``
	__Documentation__000514_smufl_segno_glyph_name_Inlined_Inlined.Lang = ``

	__Documentation__000515_smufl_wavy_line_glyph_name_Inlined_Inlined.Name = `smufl-wavy-line-glyph-name_Inlined_Inlined`
	__Documentation__000515_smufl_wavy_line_glyph_name_Inlined_Inlined.Text = `The smufl-wavy-line-glyph-name type is used to reference a specific
                Standard Music Font Layout (SMuFL) wavy line character. The value is a SMuFL
                canonical glyph name that either starts with wiggle, or begins with guitar and ends
                with VibratoStroke. This includes all the glyphs in the Multi-segment lines range,
                excluding the beam glyphs.`
	__Documentation__000515_smufl_wavy_line_glyph_name_Inlined_Inlined.Source = ``
	__Documentation__000515_smufl_wavy_line_glyph_name_Inlined_Inlined.Lang = ``

	__Documentation__000516_sound_Inlined_Inlined.Name = `sound_Inlined_Inlined`
	__Documentation__000516_sound_Inlined_Inlined.Text = `The sound element contains general playback parameters. They can stand
                alone within a part/measure, or be a component element within a direction. Tempo is
                expressed in quarter notes per minute. If 0, the sound-generating program should
                prompt the user at the time of compiling a sound (MIDI) file. Dynamics (or MIDI
                velocity) are expressed as a percentage of the default forte value (90 for MIDI
                1.0). Dacapo indicates to go back to the beginning of the movement. When used it
                always has the value "yes". Segno and dalsegno are used for backwards jumps to a
                segno sign; coda and tocoda are used for forward jumps to a coda sign. If there are
                multiple jumps, the value of these parameters can be used to name and distinguish
                them. If segno or coda is used, the divisions attribute can also be used to indicate
                the number of divisions per quarter note. Otherwise sound and MIDI generating
                programs may have to recompute this. By default, a dalsegno or dacapo attribute
                indicates that the jump should occur the first time through, while a tocoda
                attribute indicates the jump should occur the second time through. The time that
                jumps occur can be changed by using the time-only attribute. The forward-repeat
                attribute indicates that a forward repeat sign is implied but not displayed. It is
                used for example in two-part forms with repeats, such as a minuet and trio where no
                repeat is displayed at the start of the trio. This usually occurs after a barline.
                When used it always has the value of "yes". The fine attribute follows the final
                note or rest in a movement with a da capo or dal segno direction. If numeric, the
                value represents the actual duration of the final note or rest, which can be
                ambiguous in written notation and different among parts and voices. The value may
                also be "yes" to indicate no change to the final duration. If the sound element
                applies only particular times through a repeat, the time-only attribute indicates
                which times to apply the sound element. Pizzicato in a sound element effects all
                following notes. Yes indicates pizzicato, no indicates arco. The pan and elevation
                attributes are deprecated in Version 2.0. The pan and elevation elements in the
                midi-instrument element should be used instead. The meaning of the pan and elevation
                attributes is the same as for the pan and elevation elements. If both are present,
                the mid-instrument elements take priority. The damper-pedal, soft-pedal, and
                sostenuto-pedal attributes effect playback of the three common piano pedals and
                their MIDI controller equivalents. The yes value indicates the pedal is depressed;
                no indicates the pedal is released. A numeric value from 0 to 100 may also be used
                for half pedaling. This value is the percentage that the pedal is depressed. A value
                of 0 is equivalent to no, and a value of 100 is equivalent to yes. Instrument
                changes, MIDI devices, MIDI instruments, and playback techniques are changed using
                the instrument-change, midi-device, midi-instrument, and play elements. When there
                are multiple instances of these elements, they should be grouped together by
                instrument using the id attribute values. The offset element is used to indicate
                that the sound takes place offset from the current score position. If the sound
                element is a child of a direction element, the sound offset element overrides the
                direction offset element if both elements are present. Note that the offset reflects
                the intended musical position for the change in sound. It should not be used to
                compensate for latency issues in particular hardware configurations.`
	__Documentation__000516_sound_Inlined_Inlined.Source = ``
	__Documentation__000516_sound_Inlined_Inlined.Lang = ``

	__Documentation__000517_staff_details_Inlined_Inlined.Name = `staff-details_Inlined_Inlined`
	__Documentation__000517_staff_details_Inlined_Inlined.Text = `The staff-details element is used to indicate different types of
                staves. The optional number attribute specifies the staff number from top to bottom
                on the system, as with clef. The print-object attribute is used to indicate when a
                staff is not printed in a part, usually in large scores where empty parts are
                omitted. It is yes by default. If print-spacing is yes while print-object is no, the
                score is printed in cutaway format where vertical space is left for the empty part.`
	__Documentation__000517_staff_details_Inlined_Inlined.Source = ``
	__Documentation__000517_staff_details_Inlined_Inlined.Lang = ``

	__Documentation__000518_staff_divide_symbol_Inlined_Inlined.Name = `staff-divide-symbol_Inlined_Inlined`
	__Documentation__000518_staff_divide_symbol_Inlined_Inlined.Text = `The staff-divide-symbol type is used for staff division symbols. The
                down, up, and up-down values correspond to SMuFL code points U+E00B, U+E00C, and
                U+E00D respectively.`
	__Documentation__000518_staff_divide_symbol_Inlined_Inlined.Source = ``
	__Documentation__000518_staff_divide_symbol_Inlined_Inlined.Lang = ``

	__Documentation__000519_staff_divide_Inlined_Inlined.Name = `staff-divide_Inlined_Inlined`
	__Documentation__000519_staff_divide_Inlined_Inlined.Text = `The staff-divide element represents the staff division arrow symbols
                found at SMuFL code points U+E00B, U+E00C, and U+E00D.`
	__Documentation__000519_staff_divide_Inlined_Inlined.Source = ``
	__Documentation__000519_staff_divide_Inlined_Inlined.Lang = ``

	__Documentation__000520_staff_layout_Inlined_Inlined.Name = `staff-layout_Inlined_Inlined`
	__Documentation__000520_staff_layout_Inlined_Inlined.Text = `Staff layout includes the vertical distance from the bottom line of
                the previous staff in this system to the top line of the staff specified by the
                number attribute. The optional number attribute refers to staff numbers within the
                part, from top to bottom on the system. A value of 1 is used if not present. When
                used in the defaults element, the values apply to all systems in all parts. When
                used in the print element, the values apply to the current system only. This value
                is ignored for the first staff in a system.`
	__Documentation__000520_staff_layout_Inlined_Inlined.Source = ``
	__Documentation__000520_staff_layout_Inlined_Inlined.Lang = ``

	__Documentation__000521_staff_line_position_Inlined_Inlined.Name = `staff-line-position_Inlined_Inlined`
	__Documentation__000521_staff_line_position_Inlined_Inlined.Text = `The staff-line-position type indicates the line position on a given
                staff. Staff lines are numbered from bottom to top, with 1 being the bottom line on
                a staff. A staff-line-position value can extend beyond the range of the lines on the
                current staff.`
	__Documentation__000521_staff_line_position_Inlined_Inlined.Source = ``
	__Documentation__000521_staff_line_position_Inlined_Inlined.Lang = ``

	__Documentation__000522_staff_line_Inlined_Inlined.Name = `staff-line_Inlined_Inlined`
	__Documentation__000522_staff_line_Inlined_Inlined.Text = `The staff-line type indicates the line on a given staff. Staff lines
                are numbered from bottom to top, with 1 being the bottom line on a staff.`
	__Documentation__000522_staff_line_Inlined_Inlined.Source = ``
	__Documentation__000522_staff_line_Inlined_Inlined.Lang = ``

	__Documentation__000523_staff_number_Inlined_Inlined.Name = `staff-number_Inlined_Inlined`
	__Documentation__000523_staff_number_Inlined_Inlined.Text = `The staff-number type indicates staff numbers within a multi-staff
                part. Staves are numbered from top to bottom, with 1 being the top staff on a part.`
	__Documentation__000523_staff_number_Inlined_Inlined.Source = ``
	__Documentation__000523_staff_number_Inlined_Inlined.Lang = ``

	__Documentation__000524_staff_size_Inlined_Inlined.Name = `staff-size_Inlined_Inlined`
	__Documentation__000524_staff_size_Inlined_Inlined.Text = `The staff-size element indicates how large a staff space is on this
                staff, expressed as a percentage of the work's default scaling. Values less than 100
                make the staff space smaller while values over 100 make the staff space larger. A
                staff-type of cue, ossia, or editorial implies a staff-size of less than 100, but
                the exact value is implementation-dependent unless specified here. Staff size
                affects staff height only, not the relationship of the staff to the left and right
                margins. In some cases, a staff-size different than 100 also scales the notation on
                the staff, such as with a cue staff. In other cases, such as percussion staves, the
                lines may be more widely spaced without scaling the notation on the staff. The
                scaling attribute allows these two cases to be distinguished. It specifies the
                percentage scaling that applies to the notation. Values less that 100 make the
                notation smaller while values over 100 make the notation larger. The staff-size
                content and scaling attribute are both non-negative decimal values.`
	__Documentation__000524_staff_size_Inlined_Inlined.Source = ``
	__Documentation__000524_staff_size_Inlined_Inlined.Lang = ``

	__Documentation__000525_staff_tuning_Inlined_Inlined.Name = `staff-tuning_Inlined_Inlined`
	__Documentation__000525_staff_tuning_Inlined_Inlined.Text = `The staff-tuning type specifies the open, non-capo tuning of the lines
                on a tablature staff.`
	__Documentation__000525_staff_tuning_Inlined_Inlined.Source = ``
	__Documentation__000525_staff_tuning_Inlined_Inlined.Lang = ``

	__Documentation__000526_staff_type_Inlined_Inlined.Name = `staff-type_Inlined_Inlined`
	__Documentation__000526_staff_type_Inlined_Inlined.Text = `The staff-type value can be ossia, editorial, cue, alternate, or
                regular. An ossia staff represents music that can be played instead of what appears
                on the regular staff. An editorial staff also represents musical alternatives, but
                is created by an editor rather than the composer. It can be used for suggested
                interpretations or alternatives from other sources. A cue staff represents music
                from another part. An alternate staff shares the same music as the prior staff, but
                displayed differently (e.g., treble and bass clef, standard notation and tablature).
                It is not included in playback. An alternate staff provides more information to an
                application reading a file than encoding the same music in separate parts, so its
                use is preferred in this situation if feasible. A regular staff is the standard
                default staff-type.`
	__Documentation__000526_staff_type_Inlined_Inlined.Source = ``
	__Documentation__000526_staff_type_Inlined_Inlined.Lang = ``

	__Documentation__000527_staff_Inlined_Inlined.Name = `staff_Inlined_Inlined`
	__Documentation__000527_staff_Inlined_Inlined.Text = `The staff element is defined within a group due to its use by both
                notes and direction elements.`
	__Documentation__000527_staff_Inlined_Inlined.Source = ``
	__Documentation__000527_staff_Inlined_Inlined.Lang = ``

	__Documentation__000528_start_note_Inlined_Inlined.Name = `start-note_Inlined_Inlined`
	__Documentation__000528_start_note_Inlined_Inlined.Text = `The start-note type describes the starting note of trills and mordents
                for playback, relative to the current note.`
	__Documentation__000528_start_note_Inlined_Inlined.Source = ``
	__Documentation__000528_start_note_Inlined_Inlined.Lang = ``

	__Documentation__000529_start_stop_change_continue_Inlined_Inlined.Name = `start-stop-change-continue_Inlined_Inlined`
	__Documentation__000529_start_stop_change_continue_Inlined_Inlined.Text = `The start-stop-change-continue type is used to distinguish types of
                pedal directions.`
	__Documentation__000529_start_stop_change_continue_Inlined_Inlined.Source = ``
	__Documentation__000529_start_stop_change_continue_Inlined_Inlined.Lang = ``

	__Documentation__000530_start_stop_continue_Inlined_Inlined.Name = `start-stop-continue_Inlined_Inlined`
	__Documentation__000530_start_stop_continue_Inlined_Inlined.Text = `The start-stop-continue type is used for an attribute of musical
                elements that can either start or stop, but also need to refer to an intermediate
                point in the symbol, as for complex slurs or for formatting of symbols across system
                breaks. The values of start, stop, and continue refer to how an element appears in
                musical score order, not in MusicXML document order. An element with a stop
                attribute may precede the corresponding element with a start attribute within a
                MusicXML document. This is particularly common in multi-staff music. For example,
                the stopping point for a slur may appear in staff 1 before the starting point for
                the slur appears in staff 2 later in the document. When multiple elements with the
                same tag are used within the same note, their order within the MusicXML document
                should match the musical score order. For example, a note that marks both the end of
                one slur and the start of a new slur should have the incoming slur element with a
                type of stop precede the outgoing slur element with a type of start.`
	__Documentation__000530_start_stop_continue_Inlined_Inlined.Source = ``
	__Documentation__000530_start_stop_continue_Inlined_Inlined.Lang = ``

	__Documentation__000531_start_stop_discontinue_Inlined_Inlined.Name = `start-stop-discontinue_Inlined_Inlined`
	__Documentation__000531_start_stop_discontinue_Inlined_Inlined.Text = `The start-stop-discontinue type is used to specify ending types.
                Typically, the start type is associated with the left barline of the first measure
                in an ending. The stop and discontinue types are associated with the right barline
                of the last measure in an ending. Stop is used when the ending mark concludes with a
                downward jog, as is typical for first endings. Discontinue is used when there is no
                downward jog, as is typical for second endings that do not conclude a piece.`
	__Documentation__000531_start_stop_discontinue_Inlined_Inlined.Source = ``
	__Documentation__000531_start_stop_discontinue_Inlined_Inlined.Lang = ``

	__Documentation__000532_start_stop_single_Inlined_Inlined.Name = `start-stop-single_Inlined_Inlined`
	__Documentation__000532_start_stop_single_Inlined_Inlined.Text = `The start-stop-single type is used for an attribute of musical
                elements that can be used for either multi-note or single-note musical elements, as
                for groupings. When multiple elements with the same tag are used within the same
                note, their order within the MusicXML document should match the musical score order.`
	__Documentation__000532_start_stop_single_Inlined_Inlined.Source = ``
	__Documentation__000532_start_stop_single_Inlined_Inlined.Lang = ``

	__Documentation__000533_start_stop_Inlined_Inlined.Name = `start-stop_Inlined_Inlined`
	__Documentation__000533_start_stop_Inlined_Inlined.Text = `The start-stop type is used for an attribute of musical elements that
                can either start or stop, such as tuplets. The values of start and stop refer to how
                an element appears in musical score order, not in MusicXML document order. An
                element with a stop attribute may precede the corresponding element with a start
                attribute within a MusicXML document. This is particularly common in multi-staff
                music. For example, the stopping point for a tuplet may appear in staff 1 before the
                starting point for the tuplet appears in staff 2 later in the document. When
                multiple elements with the same tag are used within the same note, their order
                within the MusicXML document should match the musical score order.`
	__Documentation__000533_start_stop_Inlined_Inlined.Source = ``
	__Documentation__000533_start_stop_Inlined_Inlined.Lang = ``

	__Documentation__000534_stem_value_Inlined_Inlined.Name = `stem-value_Inlined_Inlined`
	__Documentation__000534_stem_value_Inlined_Inlined.Text = `The stem-value type represents the notated stem direction.`
	__Documentation__000534_stem_value_Inlined_Inlined.Source = ``
	__Documentation__000534_stem_value_Inlined_Inlined.Lang = ``

	__Documentation__000535_stem_Inlined_Inlined.Name = `stem_Inlined_Inlined`
	__Documentation__000535_stem_Inlined_Inlined.Text = `Stems can be down, up, none, or double. For down and up stems, the
                position attributes can be used to specify stem length. The relative values specify
                the end of the stem relative to the program default. Default values specify an
                absolute end stem position. Negative values of relative-y that would flip a stem
                instead of shortening it are ignored. A stem element associated with a rest refers
                to a stemlet.`
	__Documentation__000535_stem_Inlined_Inlined.Source = ``
	__Documentation__000535_stem_Inlined_Inlined.Lang = ``

	__Documentation__000536_step_Inlined_Inlined.Name = `step_Inlined_Inlined`
	__Documentation__000536_step_Inlined_Inlined.Text = `The step type represents a step of the diatonic scale, represented
                using the English letters A through G.`
	__Documentation__000536_step_Inlined_Inlined.Source = ``
	__Documentation__000536_step_Inlined_Inlined.Lang = ``

	__Documentation__000537_stick_location_Inlined_Inlined.Name = `stick-location_Inlined_Inlined`
	__Documentation__000537_stick_location_Inlined_Inlined.Text = `The stick-location type represents pictograms for the location of
                sticks, beaters, or mallets on cymbals, gongs, drums, and other instruments.`
	__Documentation__000537_stick_location_Inlined_Inlined.Source = ``
	__Documentation__000537_stick_location_Inlined_Inlined.Lang = ``

	__Documentation__000538_stick_material_Inlined_Inlined.Name = `stick-material_Inlined_Inlined`
	__Documentation__000538_stick_material_Inlined_Inlined.Text = `The stick-material type represents the material being displayed in a
                stick pictogram.`
	__Documentation__000538_stick_material_Inlined_Inlined.Source = ``
	__Documentation__000538_stick_material_Inlined_Inlined.Lang = ``

	__Documentation__000539_stick_type_Inlined_Inlined.Name = `stick-type_Inlined_Inlined`
	__Documentation__000539_stick_type_Inlined_Inlined.Text = `The stick-type type represents the shape of pictograms where the
                material in the stick, mallet, or beater is represented in the pictogram.`
	__Documentation__000539_stick_type_Inlined_Inlined.Source = ``
	__Documentation__000539_stick_type_Inlined_Inlined.Lang = ``

	__Documentation__000540_stick_Inlined_Inlined.Name = `stick_Inlined_Inlined`
	__Documentation__000540_stick_Inlined_Inlined.Text = `The stick type represents pictograms where the material of the stick,
                mallet, or beater is included.The parentheses and dashed-circle attributes indicate
                the presence of these marks around the round beater part of a pictogram. Values for
                these attributes are "no" if not present.`
	__Documentation__000540_stick_Inlined_Inlined.Source = ``
	__Documentation__000540_stick_Inlined_Inlined.Lang = ``

	__Documentation__000541_string_mute_Inlined_Inlined.Name = `string-mute_Inlined_Inlined`
	__Documentation__000541_string_mute_Inlined_Inlined.Text = `The string-mute type represents string mute on and mute off symbols.`
	__Documentation__000541_string_mute_Inlined_Inlined.Source = ``
	__Documentation__000541_string_mute_Inlined_Inlined.Lang = ``

	__Documentation__000542_string_number_Inlined_Inlined.Name = `string-number_Inlined_Inlined`
	__Documentation__000542_string_number_Inlined_Inlined.Text = `The string-number type indicates a string number. Strings are numbered
                from high to low, with 1 being the highest pitched full-length string.`
	__Documentation__000542_string_number_Inlined_Inlined.Source = ``
	__Documentation__000542_string_number_Inlined_Inlined.Lang = ``

	__Documentation__000543_string_type_Inlined_Inlined.Name = `string-type_Inlined_Inlined`
	__Documentation__000543_string_type_Inlined_Inlined.Text = `The string type is used with tablature notation, regular notation
                (where it is often circled), and chord diagrams. String numbers start with 1 for the
                highest pitched full-length string.`
	__Documentation__000543_string_type_Inlined_Inlined.Source = ``
	__Documentation__000543_string_type_Inlined_Inlined.Lang = ``

	__Documentation__000544_strong_accent_Inlined_Inlined.Name = `strong-accent_Inlined_Inlined`
	__Documentation__000544_strong_accent_Inlined_Inlined.Text = `The strong-accent type indicates a vertical accent mark. The type
                attribute indicates if the point of the accent is down or up.`
	__Documentation__000544_strong_accent_Inlined_Inlined.Source = ``
	__Documentation__000544_strong_accent_Inlined_Inlined.Lang = ``

	__Documentation__000545_style_text_Inlined_Inlined.Name = `style-text_Inlined_Inlined`
	__Documentation__000545_style_text_Inlined_Inlined.Text = `The style-text type represents a text element with a print-style
                attribute group.`
	__Documentation__000545_style_text_Inlined_Inlined.Source = ``
	__Documentation__000545_style_text_Inlined_Inlined.Lang = ``

	__Documentation__000546_supports_Inlined_Inlined.Name = `supports_Inlined_Inlined`
	__Documentation__000546_supports_Inlined_Inlined.Text = `The supports type indicates if a MusicXML encoding supports a
                particular MusicXML element. This is recommended for elements like beam, stem, and
                accidental, where the absence of an element is ambiguous if you do not know if the
                encoding supports that element. For Version 2.0, the supports element is expanded to
                allow programs to indicate support for particular attributes or particular values.
                This lets applications communicate, for example, that all system and/or page breaks
                are contained in the MusicXML file.`
	__Documentation__000546_supports_Inlined_Inlined.Source = ``
	__Documentation__000546_supports_Inlined_Inlined.Lang = ``

	__Documentation__000547_swing_type_value_Inlined_Inlined.Name = `swing-type-value_Inlined_Inlined`
	__Documentation__000547_swing_type_value_Inlined_Inlined.Text = `The swing-type-value type specifies the note type, either eighth or
                16th, to which the ratio defined in the swing element is applied.`
	__Documentation__000547_swing_type_value_Inlined_Inlined.Source = ``
	__Documentation__000547_swing_type_value_Inlined_Inlined.Lang = ``

	__Documentation__000548_swing_Inlined_Inlined.Name = `swing_Inlined_Inlined`
	__Documentation__000548_swing_Inlined_Inlined.Text = `The swing element specifies whether or not to use swing playback,
                where consecutive on-beat / off-beat eighth or 16th notes are played with unequal
                nominal durations. The straight element specifies that no swing is present, so
                consecutive notes have equal durations. The first and second elements are positive
                integers that specify the ratio between durations of consecutive notes. For example,
                a first element with a value of 2 and a second element with a value of 1 applied to
                eighth notes specifies a quarter note / eighth note tuplet playback, where the first
                note is twice as long as the second note. Ratios should be specified with the
                smallest integers possible. For example, a ratio of 6 to 4 should be specified as 3
                to 2 instead. The optional swing-type element specifies the note type, either eighth
                or 16th, to which the ratio is applied. The value is eighth if this element is not
                present. The optional swing-style element is a string describing the style of swing
                used. The swing element has no effect for playback of grace notes, notes where a
                type element is not present, and notes where the specified duration is different
                than the nominal value associated with the specified type. If a swung note has
                attack and release attributes, those values modify the swung playback.`
	__Documentation__000548_swing_Inlined_Inlined.Source = ``
	__Documentation__000548_swing_Inlined_Inlined.Lang = ``

	__Documentation__000549_syllabic_Inlined_Inlined.Name = `syllabic_Inlined_Inlined`
	__Documentation__000549_syllabic_Inlined_Inlined.Text = `Lyric hyphenation is indicated by the syllabic type. The single,
                begin, end, and middle values represent single-syllable words, word-beginning
                syllables, word-ending syllables, and mid-word syllables, respectively.`
	__Documentation__000549_syllabic_Inlined_Inlined.Source = ``
	__Documentation__000549_syllabic_Inlined_Inlined.Lang = ``

	__Documentation__000550_symbol_size_Inlined_Inlined.Name = `symbol-size_Inlined_Inlined`
	__Documentation__000550_symbol_size_Inlined_Inlined.Text = `The symbol-size type is used to distinguish between full, cue sized,
                grace cue sized, and oversized symbols.`
	__Documentation__000550_symbol_size_Inlined_Inlined.Source = ``
	__Documentation__000550_symbol_size_Inlined_Inlined.Lang = ``

	__Documentation__000551_sync_type_Inlined_Inlined.Name = `sync-type_Inlined_Inlined`
	__Documentation__000551_sync_type_Inlined_Inlined.Text = `The sync-type type specifies the style that a score following
                application should use to synchronize an accompaniment with a performer. The none
                type indicates no synchronization to the performer. The tempo type indicates
                synchronization based on the performer tempo rather than individual events in the
                score. The event type indicates synchronization by following the performance of
                individual events in the score rather than the performer tempo. The mostly-tempo and
                mostly-event types combine these two approaches, with mostly-tempo giving more
                weight to tempo and mostly-event giving more weight to performed events. The
                always-event type provides the strictest synchronization by not being forgiving of
                missing performed events.`
	__Documentation__000551_sync_type_Inlined_Inlined.Source = ``
	__Documentation__000551_sync_type_Inlined_Inlined.Lang = ``

	__Documentation__000552_sync_Inlined_Inlined.Name = `sync_Inlined_Inlined`
	__Documentation__000552_sync_Inlined_Inlined.Text = `The sync type specifies the style that a score following application
                should use the synchronize an accompaniment with a performer. If this type is not
                included in a score, default synchronization depends on the application. The
                optional latency attribute specifies a time in milliseconds that the listening
                application should expect from the performer. The optional player and time-only
                attributes restrict the element to apply to a single player or set of times through
                a repeated section, respectively.`
	__Documentation__000552_sync_Inlined_Inlined.Source = ``
	__Documentation__000552_sync_Inlined_Inlined.Lang = ``

	__Documentation__000553_system_dividers_Inlined_Inlined.Name = `system-dividers_Inlined_Inlined`
	__Documentation__000553_system_dividers_Inlined_Inlined.Text = `The system-dividers element indicates the presence or absence of
                system dividers (also known as system separation marks) between systems displayed on
                the same page. Dividers on the left and right side of the page are controlled by the
                left-divider and right-divider elements respectively. The default vertical position
                is half the system-distance value from the top of the system that is below the
                divider. The default horizontal position is the left and right system margin,
                respectively. When used in the print element, the system-dividers element affects
                the dividers that would appear between the current system and the previous system.`
	__Documentation__000553_system_dividers_Inlined_Inlined.Source = ``
	__Documentation__000553_system_dividers_Inlined_Inlined.Lang = ``

	__Documentation__000554_system_layout_Inlined_Inlined.Name = `system-layout_Inlined_Inlined`
	__Documentation__000554_system_layout_Inlined_Inlined.Text = `A system is a group of staves that are read and played simultaneously.
                System layout includes left and right margins and the vertical distance from the
                previous system. The system distance is measured from the bottom line of the
                previous system to the top line of the current system. It is ignored for the first
                system on a page. The top system distance is measured from the page's top margin to
                the top line of the first system. It is ignored for all but the first system on a
                page. Sometimes the sum of measure widths in a system may not equal the system width
                specified by the layout elements due to roundoff or other errors. The behavior when
                reading MusicXML files in these cases is application-dependent. For instance,
                applications may find that the system layout data is more reliable than the sum of
                the measure widths, and adjust the measure widths accordingly. When used in the
                defaults element, the system-layout element defines a default appearance for all
                systems in the score. If no system-layout element is present in the defaults
                element, default system layout values are chosen by the application. When used in
                the print element, the system-layout element affects the appearance of the current
                system only. All other systems use the default values as determined by the defaults
                element. If any child elements are missing from the system-layout element in a print
                element, the values determined by the defaults element are used there as well. This
                type of system-layout element need only be read from or written to the first visible
                part in the score.`
	__Documentation__000554_system_layout_Inlined_Inlined.Source = ``
	__Documentation__000554_system_layout_Inlined_Inlined.Lang = ``

	__Documentation__000555_system_margins_Inlined_Inlined.Name = `system-margins_Inlined_Inlined`
	__Documentation__000555_system_margins_Inlined_Inlined.Text = `System margins are relative to the page margins. Positive values
                indent and negative values reduce the margin size.`
	__Documentation__000555_system_margins_Inlined_Inlined.Source = ``
	__Documentation__000555_system_margins_Inlined_Inlined.Lang = ``

	__Documentation__000556_system_relation_number_Inlined_Inlined.Name = `system-relation-number_Inlined_Inlined`
	__Documentation__000556_system_relation_number_Inlined_Inlined.Text = `The system-relation-number type distinguishes measure numbers that are
                associated with a system rather than the particular part where the element appears.
                A value of only-top or only-bottom indicates that the number should appear only on
                the top or bottom part of the current system, respectively. A value of also-top or
                also-bottom indicates that the number should appear on both the current part and the
                top or bottom part of the current system, respectively. If these values appear in a
                score, when parts are created the number should only appear once in this part, not
                twice. A value of none indicates that the number is associated only with the current
                part, not with the system.`
	__Documentation__000556_system_relation_number_Inlined_Inlined.Source = ``
	__Documentation__000556_system_relation_number_Inlined_Inlined.Lang = ``

	__Documentation__000557_system_relation_Inlined_Inlined.Name = `system-relation_Inlined_Inlined`
	__Documentation__000557_system_relation_Inlined_Inlined.Text = `The system-relation type distinguishes elements that are associated
                with a system rather than the particular part where the element appears. A value of
                only-top indicates that the element should appear only on the top part of the
                current system. A value of also-top indicates that the element should appear on both
                the current part and the top part of the current system. If this value appears in a
                score, when parts are created the element should only appear once in this part, not
                twice. A value of none indicates that the element is associated only with the
                current part, not with the system.`
	__Documentation__000557_system_relation_Inlined_Inlined.Source = ``
	__Documentation__000557_system_relation_Inlined_Inlined.Lang = ``

	__Documentation__000558_tap_hand_Inlined_Inlined.Name = `tap-hand_Inlined_Inlined`
	__Documentation__000558_tap_hand_Inlined_Inlined.Text = `The tap-hand type represents the symbol to use for a tap element. The
                left and right values refer to the SMuFL guitarLeftHandTapping and
                guitarRightHandTapping glyphs respectively.`
	__Documentation__000558_tap_hand_Inlined_Inlined.Source = ``
	__Documentation__000558_tap_hand_Inlined_Inlined.Lang = ``

	__Documentation__000559_tap_Inlined_Inlined.Name = `tap_Inlined_Inlined`
	__Documentation__000559_tap_Inlined_Inlined.Text = `The tap type indicates a tap on the fretboard. The text content allows
                specification of the notation; + and T are common choices. If the element is empty,
                the hand attribute is used to specify the symbol to use. The hand attribute is
                ignored if the tap glyph is already specified by the text content. If neither text
                content nor the hand attribute are present, the display is application-specific.`
	__Documentation__000559_tap_Inlined_Inlined.Source = ``
	__Documentation__000559_tap_Inlined_Inlined.Lang = ``

	__Documentation__000560_technical_Inlined_Inlined.Name = `technical_Inlined_Inlined`
	__Documentation__000560_technical_Inlined_Inlined.Text = `Technical indications give performance information for individual
                instruments.`
	__Documentation__000560_technical_Inlined_Inlined.Source = ``
	__Documentation__000560_technical_Inlined_Inlined.Lang = ``

	__Documentation__000561_tenths_Inlined_Inlined.Name = `tenths_Inlined_Inlined`
	__Documentation__000561_tenths_Inlined_Inlined.Text = `The tenths type is a number representing tenths of interline staff
                space (positive or negative). Both integer and decimal values are allowed, such as 5
                for a half space and 2.5 for a quarter space. Interline space is measured from the
                middle of a staff line. Distances in a MusicXML file are measured in tenths of staff
                space. Tenths are then scaled to millimeters within the scaling element, used in the
                defaults element at the start of a score. Individual staves can apply a scaling
                factor to adjust staff size. When a MusicXML element or attribute refers to tenths,
                it means the global tenths defined by the scaling element, not the local tenths as
                adjusted by the staff-size element.`
	__Documentation__000561_tenths_Inlined_Inlined.Source = ``
	__Documentation__000561_tenths_Inlined_Inlined.Lang = ``

	__Documentation__000562_text_direction_Inlined_Inlined.Name = `text-direction_Inlined_Inlined`
	__Documentation__000562_text_direction_Inlined_Inlined.Text = `The text-direction type is used to adjust and override the Unicode
                bidirectional text algorithm, similar to the Directionality data category in the W3C
                Internationalization Tag Set recommendation. Values are ltr (left-to-right embed),
                rtl (right-to-left embed), lro (left-to-right bidi-override), and rlo (right-to-left
                bidi-override). The default value is ltr. This type is typically used by
                applications that store text in left-to-right visual order rather than logical
                order. Such applications can use the lro value to better communicate with other
                applications that more fully support bidirectional text.`
	__Documentation__000562_text_direction_Inlined_Inlined.Source = ``
	__Documentation__000562_text_direction_Inlined_Inlined.Lang = ``

	__Documentation__000563_text_element_data_Inlined_Inlined.Name = `text-element-data_Inlined_Inlined`
	__Documentation__000563_text_element_data_Inlined_Inlined.Text = `The text-element-data type represents a syllable or portion of a
                syllable for lyric text underlay. A hyphen in the string content should only be used
                for an actual hyphenated word. Language names for text elements come from ISO 639,
                with optional country subcodes from ISO 3166.`
	__Documentation__000563_text_element_data_Inlined_Inlined.Source = ``
	__Documentation__000563_text_element_data_Inlined_Inlined.Lang = ``

	__Documentation__000564_tie_Inlined_Inlined.Name = `tie_Inlined_Inlined`
	__Documentation__000564_tie_Inlined_Inlined.Text = `The tie element indicates that a tie begins or ends with this note. If
                the tie element applies only particular times through a repeat, the time-only
                attribute indicates which times to apply it. The tie element indicates sound; the
                tied element indicates notation.`
	__Documentation__000564_tie_Inlined_Inlined.Source = ``
	__Documentation__000564_tie_Inlined_Inlined.Lang = ``

	__Documentation__000565_tied_type_Inlined_Inlined.Name = `tied-type_Inlined_Inlined`
	__Documentation__000565_tied_type_Inlined_Inlined.Text = `The tied-type type is used as an attribute of the tied element to
                specify where the visual representation of a tie begins and ends. A tied element
                which joins two notes of the same pitch can be specified with tied-type start on the
                first note and tied-type stop on the second note. To indicate a note should be
                undamped, use a single tied element with tied-type let-ring. For other ties that are
                visually attached to a single note, such as a tie leading into or out of a repeated
                section or coda, use two tied elements on the same note, one start and one stop. In
                start-stop cases, ties can add more elements using a continue type. This is
                typically used to specify the formatting of cross-system ties. When multiple
                elements with the same tag are used within the same note, their order within the
                MusicXML document should match the musical score order. For example, a note with a
                tie at the end of a first ending should have the tied element with a type of start
                precede the tied element with a type of stop.`
	__Documentation__000565_tied_type_Inlined_Inlined.Source = ``
	__Documentation__000565_tied_type_Inlined_Inlined.Lang = ``

	__Documentation__000566_tied_Inlined_Inlined.Name = `tied_Inlined_Inlined`
	__Documentation__000566_tied_Inlined_Inlined.Text = `The tied element represents the notated tie. The tie element
                represents the tie sound. The number attribute is rarely needed to disambiguate
                ties, since note pitches will usually suffice. The attribute is implied rather than
                defaulting to 1 as with most elements. It is available for use in more complex tied
                notation situations. Ties that join two notes of the same pitch together should be
                represented with a tied element on the first note with type="start" and a tied
                element on the second note with type="stop". This can also be done if the two notes
                being tied are enharmonically equivalent, but have different step values. It is not
                recommended to use tied elements to join two notes with enharmonically inequivalent
                pitches. Ties that indicate that an instrument should be undamped are specified with
                a single tied element with type="let-ring". Ties that are visually attached to only
                one note, other than undamped ties, should be specified with two tied elements on
                the same note, first type="start" then type="stop". This can be used to represent
                ties into or out of repeated sections or codas.`
	__Documentation__000566_tied_Inlined_Inlined.Source = ``
	__Documentation__000566_tied_Inlined_Inlined.Lang = ``

	__Documentation__000567_time_modification_Inlined_Inlined.Name = `time-modification_Inlined_Inlined`
	__Documentation__000567_time_modification_Inlined_Inlined.Text = `Time modification indicates tuplets, double-note tremolos, and other
                durational changes. A time-modification element shows how the cumulative, sounding
                effect of tuplets and double-note tremolos compare to the written note type
                represented by the type and dot elements. Nested tuplets and other notations that
                use more detailed information need both the time-modification and tuplet elements to
                be represented accurately.`
	__Documentation__000567_time_modification_Inlined_Inlined.Source = ``
	__Documentation__000567_time_modification_Inlined_Inlined.Lang = ``

	__Documentation__000568_time_only_Inlined_Inlined.Name = `time-only_Inlined_Inlined`
	__Documentation__000568_time_only_Inlined_Inlined.Text = `The time-only type is used to indicate that a particular playback- or
                listening-related element only applies particular times through a repeated section.
                The value is a comma-separated list of positive integers arranged in ascending
                order, indicating which times through the repeated section that the element applies.`
	__Documentation__000568_time_only_Inlined_Inlined.Source = ``
	__Documentation__000568_time_only_Inlined_Inlined.Lang = ``

	__Documentation__000569_time_relation_Inlined_Inlined.Name = `time-relation_Inlined_Inlined`
	__Documentation__000569_time_relation_Inlined_Inlined.Text = `The time-relation type indicates the symbol used to represent the
                interchangeable aspect of dual time signatures.`
	__Documentation__000569_time_relation_Inlined_Inlined.Source = ``
	__Documentation__000569_time_relation_Inlined_Inlined.Lang = ``

	__Documentation__000570_time_separator_Inlined_Inlined.Name = `time-separator_Inlined_Inlined`
	__Documentation__000570_time_separator_Inlined_Inlined.Text = `The time-separator type indicates how to display the arrangement
                between the beats and beat-type values in a time signature. The default value is
                none. The horizontal, diagonal, and vertical values represent horizontal, diagonal
                lower-left to upper-right, and vertical lines respectively. For these values, the
                beats and beat-type values are arranged on either side of the separator line. The
                none value represents no separator with the beats and beat-type arranged vertically.
                The adjacent value represents no separator with the beats and beat-type arranged
                horizontally.`
	__Documentation__000570_time_separator_Inlined_Inlined.Source = ``
	__Documentation__000570_time_separator_Inlined_Inlined.Lang = ``

	__Documentation__000571_time_signature_Inlined_Inlined.Name = `time-signature_Inlined_Inlined`
	__Documentation__000571_time_signature_Inlined_Inlined.Text = `Time signatures are represented by the beats element for the numerator
                and the beat-type element for the denominator.`
	__Documentation__000571_time_signature_Inlined_Inlined.Source = ``
	__Documentation__000571_time_signature_Inlined_Inlined.Lang = ``

	__Documentation__000572_time_symbol_Inlined_Inlined.Name = `time-symbol_Inlined_Inlined`
	__Documentation__000572_time_symbol_Inlined_Inlined.Text = `The time-symbol type indicates how to display a time signature. The
                normal value is the usual fractional display, and is the implied symbol type if none
                is specified. Other options are the common and cut time symbols, as well as a single
                number with an implied denominator. The note symbol indicates that the beat-type
                should be represented with the corresponding downstem note rather than a number. The
                dotted-note symbol indicates that the beat-type should be represented with a dotted
                downstem note that corresponds to three times the beat-type value, and a numerator
                that is one third the beats value.`
	__Documentation__000572_time_symbol_Inlined_Inlined.Source = ``
	__Documentation__000572_time_symbol_Inlined_Inlined.Lang = ``

	__Documentation__000573_time_Inlined_Inlined.Name = `time_Inlined_Inlined`
	__Documentation__000573_time_Inlined_Inlined.Text = `Time signatures are represented by the beats element for the numerator
                and the beat-type element for the denominator. The symbol attribute is used to
                indicate common and cut time symbols as well as a single number display. Multiple
                pairs of beat and beat-type elements are used for composite time signatures with
                multiple denominators, such as 2/4 + 3/8. A composite such as 3+2/8 requires only
                one beat/beat-type pair. The print-object attribute allows a time signature to be
                specified but not printed, as is the case for excerpts from the middle of a score.
                The value is "yes" if not present. The optional number attribute refers to staff
                numbers within the part. If absent, the time signature applies to all staves in the
                part.`
	__Documentation__000573_time_Inlined_Inlined.Source = ``
	__Documentation__000573_time_Inlined_Inlined.Lang = ``

	__Documentation__000574_timpani_Inlined_Inlined.Name = `timpani_Inlined_Inlined`
	__Documentation__000574_timpani_Inlined_Inlined.Text = `The timpani type represents the timpani pictogram. The smufl attribute
                is used to distinguish different SMuFL stylistic alternates.`
	__Documentation__000574_timpani_Inlined_Inlined.Source = ``
	__Documentation__000574_timpani_Inlined_Inlined.Lang = ``

	__Documentation__000575_tip_direction_Inlined_Inlined.Name = `tip-direction_Inlined_Inlined`
	__Documentation__000575_tip_direction_Inlined_Inlined.Text = `The tip-direction type represents the direction in which the tip of a
                stick or beater points, using Unicode arrow terminology.`
	__Documentation__000575_tip_direction_Inlined_Inlined.Source = ``
	__Documentation__000575_tip_direction_Inlined_Inlined.Lang = ``

	__Documentation__000576_top_bottom_Inlined_Inlined.Name = `top-bottom_Inlined_Inlined`
	__Documentation__000576_top_bottom_Inlined_Inlined.Text = `The top-bottom type is used to indicate the top or bottom part of a
                vertical shape like non-arpeggiate.`
	__Documentation__000576_top_bottom_Inlined_Inlined.Source = ``
	__Documentation__000576_top_bottom_Inlined_Inlined.Lang = ``

	__Documentation__000577_traditional_key_Inlined_Inlined.Name = `traditional-key_Inlined_Inlined`
	__Documentation__000577_traditional_key_Inlined_Inlined.Text = `The traditional-key group represents a traditional key signature using
                the cycle of fifths.`
	__Documentation__000577_traditional_key_Inlined_Inlined.Source = ``
	__Documentation__000577_traditional_key_Inlined_Inlined.Lang = ``

	__Documentation__000578_transpose_Inlined_Inlined.Name = `transpose_Inlined_Inlined`
	__Documentation__000578_transpose_Inlined_Inlined.Text = `The transpose group represents what must be added to a written pitch
                to get a correct sounding pitch.`
	__Documentation__000578_transpose_Inlined_Inlined.Source = ``
	__Documentation__000578_transpose_Inlined_Inlined.Lang = ``

	__Documentation__000579_transpose_Inlined_Inlined.Name = `transpose_Inlined_Inlined`
	__Documentation__000579_transpose_Inlined_Inlined.Text = `The transpose type represents what must be added to a written pitch to
                get a correct sounding pitch. The optional number attribute refers to staff numbers,
                from top to bottom on the system. If absent, the transposition applies to all staves
                in the part. Per-staff transposition is most often used in parts that represent
                multiple instruments.`
	__Documentation__000579_transpose_Inlined_Inlined.Source = ``
	__Documentation__000579_transpose_Inlined_Inlined.Lang = ``

	__Documentation__000580_tremolo_marks_Inlined_Inlined.Name = `tremolo-marks_Inlined_Inlined`
	__Documentation__000580_tremolo_marks_Inlined_Inlined.Text = `The number of tremolo marks is represented by a number from 0 to 8:
                the same as beam-level with 0 added.`
	__Documentation__000580_tremolo_marks_Inlined_Inlined.Source = ``
	__Documentation__000580_tremolo_marks_Inlined_Inlined.Lang = ``

	__Documentation__000581_tremolo_type_Inlined_Inlined.Name = `tremolo-type_Inlined_Inlined`
	__Documentation__000581_tremolo_type_Inlined_Inlined.Text = `The tremolo-type is used to distinguish double-note, single-note, and
                unmeasured tremolos.`
	__Documentation__000581_tremolo_type_Inlined_Inlined.Source = ``
	__Documentation__000581_tremolo_type_Inlined_Inlined.Lang = ``

	__Documentation__000582_tremolo_Inlined_Inlined.Name = `tremolo_Inlined_Inlined`
	__Documentation__000582_tremolo_Inlined_Inlined.Text = `The tremolo ornament can be used to indicate single-note, double-note,
                or unmeasured tremolos. Single-note tremolos use the single type, double-note
                tremolos use the start and stop types, and unmeasured tremolos use the unmeasured
                type. The default is "single" for compatibility with Version 1.1. The text of the
                element indicates the number of tremolo marks and is an integer from 0 to 8. Note
                that the number of attached beams is not included in this value, but is represented
                separately using the beam element. The value should be 0 for unmeasured tremolos.
                When using double-note tremolos, the duration of each note in the tremolo should
                correspond to half of the notated type value. A time-modification element should
                also be added with an actual-notes value of 2 and a normal-notes value of 1. If used
                within a tuplet, this 2/1 ratio should be multiplied by the existing tuplet ratio.
                The smufl attribute specifies the glyph to use from the SMuFL Tremolos range for an
                unmeasured tremolo. It is ignored for other tremolo types. The SMuFL buzzRoll glyph
                is used by default if the attribute is missing. Using repeater beams for indicating
                tremolos is deprecated as of MusicXML 3.0.`
	__Documentation__000582_tremolo_Inlined_Inlined.Source = ``
	__Documentation__000582_tremolo_Inlined_Inlined.Lang = ``

	__Documentation__000583_trill_beats_Inlined_Inlined.Name = `trill-beats_Inlined_Inlined`
	__Documentation__000583_trill_beats_Inlined_Inlined.Text = `The trill-beats type specifies the beats used in a trill-sound or
                bend-sound attribute group. It is a decimal value with a minimum value of 2.`
	__Documentation__000583_trill_beats_Inlined_Inlined.Source = ``
	__Documentation__000583_trill_beats_Inlined_Inlined.Lang = ``

	__Documentation__000584_trill_step_Inlined_Inlined.Name = `trill-step_Inlined_Inlined`
	__Documentation__000584_trill_step_Inlined_Inlined.Text = `The trill-step type describes the alternating note of trills and
                mordents for playback, relative to the current note.`
	__Documentation__000584_trill_step_Inlined_Inlined.Source = ``
	__Documentation__000584_trill_step_Inlined_Inlined.Lang = ``

	__Documentation__000585_tuning_Inlined_Inlined.Name = `tuning_Inlined_Inlined`
	__Documentation__000585_tuning_Inlined_Inlined.Text = `The tuning group contains the sequence of elements common to the
                staff-tuning and accord elements.`
	__Documentation__000585_tuning_Inlined_Inlined.Source = ``
	__Documentation__000585_tuning_Inlined_Inlined.Lang = ``

	__Documentation__000586_tuplet_dot_Inlined_Inlined.Name = `tuplet-dot_Inlined_Inlined`
	__Documentation__000586_tuplet_dot_Inlined_Inlined.Text = `The tuplet-dot type is used to specify dotted tuplet types.`
	__Documentation__000586_tuplet_dot_Inlined_Inlined.Source = ``
	__Documentation__000586_tuplet_dot_Inlined_Inlined.Lang = ``

	__Documentation__000587_tuplet_number_Inlined_Inlined.Name = `tuplet-number_Inlined_Inlined`
	__Documentation__000587_tuplet_number_Inlined_Inlined.Text = `The tuplet-number type indicates the number of notes for this portion
                of the tuplet.`
	__Documentation__000587_tuplet_number_Inlined_Inlined.Source = ``
	__Documentation__000587_tuplet_number_Inlined_Inlined.Lang = ``

	__Documentation__000588_tuplet_portion_Inlined_Inlined.Name = `tuplet-portion_Inlined_Inlined`
	__Documentation__000588_tuplet_portion_Inlined_Inlined.Text = `The tuplet-portion type provides optional full control over tuplet
                specifications. It allows the number and note type (including dots) to be set for
                the actual and normal portions of a single tuplet. If any of these elements are
                absent, their values are based on the time-modification element.`
	__Documentation__000588_tuplet_portion_Inlined_Inlined.Source = ``
	__Documentation__000588_tuplet_portion_Inlined_Inlined.Lang = ``

	__Documentation__000589_tuplet_type_Inlined_Inlined.Name = `tuplet-type_Inlined_Inlined`
	__Documentation__000589_tuplet_type_Inlined_Inlined.Text = `The tuplet-type type indicates the graphical note type of the notes
                for this portion of the tuplet.`
	__Documentation__000589_tuplet_type_Inlined_Inlined.Source = ``
	__Documentation__000589_tuplet_type_Inlined_Inlined.Lang = ``

	__Documentation__000590_tuplet_Inlined_Inlined.Name = `tuplet_Inlined_Inlined`
	__Documentation__000590_tuplet_Inlined_Inlined.Text = `A tuplet element is present when a tuplet is to be displayed
                graphically, in addition to the sound data provided by the time-modification
                elements. The number attribute is used to distinguish nested tuplets. The bracket
                attribute is used to indicate the presence of a bracket. If unspecified, the results
                are implementation-dependent. The line-shape attribute is used to specify whether
                the bracket is straight or in the older curved or slurred style. It is straight by
                default. Whereas a time-modification element shows how the cumulative, sounding
                effect of tuplets and double-note tremolos compare to the written note type, the
                tuplet element describes how this is displayed. The tuplet element also provides
                more detailed representation information than the time-modification element, and is
                needed to represent nested tuplets and other complex tuplets accurately. The
                show-number attribute is used to display either the number of actual notes, the
                number of both actual and normal notes, or neither. It is actual by default. The
                show-type attribute is used to display either the actual type, both the actual and
                normal types, or neither. It is none by default.`
	__Documentation__000590_tuplet_Inlined_Inlined.Source = ``
	__Documentation__000590_tuplet_Inlined_Inlined.Lang = ``

	__Documentation__000591_two_note_turn_Inlined_Inlined.Name = `two-note-turn_Inlined_Inlined`
	__Documentation__000591_two_note_turn_Inlined_Inlined.Text = `The two-note-turn type describes the ending notes of trills and
                mordents for playback, relative to the current note.`
	__Documentation__000591_two_note_turn_Inlined_Inlined.Source = ``
	__Documentation__000591_two_note_turn_Inlined_Inlined.Lang = ``

	__Documentation__000592_typed_text_Inlined_Inlined.Name = `typed-text_Inlined_Inlined`
	__Documentation__000592_typed_text_Inlined_Inlined.Text = `The typed-text type represents a text element with a type attribute.`
	__Documentation__000592_typed_text_Inlined_Inlined.Source = ``
	__Documentation__000592_typed_text_Inlined_Inlined.Lang = ``

	__Documentation__000593_unpitched_Inlined_Inlined.Name = `unpitched_Inlined_Inlined`
	__Documentation__000593_unpitched_Inlined_Inlined.Text = `The unpitched type represents musical elements that are notated on the
                staff but lack definite pitch, such as unpitched percussion and speaking voice. If
                the child elements are not present, the note is placed on the middle line of the
                staff. This is generally used with a one-line staff. Notes in percussion clef should
                always use an unpitched element rather than a pitch element.`
	__Documentation__000593_unpitched_Inlined_Inlined.Source = ``
	__Documentation__000593_unpitched_Inlined_Inlined.Lang = ``

	__Documentation__000594_up_down_stop_continue_Inlined_Inlined.Name = `up-down-stop-continue_Inlined_Inlined`
	__Documentation__000594_up_down_stop_continue_Inlined_Inlined.Text = `The up-down-stop-continue type is used for octave-shift elements,
                indicating the direction of the shift from their true pitched values because of
                printing difficulty.`
	__Documentation__000594_up_down_stop_continue_Inlined_Inlined.Source = ``
	__Documentation__000594_up_down_stop_continue_Inlined_Inlined.Lang = ``

	__Documentation__000595_up_down_Inlined_Inlined.Name = `up-down_Inlined_Inlined`
	__Documentation__000595_up_down_Inlined_Inlined.Text = `The up-down type is used for the direction of arrows and other pointed
                symbols like vertical accents, indicating which way the tip is pointing.`
	__Documentation__000595_up_down_Inlined_Inlined.Source = ``
	__Documentation__000595_up_down_Inlined_Inlined.Lang = ``

	__Documentation__000596_upright_inverted_Inlined_Inlined.Name = `upright-inverted_Inlined_Inlined`
	__Documentation__000596_upright_inverted_Inlined_Inlined.Text = `The upright-inverted type describes the appearance of a fermata
                element. The value is upright if not specified.`
	__Documentation__000596_upright_inverted_Inlined_Inlined.Source = ``
	__Documentation__000596_upright_inverted_Inlined_Inlined.Lang = ``

	__Documentation__000597_valign_image_Inlined_Inlined.Name = `valign-image_Inlined_Inlined`
	__Documentation__000597_valign_image_Inlined_Inlined.Text = `The valign-image type is used to indicate vertical alignment for
                images and graphics, so it does not include a baseline value. Defaults are
                implementation-dependent.`
	__Documentation__000597_valign_image_Inlined_Inlined.Source = ``
	__Documentation__000597_valign_image_Inlined_Inlined.Lang = ``

	__Documentation__000598_valign_Inlined_Inlined.Name = `valign_Inlined_Inlined`
	__Documentation__000598_valign_Inlined_Inlined.Text = `The valign type is used to indicate vertical alignment to the top,
                middle, bottom, or baseline of the text. If the text is on multiple lines, baseline
                alignment refers to the baseline of the lowest line of text. Defaults are
                implementation-dependent.`
	__Documentation__000598_valign_Inlined_Inlined.Source = ``
	__Documentation__000598_valign_Inlined_Inlined.Lang = ``

	__Documentation__000599_virtual_instrument_data_Inlined_Inlined.Name = `virtual-instrument-data_Inlined_Inlined`
	__Documentation__000599_virtual_instrument_data_Inlined_Inlined.Text = `Virtual instrument data can be part of either the score-instrument
                element at the start of a part, or an instrument-change element within a part.`
	__Documentation__000599_virtual_instrument_data_Inlined_Inlined.Source = ``
	__Documentation__000599_virtual_instrument_data_Inlined_Inlined.Lang = ``

	__Documentation__000600_virtual_instrument_Inlined_Inlined.Name = `virtual-instrument_Inlined_Inlined`
	__Documentation__000600_virtual_instrument_Inlined_Inlined.Text = `The virtual-instrument element defines a specific virtual instrument
                used for an instrument sound.`
	__Documentation__000600_virtual_instrument_Inlined_Inlined.Source = ``
	__Documentation__000600_virtual_instrument_Inlined_Inlined.Lang = ``

	__Documentation__000601_voice_Inlined_Inlined.Name = `voice_Inlined_Inlined`
	__Documentation__000601_voice_Inlined_Inlined.Text = `A voice is a sequence of musical events (e.g. notes, chords, rests)
                that proceeds linearly in time. The voice element is used to distinguish between
                multiple voices in individual parts. It is defined within a group due to its
                multiple uses within the MusicXML schema.`
	__Documentation__000601_voice_Inlined_Inlined.Source = ``
	__Documentation__000601_voice_Inlined_Inlined.Lang = ``

	__Documentation__000602_wait_Inlined_Inlined.Name = `wait_Inlined_Inlined`
	__Documentation__000602_wait_Inlined_Inlined.Text = `The wait type specifies a point where the accompaniment should wait
                for a performer event before continuing. This typically happens at the start of new
                sections or after a held note or indeterminate music. These waiting points cannot
                always be inferred reliably from the contents of the displayed score. The optional
                player and time-only attributes restrict the type to apply to a single player or set
                of times through a repeated section, respectively.`
	__Documentation__000602_wait_Inlined_Inlined.Source = ``
	__Documentation__000602_wait_Inlined_Inlined.Lang = ``

	__Documentation__000603_wavy_line_Inlined_Inlined.Name = `wavy-line_Inlined_Inlined`
	__Documentation__000603_wavy_line_Inlined_Inlined.Text = `Wavy lines are one way to indicate trills and vibrato. When used with
                a barline element, they should always have type="continue" set. The smufl attribute
                specifies a particular wavy line glyph from the SMuFL Multi-segment lines range.`
	__Documentation__000603_wavy_line_Inlined_Inlined.Source = ``
	__Documentation__000603_wavy_line_Inlined_Inlined.Lang = ``

	__Documentation__000604_wedge_type_Inlined_Inlined.Name = `wedge-type_Inlined_Inlined`
	__Documentation__000604_wedge_type_Inlined_Inlined.Text = `The wedge type is crescendo for the start of a wedge that is closed at
                the left side, diminuendo for the start of a wedge that is closed on the right side,
                and stop for the end of a wedge. The continue type is used for formatting wedges
                over a system break, or for other situations where a single wedge is divided into
                multiple segments.`
	__Documentation__000604_wedge_type_Inlined_Inlined.Source = ``
	__Documentation__000604_wedge_type_Inlined_Inlined.Lang = ``

	__Documentation__000605_wedge_Inlined_Inlined.Name = `wedge_Inlined_Inlined`
	__Documentation__000605_wedge_Inlined_Inlined.Text = `The wedge type represents crescendo and diminuendo wedge symbols. The
                type attribute is crescendo for the start of a wedge that is closed at the left
                side, and diminuendo for the start of a wedge that is closed on the right side.
                Spread values are measured in tenths; those at the start of a crescendo wedge or end
                of a diminuendo wedge are ignored. The niente attribute is yes if a circle appears
                at the point of the wedge, indicating a crescendo from nothing or diminuendo to
                nothing. It is no by default, and used only when the type is crescendo, or the type
                is stop for a wedge that began with a diminuendo type. The line-type is solid if not
                specified.`
	__Documentation__000605_wedge_Inlined_Inlined.Source = ``
	__Documentation__000605_wedge_Inlined_Inlined.Lang = ``

	__Documentation__000606_winged_Inlined_Inlined.Name = `winged_Inlined_Inlined`
	__Documentation__000606_winged_Inlined_Inlined.Text = `The winged attribute indicates whether the repeat has winged
                extensions that appear above and below the barline. The straight and curved values
                represent single wings, while the double-straight and double-curved values represent
                double wings. The none value indicates no wings and is the default.`
	__Documentation__000606_winged_Inlined_Inlined.Source = ``
	__Documentation__000606_winged_Inlined_Inlined.Lang = ``

	__Documentation__000607_wood_value_Inlined_Inlined.Name = `wood-value_Inlined_Inlined`
	__Documentation__000607_wood_value_Inlined_Inlined.Text = `The wood-value type represents pictograms for wood percussion
                instruments. The maraca and maracas values distinguish the one- and two-maraca
                versions of the pictogram.`
	__Documentation__000607_wood_value_Inlined_Inlined.Source = ``
	__Documentation__000607_wood_value_Inlined_Inlined.Lang = ``

	__Documentation__000608_wood_Inlined_Inlined.Name = `wood_Inlined_Inlined`
	__Documentation__000608_wood_Inlined_Inlined.Text = `The wood type represents pictograms for wood percussion instruments.
                The smufl attribute is used to distinguish different SMuFL stylistic alternates.`
	__Documentation__000608_wood_Inlined_Inlined.Source = ``
	__Documentation__000608_wood_Inlined_Inlined.Lang = ``

	__Documentation__000609_work_Inlined_Inlined.Name = `work_Inlined_Inlined`
	__Documentation__000609_work_Inlined_Inlined.Text = `Works are optionally identified by number and title. The work type
                also may indicate a link to the opus document that composes multiple scores into a
                collection.`
	__Documentation__000609_work_Inlined_Inlined.Source = ``
	__Documentation__000609_work_Inlined_Inlined.Lang = ``

	__Documentation__000610_yes_no_number_Inlined_Inlined.Name = `yes-no-number_Inlined_Inlined`
	__Documentation__000610_yes_no_number_Inlined_Inlined.Text = `The yes-no-number type is used for attributes that can be either
                boolean or numeric values.`
