	__Documentation__000610_yes_no_number_Inlined_Inlined.Lang = ``

	__Documentation__000611_yes_no_Inlined_Inlined.Name = `yes-no_Inlined_Inlined`
	__Documentation__000611_yes_no_Inlined_Inlined.Text = `The yes-no type is used for boolean-like attributes. We cannot use W3C
                XML Schema booleans due to their restrictions on expression of boolean values.`
